INSERT INTO public.category_texts VALUES (4, 1, 'Board & Puzzle', '<p><strong>Board and Puzzle</strong> games are games for everyone. These free web games are an awesome way to get some quick entertainment while you still have to think a bit. But. don''t underestimate them. Some of the games will require you to do some logical thinking, and some will even challenge you to the fullest.</p><p><br></p><p>We have different types of online puzzle games on vediagames.com that will provide you with endless entertainment. Some of the games might actually teach you something that you didn''t know before- Puzzle games are also great for sharpening up your thinking which will prove very useful when you have to do some tasks later that require you to think and focus.</p><p><br></p><p>The best online board and puzzle games that you can play on vediagames.com are:</p><ul><li><a href="https://vediagames.com/game/skribbl-io" rel="noopener noreferrer" target="_blank">Skribbl.io</a></li><li><a href="https://vediagames.com/game/city-blocks-1" rel="noopener noreferrer" target="_blank">City Blocks</a></li><li><a href="https://vediagames.com/filter?title=Mahjong&amp;params=eyJ0YWdzIjpbMjNdfQ==" rel="noopener noreferrer" target="_blank">All free online mahjong games</a></li><li><a href="https://vediagames.com/game/merge-to-million" rel="noopener noreferrer" target="_blank">Merge to million - game like 2048 but million</a></li><li><a href="https://vediagames.com/filter?title=Board%20&amp;%20Puzzle&amp;params=eyJjYXRlZ29yaWVzIjpbNF19" rel="noopener noreferrer" target="_blank">And much much more!</a></li></ul><p><br></p><p>At vediagames.com you''ll find only the best online and free puzzle/board games that will entertain you. </p>', '', '');
INSERT INTO public.category_texts VALUES (6, 1, 'Sports', '<p>Sports games are free online web games where you play some sort of sports game. That is pretty much it, to be honest. We have one of the best sports games available for you to enjoy. Many sports web games support two-player game modes where you compete with another player. Or if you don''t wish to do that, there is usually a game mode where you play against bots.</p><p><br></p><p>Play these types of sports games on vediagames.com:</p><ul><li><a href="https://vediagames.com/filter?title=Ball&amp;params=eyJ0YWdzIjpbNDRdfQ==" rel="noopener noreferrer" target="_blank">Ball games</a></li><li><a href="https://vediagames.com/tag/40?slug=boxing&amp;name=Boxing" rel="noopener noreferrer" target="_blank">Boxing games</a></li><li><a href="https://vediagames.com/tag/31?slug=racing&amp;name=Racing" rel="noopener noreferrer" target="_blank">Racing games</a></li><li><a href="https://vediagames.com/tag/38?slug=soccer&amp;name=Soccer" rel="noopener noreferrer" target="_blank">Soccer games</a></li><li><a href="https://vediagames.com/tag/39?slug=basketball&amp;name=Basketball" rel="noopener noreferrer" target="_blank">Basketball games</a></li></ul>', '', '');
INSERT INTO public.category_texts VALUES (10, 1, 'Driving', '<p>vediagames.com features one of the best online web driving games. There is a variety of different driving games available on veidagames.com that you can play. You''ll be able to find something you like in no time! If you like slow-paced driving games, you can try our <a href="https://vediagames.com/tag/47?slug=truck&amp;name=Truck" rel="noopener noreferrer" target="_blank">truck games</a> which are usually some sort of online simulators. If you like fast-paced racing web games, you can check out our collection of <a href="https://vediagames.com/tag/31?slug=racing&amp;name=Racing" rel="noopener noreferrer" target="_blank">racing games</a>. If you just want to drive cool cars, check out our <a href="https://vediagames.com/tag/46?slug=car&amp;name=Car" rel="noopener noreferrer" target="_blank">car games</a> collection.</p><p><br></p><p>Some of the driving games that you will 100% like are:</p><ul><li><a href="https://vediagames.com/search?q=Moto%20X3M&amp;sort=relevancy" rel="noopener noreferrer" target="_blank">Moto X3M saga - super entertaining and challenging driving motocross games</a></li><li><a href="https://vediagames.com/game/indian-tractor-farm-simulator" rel="noopener noreferrer" target="_blank">Indian Tractor Farm Simulator - altogether very chill game</a></li><li><a href="https://vediagames.com/game/drift-car-racing" rel="noopener noreferrer" target="_blank">Drift Car Racing - cool cars, drifting, open world, sign me in!</a></li></ul>', '', '');
INSERT INTO public.category_texts VALUES (11, 1, 'Adventure', '<p>Adventure games are free online web games where you''re thrown into a fictional world. You can explore this world, build up your character and story, and have tons of fun. </p>', '', '');
INSERT INTO public.category_texts VALUES (1, 1, 'Shooting', '<p>Shooting games are games where you usually shoot some projectiles from your weapons to destroy the opponent entity. They can be super fun and very addicting. You can play one of the best free online web-shooters right here on this platform! We feature only the best shooting games that we ourselves enjoy and play.</p><p><br></p><h3>Some subcategories of shooting games are:</h3><ul><li><strong>FPS</strong> - first-person shooter where you control the character from a first perspective, we have one of the best free FPS online web games here</li><li><strong>Third-person shooters</strong> - shooting games where you control a character in a third perspective</li><li><strong>Arcade shooters</strong> - simple, fun, and very addicting shooter games that are usually cartoonish and where you have to destroy some entities to progress the level</li></ul><p><br></p><h3>Research shows that shooting games improve:</h3><ul><li>Cognitive abilities and learning skills</li><li>Spatial focus, spatial reasoning</li><li>Visual acuity and decision-making.</li></ul><p><br></p><h3>Most popular shooting games:</h3><ul><li><a href="https://vediagames.com/game/krunker-io" rel="noopener noreferrer" target="_blank">krunker.io</a></li><li><a href="https://vediagames.com/game/kirka-io" rel="noopener noreferrer" target="_blank">kirka.io</a></li></ul><p><br></p>', '', '');
INSERT INTO public.category_texts VALUES (2, 1, '.io', '<p><strong>.io</strong> <strong>games</strong> are free to play, casual, web, and online games with very few mechanisms and minimalistic graphics. They are super fun little games that can entertain you for hours upon hours! <strong>.io games</strong> are one of the most popular games on the web due to their availability and accessibility.</p><p><br></p><h3>Core <strong>.io</strong> game mechanics</h3><ul><li>Player vs player</li><li>Fast-paced gameplay</li><li>Easy to learn, difficult to master</li><li>Beginner-friendly - casual games</li><li>Everyone can defeat everyone else</li></ul><p><br></p><h3>The most popular .io games are:</h3><ul><li><a href="https://agar.io" rel="noopener noreferrer" target="_blank">agar.io</a></li><li><a href="https://slither.io" rel="noopener noreferrer" target="_blank">slither.io</a></li><li><a href="https://wings.io" rel="noopener noreferrer" target="_blank">wings.io</a></li><li><a href="https://diep.io" rel="noopener noreferrer" target="_blank">diep.io</a></li><li><a href="https://vediagames.com/game/krunker-io" rel="noopener noreferrer" target="_blank">krunker.io</a></li></ul><p><br></p><p>There are many varieties of <strong>.io</strong> games, so you''ll most likely find what you''re looking for in this category.</p>', '', '');
INSERT INTO public.category_texts VALUES (5, 1, 'Multiplayer', '<p>Multiplayer games are online web games where you can play with other players. Other players can be from other countries and continents or they can be your buddies/schoolmates. Free to play online multiplayer games allow you to compete with other players or work with them to complete common objectives. </p><p><br></p><p>Playing games with other people is incredibly fun and entertaining that''s why we at vediagames.com focus to bring you only the best web online multiplayer games that you can enjoy together with your buddies. Most of the games will allow you to play on a single keyboard and you''ll have to solve some puzzles. But some will have you compete against each other.</p><p><br></p><p>One of the best and most entertaining multiplayer web game are;</p><ul><li><a href="https://vediagames.com/game/football-legends-2021" rel="noopener noreferrer" target="_blank">Football Legends 2021</a></li><li><a href="https://vediagames.com/game/ubisoft-all-star-blast" rel="noopener noreferrer" target="_blank">Ubisoft All Star Blast - Bomberman-like online web io game</a></li><li><a href="https://vediagames.com/search?q=fireboy%20and%20watergirl&amp;sort=relevancy" rel="noopener noreferrer" target="_blank">Fireboy and watergirl saga - a true classic free two-player web game that will provide you with hours upon hours of entertainment</a></li><li><a href="https://www.twoplayergames.org/" rel="noopener noreferrer" target="_blank">Twoplayergames.org - an awesome collection of two-player games</a></li></ul><p><br></p><p>Play the best multiplayer online web games on vediagames.com  </p>', '', '');
INSERT INTO public.category_texts VALUES (12, 1, 'Beauty', '<p>Beauty and make-up games allow you to fully customize your selected characters with the latest fashion items. </p>', '', '');
INSERT INTO public.category_texts VALUES (13, 1, 'Arcade', '<p>vediagames.com has one of the best selections of free online web arcade games that you can find. These games will truly entertain you forever. </p>', '', '');
