INSERT INTO public.game_texts VALUES (1, 2, 'Ninja Rabbit', 'Ninja Rabbit es un superhéroe. Un día, el monstruo se llevó a los niños del pueblo. Teniendo en cuenta las expectativas de los aldeanos, el conejo ninja partió con determinación y se embarcó en un viaje para luchar contra los monstruos.', '', 'Salva a todos los niños del pueblo con tu fuerza ninja.', '<ul><li>¡Haz clic para lanzar el Shuriken!</li></ul>', '');
INSERT INTO public.game_texts VALUES (3, 1, 'The Mergest Kingdom', 'Do you believe in fairytales? How else would you explain the story that is about to unfold!Merge together hundreds of objects in a land full of challenging quests, collect and harvest resources, design your own island by making it look the way YOU want it! Find the best ways to match and merge various pieces to erect the biggest buildings and cultivate the most fruitful plants! Help rebuild the Mergest Kingdom and make it the most magical one in the Seventh Realm!What is The Mergest Kindom like?YOUR WORLD! Only here can you find the most amazing objects that you will ever merge! YOUR CHOICE! You can merge dragons, trees, gems, and virtually anything you find on your journey of discovery! YOUR RULES! The islands full of merge magic and merge craft enabling you to make the biggest merges the way YOU want!Quests and challengesTake part in DAILY QUESTS to collect coins and gems, Mine various RESOURCES to build, Explore vast MAGIC territories full of mysterious creatures, bedazzling characters, and captivating objects populating this infinite world!If you love merge games this mergical experience is going to be a perfect fit for you!', '', 'Merge and combine pieces to save and upgrade the Kingdom!', '<ul><li>Click and drag to m<span style="color: rgb(0, 0, 0);">erge and combine pieces.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (3, 2, 'The Mergest Kingdom', '¿Usted cree en los cuentos de hadas? ¡De qué otra manera explicarías la historia que está a punto de desarrollarse! ¡Combina cientos de objetos en una tierra llena de misiones desafiantes, recolecta y cosecha recursos, diseña tu propia isla haciéndola lucir como TÚ quieres! ¡Encuentra las mejores formas de combinar y fusionar varias piezas para erigir los edificios más grandes y cultivar las plantas más fructíferas! ¡Ayuda a reconstruir Mergest Kingdom y conviértelo en el más mágico del Séptimo Reino! ¿Cómo es The Mergest Kingdom? ¡TU MUNDO! ¡Solo aquí puedes encontrar los objetos más sorprendentes que jamás fusionarás! ¡TU ELECCIÓN! ¡Puedes fusionar dragones, árboles, gemas y prácticamente cualquier cosa que encuentres en tu viaje de descubrimiento! ¡TUS REGLAS! ¡Las islas llenas de magia de fusión y artesanía de fusión que te permiten hacer las fusiones más grandes de la manera que TÚ quieras! Misiones y desafíos Participa en MISIONES DIARIAS para recolectar monedas y gemas, Extrae varios RECURSOS para construir, Explora vastos territorios MÁGICOS llenos de criaturas misteriosas, deslumbrantes ¡Personajes y objetos cautivadores que pueblan este mundo infinito! ¡Si te encantan los juegos de combinación, esta experiencia mágica será perfecta para ti!', '', ' ¡Combina y combina piezas para salvar y mejorar el Reino!', '<ul><li>Haga clic y arrastre para fusionar y combinar piezas.</li></ul>', '');
INSERT INTO public.game_texts VALUES (4, 1, 'Scatty Maps Europe', 'Test your Europe geography knowledge by playing this fun little puzzle game. It has two different game modes - easy and hard, that you can do at your own pace. ', '', 'Educational geography game in which you have to guess countries in europe.', '<ul><li>Click or touch and drag country pieces and place them on the map of Europe</li></ul>', '');
INSERT INTO public.game_texts VALUES (4, 2, 'Scatty Maps Europe', 'Pon a prueba tus conocimientos de geografía europea jugando a este divertido juego corto. Tiene dos modos de juego diferentes, fácil y difícil, que puedes hacer a tu propio ritmo.', '', 'Juego educativo de geografía en el que debes adivinar los países de Europa.', '<ul><li>Haga clic o toque y arrastre piezas de países y colóquelas en el mapa de Europa</li></ul>', '');
INSERT INTO public.game_texts VALUES (5, 1, 'Little Animals Coloring', 'What can you do if we give you a magic brush and a magic paint? Do you trust your abilities? Cute animals are waiting for you to add color to their lives, don''t make them wait any longer, click now to start the adventure!', '', 'A satisfying coloring game with different animals to color.', '<ul><li>Left click or touch</li></ul>', '');
INSERT INTO public.game_texts VALUES (5, 2, 'Little Animals Coloring', '¿Qué puedes hacer si te damos un pincel mágico y una pintura mágica? ¿Confía en sus habilidades? Los animales lindos están esperando para que usted agregue color a sus vidas, no los haga esperar más, haga clic ahora para comenzar la aventura!', '', 'Un juego de coloración satisfactorio con diferentes animales para colorear.', '', '');
INSERT INTO public.game_texts VALUES (6, 1, 'Virtual families cook-off', 'Fire up the grill, mix your marinades, become a chef and start your very own Cook-Off now! Manage your time to beat the dinner dash and dish out the delicious, from pizza to burgers, sushi and cupcakes and so much more!', '', 'Cook and serve different dishes to your customers.', '<ul><li><span style="color: rgb(0, 0, 0);">Tap or click to cook for and serve your guests!</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (6, 2, 'Virtual families cook-off', 'Encienda la parrilla, mezcle sus adobas, conviértase en chef y comience su propia cocina ahora mismo. ¡Congestiona tu tiempo para superar el guión de la cena y disfrutar de los deliciosos platos, desde pizza hasta hamburguesas, sushi y pastelitos y mucho más!', '', 'Cocina y sirve diferentes platos a tus clientes.', '<ul><li>¡Toca o haz clic para cocinar y servir a tus invitados!</li></ul>', '');
INSERT INTO public.game_texts VALUES (7, 1, 'Julias Food Truck', 'Help Julia run her burger food truck. Her goal is to prepare the most delicious burgers. Her little food truck is constantly visited by hungry customers. Each customer approaches the food truck and orders his favorite burger. Julia has very little time to prepare the meal, but if she manages to do that quickly, customers are very generous.', '', 'Cook and serve your customers!', '<ul><li><span style="color: rgb(0, 0, 0);">Tap or click on the ingredients shown on the screen to add it to the burger. Follow the client''s order to earn money. You need to tap on the coins left by the customer to collect it.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (7, 2, 'Julias Food Truck', 'Ayuda a Julia a dirigir su camión de comida de hamburguesas. Su objetivo es preparar las hamburguesas más deliciosas. Su pequeño camión de comida es constantemente visitado por clientes hambrientos. Cada cliente se acerca al camión de comida y pide su hamburguesa favorita. Julia tiene muy poco tiempo para preparar la comida, pero si logra hacerlo rápidamente, los clientes son muy generosos.', '', '¡Cocina y atiende a tus clientes!', '<ul><li>Toque o haga clic en los ingredientes que se muestran en la pantalla para agregarlo a la hamburguesa. Siga la orden del cliente para ganar dinero. Debe tocar las monedas dejadas por el cliente para recogerlo.</li></ul>', '');
INSERT INTO public.game_texts VALUES (9, 1, 'Sherwood Shooter ', 'Try to shoot the Apple from your friends head safely, without hitting him by accident!', '', 'Try to shoot the apple, without hitting your friend.', '<ul><li>Aim with your mouse or finger. Release mouse/finger to shoot.</li></ul>', '');
INSERT INTO public.game_texts VALUES (9, 2, 'Sherwood Shooter ', '¡Intenta disparar a la Manzana desde la cabeza de tus amigos de forma segura, sin golpearlo por accidente!', '', 'Intenta disparar a la manzana, sin golpear a tu amigo.', '<ul><li>Apunta con el ratón o el dedo. Suelte el ratón/dedo para disparar.</li></ul>', '');
INSERT INTO public.game_texts VALUES (51, 2, 'Basketball with buddies', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (52, 2, 'Dunkers Fight 2P', '', '', '', '<p><br></p>', '');
INSERT INTO public.game_texts VALUES (10, 1, 'BatGirl Dress Up', 'The beautiful batwoman is batman''s girlfriend. Batwoman is getting ready for her date tonight. She can''t decide which costume to wear. Can you help batwoman to choose a costume?', '', 'Dress the model as you wish.', '<ul><li>Click or tap on the menu items to change what the model wears.</li></ul>', '');
INSERT INTO public.game_texts VALUES (10, 2, 'BatGirl Dress Up', 'La hermosa batwoman es la novia de Batman. Batwoman se está preparando para su cita de esta noche. Ella no puede decidir qué disfraz usar. ¿Puedes ayudar a batwoman a elegir un disfraz?', '', 'Viste al modelo como desees.', '<ul><li>Haga clic o toque en los elementos del menú para cambiar lo que usa el modelo.</li></ul>', '');
INSERT INTO public.game_texts VALUES (11, 1, 'Smiling glass 2', 'Smilling Glass 2 is a game in which you need to fill a glass with water. Filling the glass with water can be very difficult, you need to avoid obstacles, spikes and more. FIll the specified amount of water in the glass to win the level.', '', 'Fill the glass with water without wasting it to win the level.', '<ul><li>Click/Tap and hold for water to run.</li></ul>', '');
INSERT INTO public.game_texts VALUES (11, 2, 'Smiling glass 2', 'Smilling Glass 2 es un juego en el que necesitas llenar un vaso con agua. Llenar el vaso con agua puede ser muy difícil, debe evitar obstáculos, picos y más. Utilice la cantidad especificada de agua en el vaso para ganar el nivel.', '', 'Llena el vaso con agua sin desperdiciarla para ganar el nivel.', '<ul><li>Haga clic / toque y mantenga presionado para que el agua corra.</li></ul>', '');
INSERT INTO public.game_texts VALUES (8, 1, 'Baby Hazel African Safari', '<p>Baby Hazel and her parents along with Bruno have gone on holiday to South Africa. After experiencing the beautiful scenic of Cape Town, they have decided to spend a night in the jungle safari tent. </p><p><br></p><p>Isn''t that exciting? Do you want to be part of this jungle adventure? Join Baby Hazel and her family and taste the wilderness of the Jungle.</p>', '', 'Join Baby Hazel in a jungle adventure!', '<ul><li><span style="color: rgb(0, 0, 0);">Click or tap/Drag to interact with Baby Hazel.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (8, 2, 'Baby Hazel African Safari', '<p>Baby Hazel y sus padres junto con Bruno se han ido de vacaciones a Sudáfrica. Después de experimentar el hermoso paisaje de Ciudad del Cabo, han decidido pasar una noche en la tienda de safari en la jungla. </p><p><br></p><p>¿No es emocionante? ¿Quieres ser parte de esta aventura en la selva? Únase a Baby Hazel y su familia y pruebe el desierto de la jungla.</p>', '', '¡Únete a Baby Hazel en una aventura en la jungla!', '<ul><li>Haz clic o pulsa o arrastra para interactuar con Baby Hazel.</li></ul>', '');
INSERT INTO public.game_texts VALUES (13, 1, 'Falling Lovers', 'Falling Lovers is an interesting game for skills. Rotate the blocks that the boyfriend is on for him to fall on his love. Click/Tap and hold to rotate the Block. Have fun!', '', 'Rotate the blocks so the boyfriend can get to his love.', '<ul><li>Click/Tap and drag to rotate the Block.</li></ul>', '');
INSERT INTO public.game_texts VALUES (13, 2, 'Falling Lovers', 'Falling Lovers es un juego interesante para las habilidades. Gira los bloques en los que está el novio para que caiga sobre su amor. Haga clic/Pulse y mantenga presionado para girar el Bloque. ¡Que te diviertas!', '', 'Gira los bloques para que el novio pueda llegar a su amor.', '<ul><li>Haga clic/Toque y arrastre para girar el bloque.</li></ul>', '');
INSERT INTO public.game_texts VALUES (14, 1, 'Skydom', 'Welcome to the magical high kingdoms! Skydom is a bright and exciting puzzle with truly unique game modes! Went through thousands of different match-3 levels and want something refreshing? Have a look inside ... Only in Skydom you can face-off with different players to determine the best at match 3! Show off your skill against real opponents or connect with friends in live Match-3 action on hundreds of levels with unique settings, gorgeous effects and unexpected turns.', '', 'A satisfying match-3 with lots of levels.', '<ul><li><span style="color: rgb(0, 0, 0);">Match 3 pieces of the same color by swapping adjacent ones!</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (14, 2, 'Skydom', '¡Bienvenido a los mágicos reinos altos! ¡Skydom es un rompecabezas brillante y emocionante con modos de juego verdaderamente únicos! ¿Pasaste por miles de niveles diferentes de match-3 y quieres algo refrescante? Echa un vistazo al interior... ¡Solo en Skydom puedes enfrentarte a diferentes jugadores para determinar los mejores en el partido 3! Muestra tu habilidad contra oponentes reales o conéctate con amigos en acción en vivo de Match-3 en cientos de niveles con escenarios únicos, efectos magníficos y turnos inesperados.', '', 'Un match-3 satisfactorio con muchos niveles.', '<ul><li>¡Combina 3 piezas del mismo color intercambiando las adyacentes!</li></ul>', '');
INSERT INTO public.game_texts VALUES (15, 2, 'Solitaire Farm: Seasons', '<p>Solitaire Farm: Seasons, el clásico juego de cartas de solitario que te permite entrenar tu cerebro con diferentes rompecabezas de solitario mientras disfrutas de la belleza de la vida en el campo. </p><p><br></p><p>¿Te encantan los juegos de cartas de solitario clásico como Tri Peaks Solitaire, Pyramid Solitaire, Freecell Solitaire, Spider Solitaire y Klondike Solitaire, o eres nuevo en los juegos de cartas gratis? De cualquier manera, ¡tu viaje a través de Solitaire Farm: Seasons será el rompecabezas perfecto para tu cerebro! </p><p><br></p><p>ASPECTOS DESTACADOS de Solitaire Farm: Seasons ♥ ️ ¡Juega, planta y cosecha los cultivos de tu granja! ♠ ️ ¡Más de 2000 niveles diferentes de solitario! ♦ ️ ¡Modos de juego emocionantes y misiones diarias! </p><p><br></p><p>¿Nunca jugaste al Solitario ni a ningún juego de cartas antes? ¡Sin preocupaciones! ¡Simplemente complete un tutorial de sorteo de cartas y aprenderá a jugar este juego de cartas de solitario tri picos en unos minutos! ¡El juego te ayudará a entrenar tu cerebro y aumentar tu coeficiente intelectual mientras exploras países lejanos, plantas exóticas, hermosos paisajes y grandes monumentos desde la comodidad de tu hogar!</p>', '', 'Juega un buen juego de solitario.', '<ul><li>Haga clic / toque en las tarjetas.</li></ul>', '');
INSERT INTO public.game_texts VALUES (16, 1, 'Dead Fight', 'The fighters of the blue and red team fight each other in a mysterious arena. The challenge is to break the energy stone of the opposing team or kill the players of the opposing team''s team. If you can hack the opponent''s PC, it gives you extra power to break the special stone. You must move fast in the arena and neutralize your opponent. Dead fight can be played with both single player and two players. Have fun.', '', 'Win by either killing the opposing team or by hacking their computer.', '<ul><li>AWD - to move</li><li>Tab - to switch characters</li><li>CTRL - to hack computer</li><li>Spacebar - to attack</li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span>⬆️➡️ - to move</li><li>K - to attack</li><li>L - to hack computer</li></ul>');
INSERT INTO public.game_texts VALUES (22, 1, 'Ubisoft All Star Blast', '<p>"All Star Blast" is the unique UBISOFT-crossover arcade game, that propels players into king-size multiplayer maps filled with legendary Ubisoft games references, where they can compete in varied hilarious &amp; energetic mini-games inspired by classic arcade games with up to 100 players, and unlock characters, skills and skins to develop a collection of powerful Ubisoft classic characters.</p>', '', 'Avoid bombs at all costs playing as your favorite Ubisoft characters.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span>⬆️➡️ - to move</li><li>Spacebar - to place bomb</li></ul>', '');
INSERT INTO public.game_texts VALUES (12, 1, 'Indian Tractor Farm Simulator', '<p>Become a modern farmer in Indian Tractor Farm Simulator! Immerse yourself in a huge open world and harvest many types of crops, take care of your livestock - cows, sheep, and pigs - take part in forestry, and sell your products on a dynamic market to expand your farm!</p><p><br></p><p>Indian Tractor farm Simulator is a 3D game that you can play online in your browser. It allows you to go on a farming adventure and build up your own virtual farm! There are also upgrades that you can buy which will help you be more efficient and make even a larger farm!</p>', '', 'A web 3D game that allows you to build your own virtual farm. ', '<ul><li>W or ⬆️ to move forward</li><li>D or ➡️ to move right</li><li>S or ⬇️ to move backward</li><li>A or ⬅️ to move left</li></ul>', '');
INSERT INTO public.game_texts VALUES (12, 2, 'Indian Tractor Farm Simulator', '<p>¡Conviértete en un granjero moderno en Indian Tractor Farm Simulator! Sumérjase en un enorme mundo abierto y coseche muchos tipos de cultivos, cuide su ganado (vacas, ovejas y cerdos), participe en la silvicultura y venda sus productos en un mercado dinámico para expandir su granja.</p><p><br></p><p>Indian Tractor farm Simulator es un juego 3D que puedes jugar en línea en tu navegador. ¡Te permite emprender una aventura agrícola y construir tu propia granja virtual! ¡También hay mejoras que puedes comprar que te ayudarán a ser más eficiente y hacer una granja aún más grande!</p>', '', 'Un juego web 3D que te permite construir tu propia granja virtual.', '<ul><li>W o ⬆️ para avanzar</li><li>D o ➡️ para moverse a la derecha</li><li>S o ⬇️ para retroceder</li><li>A o ⬅️ para moverse a la izquierda</li></ul>', '');
INSERT INTO public.game_texts VALUES (16, 2, 'Dead Fight', 'Los luchadores del equipo azul y rojo luchan entre sí en una arena misteriosa. El desafío es romper la piedra de energía del equipo contrario o matar a los jugadores del equipo del equipo contrario. Si puedes hackear la PC del oponente, te da poder adicional para romper la piedra especial. Debes moverte rápido en la arena y neutralizar a tu oponente. Dead fight se puede jugar tanto con un jugador como con dos jugadores. Que te diviertas.', '', 'Gana matando al equipo contrario o hackeando su computadora.', '<ul><li>AWD - para mover&nbsp;</li><li>TAB - para cambiar los caracteres&nbsp;</li><li>CTRL - para hackear la computadora</li><li>Spacebar - para atacar</li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span>⬆️➡️ - para mover</li><li><span style="color: rgba(0, 0, 0, 0.88);">K - para atacar&nbsp;</span></li><li><span style="color: rgba(0, 0, 0, 0.88);">L - hackear la computadora</span></li></ul>');
INSERT INTO public.game_texts VALUES (17, 1, 'Break The Brick', 'Are you strong enough to break the brick? Break Brick is a game about a karate master, who is testing his power and breath controls by breaking a brick. If he is quick and concentrated, he can surely break the brick easily.', '', 'Break the brick by clicking on time!', '<ul><li>Click/Tap when the red bar overlaps with the yellow/green bar.</li></ul>', '');
INSERT INTO public.game_texts VALUES (17, 2, 'Break The Brick', '¿Eres lo suficientemente fuerte como para romper el ladrillo? Break Brick es un juego sobre un maestro de karate, que está probando sus controles de poder y respiración rompiendo un ladrillo. Si es rápido y concentrado, seguramente puede romper el ladrillo fácilmente.', '', '¡Rompe el ladrillo haciendo clic a tiempo!', '<ul><li>Haga clic/Toque cuando la barra roja se superponga con la barra amarilla/verde.</li></ul>', '');
INSERT INTO public.game_texts VALUES (20, 1, 'Christmas 2021 Puzzle', 'Play with 9 images in this perfect jigsaw puzzle game: Christmas 2021 Puzzle. All images is with the themes of christmas 2021. Solve all puzzles and keep your brain sharp. You have four modes for each picture, 16 pieces, 36 pieces, 64 pieces and 100 pieces. Enjoy and have fun.', '', 'A christmas puzzle with pictures and different modes.', '<ul><li>Click/Tap and drag the puzzle piece to the right place.</li></ul>', '');
INSERT INTO public.game_texts VALUES (20, 2, 'Christmas 2021 Puzzle', 'Juega con 9 imágenes en este juego de rompecabezas perfecto: Rompecabezas de Navidad 2021. Todas las imágenes son con los temas de navidad 2021. Resuelve todos los rompecabezas y mantén tu cerebro agudo. Tienes cuatro modos para cada imagen, 16 piezas, 36 piezas, 64 piezas y 100 piezas. Disfruta y diviértete.', '', 'Un rompecabezas navideño con imágenes y diferentes modos.', '<ul><li>Haga clic / toque y arrastre la pieza del rompecabezas al lugar correcto.</li></ul>', '');
INSERT INTO public.game_texts VALUES (19, 2, 'Floral Outfit For The Princess', '<p>El evento principal del reino de las hadas, el Flower Ball, reunió a princesas de todas partes de la tierra mágica. Basta con mirar estos lujosos vestidos bordados con maravillosas flores.</p><p><br></p><p> Las princesas Tiana, Aurora, Jasmine, Elsa, Ariel y Mulan eclipsaron a todos con su belleza. La bella imagen se complementa con peinados decorados con capullos y pétalos de plantas. Magníficas joyas brillan en los cuellos de las chicas. Y, por supuesto, un bolso de mujer con estilo es un atributo indispensable de cualquier belleza.</p><p><br></p><p> Sumérgete en este remolino floral de diversión y celebración con las heroínas del juego Floral Outfit For The Princess en DressUpWho.</p>', '', 'Viste a las princesas para el baile.', '<ul><li>Haga clic / toque en los artículos que desea que usen las princesas.</li></ul>', '');
INSERT INTO public.game_texts VALUES (18, 1, '2048 Classic Edition', '<p>The great puzzle classic, 2048, is back in this edition for all you number lovers out there who enjoy a good challenge for your brain.</p><p><br></p><p>For those less familiar with the concept, 2048 is a numbers game where you fuse two of the same number in a grid to add them up and try to reach the number 2048.</p>', '', 'Play the great 2048, fuse the same numbers to get to 2048.', '<ul><li>Swipe in the direction in which you wish the squares to move. Any doubles that collide will fuse (so two 8s will fuse to create a 16).</li></ul>', '');
INSERT INTO public.game_texts VALUES (18, 2, '2048 Classic Edition', '<p>El gran clásico del rompecabezas, 2048, está de vuelta en esta edición para todos los amantes de los números que disfrutan de un buen desafío para su cerebro.</p><p><br></p><p>Para aquellos menos familiarizados con el concepto, 2048 es un juego de números en el que fusionas dos del mismo número en una cuadrícula para sumarlos e intentar alcanzar el número 2048.</p>', '', 'Juega el gran 2048, fusiona los mismos números para llegar a 2048.', '<ul><li>Desliza el dedo en la dirección en la que deseas que se muevan los cuadrados. Cualquier doble que choque se fusionará (por lo que dos 8 se fusionarán para crear un 16).</li></ul>', '');
INSERT INTO public.game_texts VALUES (19, 1, 'Floral Outfit For The Princess', '<p>The main event of the fairy kingdom - the Flower Ball, brought together princesses from all over the magical land. Just look at these luxurious dresses embroidered with wonderful flowers. </p><p><br></p><p>Princesses Tiana, Aurora, Jasmine, Elsa, Ariel and Mulan eclipsed everyone with their beauty. The beautiful image is complemented by hairstyles decorated with buds and petals of plants. Magnificent jewelry sparkles on the girls'' necks. And, of course, a stylish women''s handbag is an indispensable attribute of any beauty. </p><p><br></p><p>Immerse yourself in this floral swirl of fun and celebration with the heroines of the game Floral Outfit For The Princess at DressUpWho.</p>', '', 'Dress up the princesses for the ball.', '<ul><li>Click/tap on the items you wish the princesses to wear.</li></ul>', '');
INSERT INTO public.game_texts VALUES (68, 1, 'Cute Snake io', '<p>Cute Snake io is a fun snake game with multiple customizations. Stay alive for as long as you can. Don''t bump into other snakes.</p>', '', 'A satisfying .io game with multiple customisations.', '<ul><li>Point the cursor in the way you want to go. </li></ul>', '');
INSERT INTO public.game_texts VALUES (68, 2, 'Cute Snake io', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (23, 1, 'Time Control', '<p>You need to get the ball to the ending point by controlling it around the white squares. It will be destroyed, if it touches any of them. If the ball hits the ending point you will earn a score.</p>', '', 'Control the ball so it can get to the ending point successfully.', '<ul><li>Click/Tap and hold to control the ball.</li></ul>', '');
INSERT INTO public.game_texts VALUES (23, 2, 'Time Control', '<p>Necesitas llevar la pelota al punto final controlándola alrededor de los cuadrados blancos. Será destruido, si toca a alguno de ellos. Si la pelota golpea el punto final, ganarás una puntuación.</p>', '', 'Controla la pelota para que pueda llegar al punto final con éxito.', '<ul><li>Haga clic/toque y mantenga pulsado para controlar la bola.</li></ul>', '');
INSERT INTO public.game_texts VALUES (24, 1, 'Ice Queen Bathroom Deco', '<p>Clean and decorate the bathroom as you </p><p>wish.</p>', '', 'Clean and decorate the bathroom.', '<ul><li>Click and drag to clean</li><li>Click/Tap to decorate</li></ul>', '');
INSERT INTO public.game_texts VALUES (24, 2, 'Ice Queen Bathroom Deco', '<p>Limpia y decora el baño como desees.</p>', '', 'Limpia y decora el baño.', '<ul><li>Haga clic y arrastre para limpiar</li><li>Haga clic / toque para decorar</li></ul>', '');
INSERT INTO public.game_texts VALUES (25, 1, 'Garden Tales', '<p><span style="color: rgb(0, 0, 0);">The colorful match 3 game Garden Tales takes you to a beautifully landscaped garden. Combine and collect flowers, fruit, and mushrooms in over 700 exciting levels. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The more flowers and fruits of the same kind you combine, the cooler the extras you get, making the game easier for you.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Help the garden gnome Willy keep the beds accurate and free from weeds. </span></p><p><span style="color: rgb(0, 0, 0);">Remove ice, puddles, stones and other debris, collect fruit baskets or go treasure hunting with your spade. But beware of the moles, they will ruin your whole garden! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Complete the daily missions or the daily challenge to earn additional coins and other gifts. Enjoy the catchy soundtrack and challenging levels. Play Garden Tales now for free.</span></p>', '', 'Match at least three same items to clear the board.', '<ul><li>Click/Tap and drag to swap the fruits and vegetables.</li></ul>', '');
INSERT INTO public.game_texts VALUES (25, 2, 'Garden Tales', '<p>El colorido partido 3 Garden Tales juego te lleva a un hermoso jardín paisajístico. Combine y recoja flores, frutas y champiñones en más de 700 emocionantes niveles. </p><p><br></p><p>Cuanto más flores y frutas de la misma clase que usted combina, el refrigerador de los extras que usted consigue, haciendo el juego más fácil para usted.</p><p><br></p><p>Ayuda el gnome Willy jardín mantener las camas exactas y libres de malezas.</p><p>Retire el hielo, charcos, piedras y otros desechos, recoger cestas de frutas o ir a la caza del tesoro con su espada. ¡Pero cuidado con los topos, arruinarán todo tu jardín! </p><p><br></p><p>Completar las misiones diarias o el desafío diario para ganar monedas adicionales y otros regalos. Disfrute de la banda sonora pegadiza y los niveles desafiantes. Juega a Garden Tales ahora gratis.</p>', '', 'Haga coincidir al menos tres elementos iguales para limpiar el tablero.', '<p>Haga clic/toque y arrastre para cambiar las frutas y verduras.</p>', '');
INSERT INTO public.game_texts VALUES (15, 1, 'Solitaire Farm: Seasons', '<p>Solitaire Farm: Seasons, the classic solitaire card game which allows you to train your brain with different solitaire game puzzles while enjoying the beauty of country life! </p><p><br></p><p>Do you love Classic Solitaire card games like Tri Peaks Solitaire, Pyramid Solitaire, Freecell Solitaire, Spider Solitaire and Klondike Solitaire, or are you new to free card games? Either way, your journey through Solitaire Farm: Seasons will be the perfect puzzler for your brain! </p><p><br></p><p>HIGHLIGHTS of Solitaire Farm: Seasons ♥️ Play, Plant &amp; Harvest your farm crops! ♠️ 2000+ different Solitaire levels! ♦️ Exciting game modes and daily missions! </p><p><br></p><p>Never played Solitaire or any card games before? No worries! Simply complete a card draw tutorial and you''ll learn how to play this solitaire tri peaks card game in a few minutes! The game will help you train your brain and increase your IQ while exploring distant countries, exotic plants, beautiful landscapes and great landmarks from the comfort of your own home!</p>', '', 'Play a good game of solitaire.', '<ul><li>Click/Tap on the cards.</li></ul>', '');
INSERT INTO public.game_texts VALUES (26, 1, 'Raymans Incrediballs Dodge', '<p><span style="color: rgb(0, 0, 0);">Anarchy in the Jungle! Choose one of more than 20 hilarious Incrediballs and take advantage of their unique properties to escape the hazards of the jungle for as long as you can. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿Dodge left, dodge right and push other players around, it''s the law of the jungle!</span></p>', '', 'Survive as long as you can in the jungle.', '<ul><li><strong style="color: rgb(0, 0, 0);">Mobile:</strong><span style="color: rgb(0, 0, 0);"> Swipe to move. </span></li><li><strong style="color: rgb(0, 0, 0);">Desktop: </strong><span style="color: rgb(0, 0, 0);">Click/Hold, ⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span><span style="color: rgb(0, 0, 0);"> to move. </span></li></ul>', '');
INSERT INTO public.game_texts VALUES (36, 2, 'Cartoon Animal Puzzle', '<p>Conoce algunos animales lindos y divertidos. Hay seis rompecabezas de animales diferentes. Tortuga, panda, conejo, mono, gato y mapache. Cada imagen de rompecabezas consta de nueve piezas. Combina las piezas y completa los rompecabezas.</p>', '', 'Combina las piezas y completa los rompecabezas.', '<ul><li>Haga clic y arrastre cada pieza del rompecabezas a su lugar.</li></ul>', '');
INSERT INTO public.game_texts VALUES (21, 2, 'Assassin''s Creed Freerunners', '<p>Assassin''s Creed Freerunners es la prueba definitiva de Assassin Freerunning. Nombra a tu asesino de confianza y entra en el animus con otros 7 jugadores, supera los peligros y llegar al punto de extracción primero!</p><p><br></p><p>Suba a los tejados, suba a las paredes, utilice el medio ambiente y dé un épico salto de fe para aumentar su sincronización y convocar a personajes legendarios de toda la serie Assassin’s Creed. Iniciando simulación…3…2…1..Run!</p>', '', 'Llegar primero al punto de extracción utilizando el entorno.', '<ul><li>Haga clic/Presione espacio para saltar o saltar dos veces</li></ul>', '');
INSERT INTO public.game_texts VALUES (22, 2, 'Ubisoft All Star Blast', '<p>''All Star Blast'' es el exclusivo juego de arcade de UBISOFT-crossover, que impulsa a los jugadores a utilizar mapas multijugador de tamaño king repletos de legendarias referencias de juegos de Ubisoft, donde pueden competir en divertidos y enérgicos minijuegos inspirados en los clásicos juegos de arcade con hasta 100 jugadores, Y desbloquear personajes, habilidades y pieles para desarrollar una colección de poderosos personajes clásicos de Ubisoft.</p>', '', 'Evita las bombas a toda costa jugando como tus personajes favoritos.', '<ul><li>⬅⬆➡ - para mover</li><li>Spacebar - para colocar la bomba</li></ul>', '');
INSERT INTO public.game_texts VALUES (63, 1, 'Happy Princesses Pregnant Bffs', '<p>These two princesses are BFFs and they are going to be mommies at the same time! </p><p><br></p><p>Spend the day with them in this cute caring game and have fun with different activities. Make sure they take their vitamins, they eat healthy food, and don''t forget about the little ones. Place the headphones on the bellies and play beautiful music for the babies. In the end, you get to choose an awesome dress and hairstyle for each mommy to be! </p>', '', 'Help two BFF pregnant princesses go about their day!', '<ul><li>Follow the tutorial on the screen</li><li>Click with the mouse or tap with your finger</li></ul>', '');
INSERT INTO public.game_texts VALUES (26, 2, 'Raymans Incrediballs Dodge', '<p>¡Anarquía en la selva! Elige uno de los más de 20 hilarantes Incrediballs y aprovecha sus propiedades únicas para escapar de los peligros de la selva durante todo el tiempo que puedas.</p><p><br></p><p>Esquiva a la izquierda, esquiva a la derecha y empuja a otros jugadores, ¡es la ley de la jungla!</p>', '', 'Sobrevive todo el tiempo que puedas en la selva.', '<ul><li><span style="color: rgba(0, 0, 0, 0.88);">Móvil: Deslice para moverse.</span></li><li>Escritorio: haga clic/mantenga pulsado, <span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️➡️</span> para mover.<span style="color: rgba(0, 0, 0, 0.88);">&nbsp;</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (27, 1, 'Balls Race', '<p><span style="color: rgb(0, 0, 0);">Roll as fast as you can! Avoid different obstacles and win the race! Best and most addictive balls race! ​</span></p>', '', 'Roll the ball and avoid obstacles to get better scores.', '<ul><li>Drag the ball left and right to avoid obstacles.</li></ul>', '');
INSERT INTO public.game_texts VALUES (27, 2, 'Balls Race', '<p>​¡Enrollar tan rápido como usted puede! Evita diferentes obstáculos y gana la carrera! La mejor y más adictiva carrera de pelotas!</p>', '', 'Enrolla la pelota y evitar obstáculos para obtener mejores puntuaciones.', '<ul><li>Arrastre la pelota a izquierda y derecha para evitar obstáculos.</li></ul>', '');
INSERT INTO public.game_texts VALUES (28, 1, 'Trackmania Blitz', '<p><span style="color: rgb(0, 0, 0);">TrackMania Blitz is a fast &amp; challenging top-down 2D live multiplayer racer based on the classic Ubisoft franchise Trackmania, where players are blasted into high speed real-multiplayer elimination races filled with crazy jumps, loops and turbo boosts. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Survive at all cost by staying on top of unforgiving elimination races! Beat world records in the global leaderboard!</span></p>', '', 'Race and survive to win the elimination races.', '<ul><li><strong>Desktop</strong>: <span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">➡️</span> to steer</li><li><strong>Mobile</strong>: Tap to steer</li></ul>', '');
INSERT INTO public.game_texts VALUES (28, 2, 'Trackmania Blitz', '<p>TrackMania Blitz es un rápido y desafiante corredor multijugador en vivo en 2D de arriba hacia abajo basado en la clásica franquicia de Ubisoft Trackmania, donde los jugadores son lanzados a carreras de eliminación multijugador real de alta velocidad llenas de saltos locos, bucles y turbo boosts.&nbsp; </p><p><br></p><p>¡Sobrevive a toda costa manteniéndote al tanto de las implacables carreras de eliminación! ¡Batió récords mundiales en la tabla de clasificación global!</p>', '', 'Corre y sobrevive para ganar las carreras de eliminación.', '<ul><li>Escritorio: ⬅➡ Para dirigir</li><li>Móvil: Toque para dirigir</li></ul>', '');
INSERT INTO public.game_texts VALUES (29, 1, 'Magic Pom', '<p><span style="color: rgb(0, 0, 0);">Magic Pom is a cute casual puzzle game! Connect 3 or more similar Poms to make points within the time limit and reach the objectives in each level. Gain points to collect Pom packs and buy new abilities. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Songs: In-Game: Jump and Run </span></p><p><span style="color: rgb(0, 0, 0);">- Tropical Mix (OpenGameArt) </span></p><p><span style="color: rgb(0, 0, 0);">Shop: Buy something! </span></p><p><span style="color: rgb(0, 0, 0);">- Autor: Cleyton Kauffman Magic: Run Around (Edited) </span></p><p><span style="color: rgb(0, 0, 0);">- Autor: Yubatake Music Theme: Rainbow Forest </span></p><p><span style="color: rgb(0, 0, 0);">- Autor: Quincas Moreira</span></p>', '', 'An extremely satisfying match-3 game where you need to connect poms.', '<ul><li>Drag to connect the poms.</li></ul>', '');
INSERT INTO public.game_texts VALUES (29, 2, 'Magic Pom', '<p><span style="color: rgba(0, 0, 0, 0.88);">¡Magic Pom es un lindo juego de rompecabezas casual! Conecta 3 o más Poms similares para hacer puntos dentro del límite de tiempo y alcanzar los objetivos en cada nivel. Gana puntos para recoger packs pom y comprar nuevas habilidades.&nbsp;&nbsp;</span></p><p><br></p><p><span style="color: rgba(0, 0, 0, 0.88);">Canciones: In-Game: Jump and Run&nbsp;</span></p><p><span style="color: rgba(0, 0, 0, 0.88);">- Tropical Mix (OpenGameArt)&nbsp;</span></p><p><span style="color: rgba(0, 0, 0, 0.88);">Tienda: ¡Compra algo!&nbsp;&nbsp;</span></p><p><span style="color: rgba(0, 0, 0, 0.88);">- Autor: Cleyton Kauffman Magic: Run Around (Editado)&nbsp;</span></p><p><span style="color: rgba(0, 0, 0, 0.88);">- Autor: Yubatake Music Theme: Rainbow Forest&nbsp;</span></p><p><span style="color: rgba(0, 0, 0, 0.88);">- Autor: Quincas Moreira</span></p>', '', 'Un juego match-3 extremadamente satisfactorio donde necesitas conectar poms', '<ul><li>Arrastre para conectar los poms.</li></ul>', '');
INSERT INTO public.game_texts VALUES (30, 1, 'Stick Duel: Revenge', '<p>Stick Duel series continues with the Revenge episode. In this special episode, the Stickman have flying shoes and new advanced weapons. </p><p><br></p><p>Battle against your friend or the computer in over 50 different levels! Each chapter has its own special variations and this affects the battle. </p><p><br></p><p>Stay away from fire pools and traps! </p><p><br></p><p>Stick Battle: Revenge can be played with both 1 player and 2 players. The one who reaches 5 score first, wins the game.</p>', '', 'Battle against your friend or the computer in over 50 different levels! ', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span>⬆️➡️ - to move</li><li>L - to shoot</li><li>O - to throw the weapon</li></ul>', '<ul><li>WASD - to move</li><li>F - to shoot</li><li>R - to throw the weapon</li></ul><p><br></p>');
INSERT INTO public.game_texts VALUES (30, 2, 'Stick Duel: Revenge', '<p>La serie Stick Duel continúa con el episodio de Revenge. En este episodio especial, los Stickman tienen zapatos voladores y nuevas armas avanzadas. </p><p><br></p><p>Lucha contra tu amigo o la computadora en más de 50 niveles diferentes! Cada capítulo tiene sus propias variaciones especiales y esto afecta la batalla. </p><p><br></p><p>¡Mantente alejado de las piscinas de fuego y trampas! </p><p><br></p><p>Stick Battle: La venganza se puede jugar tanto con 1 jugadores como con 2 jugadores. El que primero alcanza la puntuación de 5, gana el juego.</p>', '', '¡Lucha contra tu amigo o la computadora en más de 50 niveles diferentes!', '<ul><li>⬅⬆➡ - Para mover </li><li>L - Para disparar </li><li>O - Para lanzar el arma</li></ul>', '<ul><li>WASD - Para mover </li><li>F - Para disparar </li><li>R - Para lanzar el arma</li></ul>');
INSERT INTO public.game_texts VALUES (31, 1, 'Merge Dreams', '<p>Merge &amp; Build a wonderland full of interesting classic characters and stories! You can combine everything into better and more powerful items for your journey. Build &amp; upgrade all kinds of buildings to produce all kinds of useful products. Use these products to complete the orders to earn more Gold and get more experience points. </p><p><br></p><p>The more experience points, the higher the level you are, and you can unlock more interesting characters, stories, lands, etc.</p>', '', 'Build a wonderland full of interesting things by merging everything.', '<ul><li>Click/Tap, drag and let go the element you want to merge.</li></ul>', '');
INSERT INTO public.game_texts VALUES (62, 2, 'Chicken Egg Challenge', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (69, 2, 'Stick Man', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (63, 2, 'Happy Princesses Pregnant Bffs', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (64, 2, 'Stick Duel Shadow Fight', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (31, 2, 'Merge Dreams', '<p>¡Fusiona y construye un país de las maravillas lleno de interesantes personajes e historias clásicas! Puedes combinar todo en artículos mejores y más poderosos para tu viaje. Construye y actualiza todo tipo de edificios para producir todo tipo de productos útiles. Usa estos productos para completar los pedidos y ganar más Oro y obtener más puntos de experiencia.&nbsp;</p><p><br></p><p>Cuantos más puntos de experiencia, mayor será el nivel que tengas, y podrás desbloquear personajes, historias, tierras, etc. más interesantes.</p>', '', 'Construir un país de las maravillas fusionando cada elemento en algo mejor.', '<ul><li>Haga clic/puntee, arrastre y deje ir el elemento que desea combinar.</li></ul>', '');
INSERT INTO public.game_texts VALUES (32, 1, 'Kick the Huggie Wuggie', '<p>Get ready to beat up the most annoying monsters you’ll ever meet. </p><p><br></p><p>Rag doll physics&nbsp;+ tons of weapons = PURE FUN </p><p><br></p><p>People just can’t resist beating him up &amp; neither will you. </p><p><br></p><p>Complete with rag doll physics and loads and loads of weapons for you to choose from. Collect coins to unlock new weapons and modes to kick your little monster. Choose many guns as pistols, grenades, mines, flamethrowers, blades and many other weapons.</p>', '', 'A clicker game where you get to kick the most annoying monsters.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (32, 2, 'Kick the Huggie Wuggie', '<p>Prepárate para golpear a los monstruos más molestos que jamás conocerás. </p><p><br></p><p>Muñeca de trapo física + toneladas de armas = PURA DIVERSIÓN </p><p><br></p><p>La gente simplemente no puede resistirse a golpearlo y tú tampoco. </p><p><br></p><p>Completo con física de muñecas de trapo y cargas y montones de armas para que elijas. Recoge monedas para desbloquear nuevas armas y modos para patear a tu pequeño monstruo. Elija muchas armas como pistolas, granadas, minas, lanzallamas, cuchillas y muchas otras armas.</p>', '', 'Un juego de clicker donde puedes patear a los monstruos más molestos.', '<ul><li>Haga clic/toque.</li></ul>', '');
INSERT INTO public.game_texts VALUES (33, 1, 'Sliding Ball', '<p>Test your reaction and natural reflexes in Sliding Ball game. You will control the ball, which is on a straight line, moving from left to right and vice versa in a horizontal plane. The ball cannot get away from this line, it has a limited field of activity. This is the difficulty of the task, because various figures will soon begin to fall from above, trying to touch and destroy your ball.</p>', '', 'Sliding ball is an hypercasual game that will test your reflexes', '<ul><li>Use mouse or touch the screen to move ball in the opposite direction</li><li>Avoid projectiles to gain score</li></ul>', '');
INSERT INTO public.game_texts VALUES (33, 2, 'Sliding Ball', '<p>Pon a prueba tu reacción y reflejos naturales en el juego Sliding Ball. Controlarás la pelota, que está en línea recta, moviéndose de izquierda a derecha y viceversa en un plano horizontal. La pelota no puede salirse de esta línea, tiene un campo de actividad limitado. Esta es la dificultad de la tarea, porque varias figuras pronto comenzarán a caer desde arriba, tratando de tocar y destruir tu bola.</p>', '', 'Sliding ball es un juego hipercasual que pondrá a prueba tus reflejos', '<ul><li>Usa el mouse o toca la pantalla para mover la bola en la dirección opuesta</li><li>Evita los proyectiles para ganar puntos.</li></ul>', '');
INSERT INTO public.game_texts VALUES (40, 1, 'Basket Champ', '<p><span style="color: rgb(0, 0, 0);">Basket Champ is a Single tap-based game that comes with some amazing graphics. The game theme gets change on clearing of 5 levels. You need to tap on the screen to hit the ball towards the basket. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You should have some patience to dunk the ball in the basket as you will face challenges to do it. Don''t let the bouncy ball go down otherwise you will kick out of the game. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Be ready with your flippers and show some basketball skills to dunk balls in the basket to become the next basketball star!</span></p>', '', 'Hit the ball so it gets in the basket.', '<ul><li>Click/Tap to hit the ball.</li></ul>', '');
INSERT INTO public.game_texts VALUES (34, 1, 'God Simulator', '<p><span style="color: rgb(0, 0, 0);">The best free strategy game about religion! Top-end god simulator in the popular sandbox strategy genre. Become a God! Unite the whole world with one faith! Create your own unique religion!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Choose the cult, difficulty, and a country/territory to get started. After selecting the territory, you will start gaining believers in that particular territory. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">In the upper-right corner of the game, you will see the number of years that have been passed so far. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Every year, you make a little progress the long-term goal is to make all the people in the world have unconditional faith in your religion; gain believers, enlighten them, raise fanaticism so that you can have violent followers.</span></p>', '', 'Conquer the whole world by forming a religion and by gaining followers.', '<ul><li>Click on different fields to upgrade skills or to get more followers.</li></ul>', '');
INSERT INTO public.game_texts VALUES (34, 2, 'God Simulator', '<p>¡El mejor juego de estrategia gratuito sobre religión! Simulador de dios de gama alta en el popular género de estrategia sandbox. ¡Conviértete en un Dios! ¡Une al mundo entero con una sola fe! ¡Crea tu propia religión única! </p><p><br></p><p>Elija el culto, la dificultad y un país / territorio para comenzar. Después de seleccionar el territorio, comenzarás a ganar creyentes en ese territorio en particular.</p><p><br></p><p>En la esquina superior derecha del juego, verá el número de años que han pasado hasta ahora. </p><p><br></p><p>Cada año, usted hace un poco de progreso El objetivo a largo plazo es hacer que todas las personas en el mundo tengan una fe incondicional en su religión; ganar creyentes, iluminarlos, elevar el fanatismo para que pueda tener seguidores violentos.</p>', '', 'Conquista el mundo entero formando una religión y ganando seguidores.', '<p>Haga clic en diferentes campos para mejorar las habilidades o para obtener más seguidores.</p>', '');
INSERT INTO public.game_texts VALUES (35, 1, 'Noob Ninja Guardian', '<p><span style="color: rgb(0, 0, 0);">A brave ninja decided to protect his doyo from the waves of enemies who seek to collapse each stone and conquer your territory. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You must control the direction of the guardian where he should attack so as not to let any enemy pass. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>You could collect the coins to upgrade your skills and evolve the power of the guardian ninja.</span></p>', '', 'Kill all of your enemies before they can pass.', '<ul><li>Click.</li></ul>', '');
INSERT INTO public.game_texts VALUES (35, 2, 'Noob Ninja Guardian', '<p>Un valiente ninja decidió proteger a su doyo de las oleadas de enemigos que buscan derrumbar cada piedra y conquistar tu territorio. </p><p><br></p><p>Debes controlar la dirección del guardián donde debe atacar para no dejar pasar a ningún enemigo. </p><p><br></p><p>Podrías recolectar las monedas para mejorar tus habilidades y evolucionar el poder del ninja guardián.</p>', '', 'Mata a todos tus enemigos antes de que puedan pasar.', '<ul><li>Haga clic.</li></ul>', '');
INSERT INTO public.game_texts VALUES (36, 1, 'Cartoon Animal Puzzle', '<p><span style="color: rgb(69, 69, 69);">Meet some cute and funny animals. There are six different animal puzzles. Turtle, panda, rabbit, monkey, cat and raccoon. Each jigsaw picture consists of nine pieces. Combine the pieces and complete the puzzles.</span></p>', '', 'Combine the pieces and complete the puzzles.', '<ul><li>Click and drag each puzzle piece to its place.</li></ul>', '');
INSERT INTO public.game_texts VALUES (37, 1, 'Magic Herobrine Smart Brain and Puzzle Quest', '<p><span style="color: rgb(0, 0, 0);">Welcome to Magic Herobrine - smart brain &amp; puzzle quest! Take a deep breath and dive into an magic cube world of puzzle quests fun with Herobrine, an all-new free game! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Try challenging and fun smart brain quest gameplay with unique puzzles as you pass logic levels to become more smart. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Burn boxes, open lucky blocks, get chests, and solve cool puzzles and quests. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Hey, your herobrine is waiting for you, so enjoy this amazing Magic Herobrine - smart brain &amp; puzzle quest adventure!</span></p>', '', 'Complete each level by getting the yellow surprise box on the floor.', '<ul><li>Click on the boxes.</li></ul>', '');
INSERT INTO public.game_texts VALUES (37, 2, 'Magic Herobrine Smart Brain and Puzzle Quest', '<p>¡Bienvenido a Magic Herobrine - cerebro inteligente y búsqueda de rompecabezas! ¡Respira hondo y sumérgete en un mundo de cubos mágicos de misiones de rompecabezas divertidas con Herobrine, un juego gratuito completamente nuevo! </p><p><br></p><p>Prueba el desafiante y divertido juego de búsqueda inteligente del cerebro con rompecabezas únicos a medida que pasas los niveles de lógica para ser más inteligente. </p><p><br></p><p>Quema cajas, abre bloques de la suerte, consigue cofres y resuelve rompecabezas y misiones geniales. </p><p><br></p><p>Oye, tu herobrine te está esperando, ¡así que disfruta de esta increíble Aventura mágica de Magic Herobrine - cerebro inteligente y búsqueda de rompecabezas!</p>', '', 'Completa cada nivel consiguiendo la caja sorpresa amarilla en el suelo.', '<ul><li>Haga clic en las casillas.</li></ul>', '');
INSERT INTO public.game_texts VALUES (38, 1, 'Penalty Kick Target', '<p>It''s penalty time! Are you confident in your abilities? Don''t miss target to get more points and hurry up to hit again to double your bonus!</p>', '', 'Hit the target to get coins!', '<ul><li>Click &amp; Hold to aim and then let go.</li></ul>', '');
INSERT INTO public.game_texts VALUES (38, 2, 'Penalty Kick Target', '<p>¡Es tiempo de penalización! ¿Confías en tus habilidades? ¡No te pierdas el objetivo para obtener más puntos y date prisa para golpear de nuevo para duplicar tu bonificación!</p>', '', '¡Hit el objetivo para conseguir monedas!', '<ul><li>Haga clic y mantenga presionado para apuntar y luego suéltelo.</li></ul>', '');
INSERT INTO public.game_texts VALUES (40, 2, 'Basket Champ', '<p>Basket Champ es un juego basado en un solo toque que viene con algunos gráficos increíbles. El tema del juego cambia al despejar 5 niveles. Debe tocar la pantalla para golpear la pelota hacia la canasta.&nbsp;</p><p><br></p><p>Debes tener un poco de paciencia para sumergir la pelota en la canasta, ya que enfrentarás desafíos para hacerlo. No dejes que la bola hinchable baje, de lo contrario serás expulsado del juego.&nbsp;</p><p><br></p><p>¡Prepárate con tus aletas y muestra algunas habilidades de baloncesto para sumergir pelotas en la canasta y convertirte en la próxima estrella del baloncesto!</p>', '', 'Golpea la pelota para que se meta en la canasta.', '<ul><li>Haga clic / toque para golpear la pelota.</li></ul>', '');
INSERT INTO public.game_texts VALUES (43, 1, 'Ultra Sharp Slice', '<p>Ultra Sharp Slice is a perfect little web online game that will make you think and strategize. </p><p><br></p><p>Use physics to your advantage to destroy little balls and squares by logically cutting pieces of the squares, triangles, and rectangles.</p>', '', 'Web game that will make you think and create strategies.', '<ul><li>Cut pieces by clicking and dragging with a mouse</li></ul>', '');
INSERT INTO public.game_texts VALUES (41, 1, 'Tennis Masters', '<p><span style="color: rgb(0, 0, 0);">Become a tennis master and show all your competitor talents to beat your opponents in the game Tennis Masters. You can play against the computer, or against a friend in 2 player mode! Collect power-ups and funny transformations. Have fun!</span></p>', '', 'Become a tennis master and win every other champion.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - </span><span style="color: rgb(0, 0, 0);">to move </span></li><li><span style="color: rgb(0, 0, 0);">X - to hit </span></li><li><span style="color: rgb(0, 0, 0);">Z - to smash</span></li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move </span></li><li><span style="color: rgb(0, 0, 0);">L - to hit </span></li><li><span style="color: rgb(0, 0, 0);">K - to smash</span></li></ul>');
INSERT INTO public.game_texts VALUES (43, 2, 'Ultra Sharp Slice', '', '', 'Juego web que te hará pensar y crear estrategias.', '<ul><li>Cortar piezas haciendo clic y arrastrar con el mouse</li></ul>', '');
INSERT INTO public.game_texts VALUES (41, 2, 'Tennis Masters', '<p>Conviértete en un maestro de tenis y muestra todos los talentos de tu competidor para vencer a tus oponentes en el juego Tennis Masters. ¡Puedes jugar contra la computadora o contra un amigo en el modo de 2 jugadores! Colecciona potenciadores y divertidas transformaciones. ¡Que te diviertas!</p>', '', 'Conviértete en un maestro de tenis y gana a todos los demás campeones.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span> - Para mover</li><li>X - Para golpear</li><li>Z - Para aplastar</li></ul>', '<ul><li>WASD - para mover</li><li>L - para golpear</li><li>K - para aplastar</li></ul>');
INSERT INTO public.game_texts VALUES (39, 1, 'Gravity Soccer 3', '<p><span style="color: rgb(0, 0, 0);">Solve all Gravity Soccer levels using logic. Destroy blocks and manage to get the ball into the net, trying to get all stars. Touch/Click the objects to destroy.</span></p>', '', 'Get the ball into the net using logic.', '<ul><li>Click/Tap on the objects you wish to destroy.</li></ul>', '');
INSERT INTO public.game_texts VALUES (39, 2, 'Gravity Soccer 3', '<p>Resuelve todos los niveles de Gravity Soccer usando la lógica. Destruye bloques y consigue meter la pelota en la red, intentando conseguir todas las estrellas. Toca o haz clic en los objetos que quieras destruir.</p>', '', 'Consiga la bola en la red usando la lógica.', '<ul><li>Haga clic / toque en los objetos que desea destruir.</li></ul>', '');
INSERT INTO public.game_texts VALUES (81, 1, 'Snack Mahjong', '<p>You have to find a pair of identic images and clear the entire game field. If there are wooden boxes on the field you can destroy them by clearing neighboring tiles, the blocks made of steel can only be moved around but not destroyed.</p><p><br></p><p>The objects can be connected only if there are no obstacles between them. There are also special blocks that can move the tiles around or along the straight line.</p>', '', 'Connect the same images if the way between them is clear.', '<ul><li>Click.</li></ul>', '');
INSERT INTO public.game_texts VALUES (66, 1, 'Drift Car Racing', '<p><span style="color: rgb(0, 0, 0);">Drift car racing has never been so fun, experience the whole new world of possibilities with the best car driving simulator. Have the freedom of exploring every corner of the map, and get lost in something you’ve never experienced before. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Select your favorite sports car; modify it with amazing new modification options and start drifting. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">This game brings the ultimate experience of drifting. This is not all, drive as fast as you can, and perform freestyle stunts on skyscrapers, houses, and bridges.</span></p>', '', 'Select your favorite sports car and drive around the city!', '<ul><li>WASD - to move.</li><li><span style="color: rgb(0, 0, 0);">F - for nitro.</span></li><li><span style="color: rgb(0, 0, 0);">Spacebar - to slow down.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (66, 2, 'Drift Car Racing', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (42, 2, 'Industry Road Construction', '<p>Industry Road Construction es un juego web en línea en 3D en el que juegas como ingeniero de construcción. En este juego web, conducirá y utilizará equipos y camiones de construcción pesados ​​para ayudar a crear ciudades urbanas.</p><p><br></p><h3>Características del juego;</h3><ul><li>Ponga en práctica sus habilidades de conducción y construcción de carreteras y construya carreteras en varios lugares de la ciudad.</li><li>Conviértete en ingeniero de obras y ayuda a crear vías urbanas transitables</li><li>Conduce múltiples maquinarias pesadas en la zona de construcción para construir carreteras.</li><li>Use su conocimiento arquitectónico y cree un plan de construcción; cómo construir caminos en un área de la ciudad y qué tipo de maquinaria usarán los constructores de caminos.</li></ul>', '', 'Juego web en línea en 3D donde conduces equipos de construcción pesados', '<ul><li>W o ⬆️ para avanzar</li><li>D o ➡️ para mover a la derecha</li><li>S o ⬇️ para retroceder</li><li>A o ⬅️ para moverse a la izquierda</li><li>Mueva los controles deslizantes en la pantalla para ajustar la carga del camión y la excavadora.</li></ul>', '');
INSERT INTO public.game_texts VALUES (21, 1, 'Assassin''s Creed Freerunners', '<p>Assassin''s Creed Freerunners is the ultimate Assassin freerunning test! Appoint your most trusted Assassin and enter the animus with 7 other players, surpass the dangers and get to the extraction point first!</p><p><br></p><p>Climb on roofs, jump on walls, use the environment and take an epic leap of faith to increase your synchronization and summon legendary characters from the entire Assassin’s Creed series. Initiating simulation…3…2…1..Run!</p>', '', 'Get to the extraction point first by using the environment.', '<ul><li>Click/Press space to jump or jump twice</li></ul>', '');
INSERT INTO public.game_texts VALUES (2, 1, 'Kirka.io', '<p>Kirka.io is a brand new online multiplayer game. It is a web FPS that is a bit slower-paced when compared with other web FPS games such as <a href="https://krunker.io/" rel="noopener noreferrer" target="_blank">Krunker.io</a>. It is like Counter-Strike but you can play it in your browser!</p><p><br></p><p>This online FPS web game has tons of features, such as parkour, capture the point, TDM, and FFA. It has beautiful voxel graphics and wonderful sound effects. It truly is a masterpiece that performs very well in your browser.</p><p><br></p><p>Come and play! Your teammates and enemies await you.</p>', '', 'Test your FPS skills in this brand new 3D multiplayer web online shooter.', '<ul><li>WASD - to move</li><li>Space - to jump</li><li>Shift - to crouch</li><li>E - to dash</li><li>Left-click - to shoot</li><li>Right-click - to aim</li><li>1, 2, 3 - for switching weapons</li></ul>', '');
INSERT INTO public.game_texts VALUES (2, 2, 'Kirka.io', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (45, 1, 'Slither.io', '<p><em style="color: rgb(69, 64, 61);">Slither.io</em><span style="color: rgb(69, 64, 61);">&nbsp;can be played with either a touch screen or a mouse. The game is played from a top-down perspective. You play as a tiny snake that can be customized with different colors and patterns. Like the classic Nokia game,&nbsp;</span><em style="color: rgb(69, 64, 61);">Snake</em><span style="color: rgb(69, 64, 61);">, your&nbsp;</span><em style="color: rgb(69, 64, 61);">Slither.io&nbsp;</em><span style="color: rgb(69, 64, 61);">character can never stop moving and will follow your mouse/finger where ever you move it. Scattered everywhere are tiny multi-colored orbs. </span></p><p><br></p><p><span style="color: rgb(69, 64, 61);">Every time you move over an orb, you will consume it and increase in length. There are 50 other snakes in the game so, if you ever run headfirst into another snake, regardless of you or its size, you will immediately die and exit the game. </span></p><p><br></p><p><span style="color: rgb(69, 64, 61);">However, whenever&nbsp;another snake collides headfirst with any snake, including you, they instantly die and leave behind all of the orbs they have eaten.</span></p><p><br></p><p><span style="color: rgb(69, 64, 61);">The strategy is to use your shape and size to force other snakes to collide with each other (and you) in order to consume their orbs and grow as quickly as possible. </span></p><p><br></p><p><span style="color: rgb(69, 64, 61);">The bigger you are, the easier it is to kill other players. A popular strategy involves encircling other smaller snakes and spinning around them, making your circle tighter and tighter until they eventually run into you and you can consume their orbs.</span></p>', '', 'Play against other people online! Can you become the longest slither?', '<ul><li>Point your mouse/Drag in that direction you want to go.</li></ul>', '');
INSERT INTO public.game_texts VALUES (46, 2, 'Hole.io', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (47, 1, 'Krunker.io', '<p>In a single sentence, <strong>Krunker is a free-to-play arena-style browser-based tactical first-person shooter game where (typically) up to 8 players join a lobby and shoot each other to death or compete over an objective.</strong> Sounds violent? Not so fast. Stylistically, Krunker has simplified block-like graphics much like Minecraft or Roblox. There is no blood or gore in the game. Yes, there ARE guns in the game like an Assault Rifle, Rocket Launcher, and Uzi - but that’s pretty much as far as the violence goes.</p><p><br></p><p>Since it’s a browser-based game, that means it can be played on Windows PC, Mac, ChromeOS, and even Linux. If you don’t want to play in the web browser, you can also download the official “client” version of the game which is available for Windows and Mac. The game is the same as the browser version with just a few small added features. Players can play with each other regardless of which platform they are on. </p><p><br></p><p>Games typically last about just 4 minutes which means that Krunker is a fun “pick up and play” type game. The game speed is lightning fast too. After you die in-game, you can respawn instantly, which means there is very little downtime. This is in stark contrast to slower-paced battle royale games where a single game lasts about 30 minutes.</p><p><br></p><p>In terms of the gameplay, Krunker is most similar to the Call of Duty games. The guns in the game do have recoil, but not too much. Krunker has an arcade-style feel even though it also has elements of tactical shooters</p><p>. </p><p><strong>The main modes in the game are:</strong></p><ul><li>Free-for-all (FFA)</li><li>Team Deathmatch (TDM)</li><li>Capture the Flag (CTF)</li><li>Hardpoint (POINT)</li><li class="ql-indent-1">In Hardpoint, you fight for control of a single objective that changes location after 1 minute. By standing on the objective, your team accumulates points.</li></ul><p> </p><p><strong>There are a total of 12 classes to choose from, each with different weapons (loadouts).</strong></p><ul><li>Triggerman (Assault Rifle)</li><li>Hunter (Sniper Rifle)</li><li>Run N Gun (SMG)</li><li>Spray N Pray (LMG)</li><li>Vince (Shotgun)</li><li>Detective (Revolver)</li><li>Marksman (Semi Auto)</li><li>Rocketeer (Rocket Launcher)</li><li>Agent (Akimbo Uzi)</li><li>Runner (Combat Knife)</li><li>Bowman (Crossbow)</li><li>Commando (FAMAS). </li></ul><p><br></p>', '', 'Up to 8 players shoot each other to death or compete over an objective.', '<ul><li>C - to aim.</li><li>Q - next weapon.</li><li>E - previous Weapon.</li><li>Enter - chat.</li><li>V - voice.</li><li>WASD - to move.</li><li>Left-click - to shoot.</li><li>R - reload the gun.</li><li>Spacebar - to jump.</li><li>Shift - to crouch</li><li>F - to spray.</li></ul><p><br></p>', '');
INSERT INTO public.game_texts VALUES (47, 2, 'Krunker.io', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (48, 1, 'Skribbl.io', '<p><span style="color: rgb(32, 33, 36);">Skribbl.io is&nbsp;</span><strong style="color: rgb(32, 33, 36);">a free multiplayer drawing and guessing game</strong><span style="color: rgb(32, 33, 36);">. One game consists of a few rounds in which every round someone has to draw their chosen word and others have to guess it to gain points! The person with the most points at the end of the game will then be crowned the winner!</span></p>', '', 'Multiplayer drawing and guessing games.', '<ul><li>Watch what the other players are drawing and write your guesses in the text field.</li><li>Draw when it''s your turn.</li></ul>', '');
INSERT INTO public.game_texts VALUES (48, 2, 'Skribbl.io', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (49, 1, 'Richup.io', '<p>Richup is a web-based board game inspired by Monopoly in which you purchase properties and build your financial empire against other players. In the game, all players start with the same amount of cash ($1500). </p><p><br></p><p>Each player rolls the dice to move forward. Once one landed on a property, it can be purchased, and other players that will land on this property will have to pay its owner. Once you own all properties in a group, you can start upgrading them by building houses and hotels. </p><p><br></p><p>The more houses or hotels you have in a property, the more players will pay you once they land on it. Your goal is to own as many properties as you can and become the last remaining player.</p>', '', 'A board game alternative to Monopoly', '<ul><li>Click on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (49, 2, 'Richup.io', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (45, 2, 'Slither.io', '', '', 'SLITHER IO WAS DISABLED DUE TO NOT BEING HTTPS', '', '');
INSERT INTO public.game_texts VALUES (50, 1, 'Might and Magic armies', '<p><span style="color: rgb(0, 0, 0);">Lead the mightiest army and crush other players! Summon Epic heroes, use their unique skills, recruit thousands of soldiers and use the terrain strategically! Lead ferocious creatures from the Might &amp; Magic universe and crush the armies of other players with tactics…or brute force!</span></p>', '', 'Lead the mightiest army and crush other players!', '<p><span style="color: rgb(0, 0, 0);">Desktop: </span></p><ul><li><span style="color: rgb(0, 0, 0);">Use ⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span><span style="color: rgb(0, 0, 0);"> - to move.</span></li><li><span style="color: rgb(0, 0, 0);">Press Space to activate the speed boost.</span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">Mobile: </span></p><ul><li><span style="color: rgb(0, 0, 0);">Drag - to move.</span></li><li><span style="color: rgb(0, 0, 0);">Press the Boost Button - to speed up.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (50, 2, 'Might and Magic armies', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (64, 1, 'Stick Duel Shadow Fight', '<p><span style="color: rgb(0, 0, 0);">Shadow stickmen are on the scene with relentless fights. Use your punches and kicks wisely and try to beat your opponent. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿When your special strike bar is full, send the fire blow to your opponent. Stick Duel Shadow Fights game can be played in 1 and 2-player modes.</span></p>', '', 'Use your punches and kicks wisely and try to beat your opponents.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li><li><span style="color: rgb(0, 0, 0);">F - to punch</span></li><li><span style="color: rgb(0, 0, 0);">G - to kick.</span></li><li>R - special kick.</li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span><span style="color: rgb(0, 0, 0);"> </span></li><li>L - to punch.</li><li><span style="color: rgb(0, 0, 0);">K - to kick.</span></li><li><span style="color: rgb(0, 0, 0);">O - special kick.</span></li></ul>');
INSERT INTO public.game_texts VALUES (65, 1, 'Puzzle Parking 3D', '<p><span style="color: rgb(0, 0, 0);">Puzzle Parking 3D is a fun puzzle parking game online and a free simulation game for kids in which you have to act as a driver and use your brain to park the car in the parking space, come and challenge yourself and you will be the next parking master. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The time has come to prove that you are a competent driver.</span></p>', '', 'Park the car in the right parking lot.', '<ul><li>Click/Tap and drag in the direction you want the car to go.</li></ul>', '');
INSERT INTO public.game_texts VALUES (65, 2, 'Puzzle Parking 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (67, 1, 'Super Solitaire', '<p><span style="color: rgb(0, 0, 0);">Play Super Solitaire - Play Klondike, Golf, and Freecell, three of the most popular solitaire games. If you are a solitaire enthusiast, Super Solitaire is the perfect game for you!</span></p><p><br></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Klondike</strong><span style="color: rgb(0, 0, 0);">: build piles of the four suits from ace to king on the foundations, move the face-up cards to a card of the next higher value if it is of the opposite color. </span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Golf:</strong><span style="color: rgb(0, 0, 0);"> remove all the cards from the tableau piles, cards may be moved from the tableau to the waste pile only if they are either one rank higher or one rank lower than the top card, regardless of suit.</span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Freecell</strong><span style="color: rgb(0, 0, 0);">: build piles of the four suits from ace to king on the foundations.</span></p><p><br></p>', '', 'Play the most popular solitaire games: Klondike, Golf, or Freecell.', '<ul><li>Click &amp; Drag.</li></ul>', '');
INSERT INTO public.game_texts VALUES (67, 2, 'Super Solitaire', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (81, 2, 'Snack Mahjong', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (82, 1, 'Vegetables Mahjong Connection', '<p>Connect all the vegetable mahjong tiles and clear the board in this html5 mahjong connection game. </p><p><br></p><p>You can only connect 2 tiles with the same items with a path with no more than two 90-degree angles. What''s the max level can you play?</p>', '', 'Connect all the vegetable tiles and clear the board.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (82, 2, 'Vegetables Mahjong Connection', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (83, 1, 'Olimpian Mahjong', '<p><span style="color: rgb(0, 0, 0);">Match identical sports tiles to remove them from the playing field. All mahjong tiles represent the kinds of winter sports that will be played at the Olympic Winter Games in Beijing in 2022.</span></p>', '', 'Match identical sports tiles to remove them from the playing field.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (83, 2, 'Olimpian Mahjong', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (52, 1, 'Dunkers Fight 2P', '<p><span style="color: rgb(0, 0, 0);">Get a lot of fun with the Dunkers Fight 2P game. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Get ready when the countdown starts and grab the ball before your opponent. Try to throw your ball and hit the pot.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">If your opponent grabs the ball from your hand, resist him and protect the pot. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿Funny 2-person game your time playing with friends at school will pass with pleasure. Enjoy!</span></p>', '', 'Play with a friend and win in this fun basketball game!', '<ul><li><span style="color: rgb(0, 0, 0);">A, D - to move. </span></li><li><span style="color: rgb(0, 0, 0);">W, S - to shoot.</span></li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️ </span><span style="color: rgb(0, 0, 0);">- to move.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️</span>⬇️<span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);"> - to shoot.</span></li></ul>');
INSERT INTO public.game_texts VALUES (53, 1, 'Basket Slam', '<p><span style="color: rgb(0, 0, 0);">Click on the screen, drag, and release to throw the ball. The goal is to throw the ball into the hoop to score points, BUT the player must slam the blue platform before!</span></p>', '', 'Click, drag and release to throw the ball into the hoop.', '<ul><li>Click, drag and release to throw the ball. You must slam the blue platform before the ball goes into the hoop.</li></ul>', '');
INSERT INTO public.game_texts VALUES (53, 2, 'Basket Slam', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (54, 1, 'Flappy Dunk', '<p><span style="color: rgb(0, 0, 0);">You need to throw a basketball into the ring. Try to go as far as possible by clicking on mouse. If you think that it is easy - just let try to play this breathtaking game.</span></p>', '', 'Try to put the ball in as many hoops as possible.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (54, 2, 'Flappy Dunk', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (55, 1, 'Basket Puzzle', '<p><span style="color: rgb(0, 0, 0);">Basket Puzzle is a challenging sliding game. Move the ball and the basket on the board at the same time to dunk the ball properly. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Finish the levels with 3 stars, and collect coins to buy new balls. Plan your strategy and good luck!</span></p>', '', 'Slide the ball into the basket.', '<ul><li><span style="color: rgb(0, 0, 0);">Use your finger, mouse, or keyboard to slide the ball into the basket. </span></li></ul>', '');
INSERT INTO public.game_texts VALUES (55, 2, 'Basket Puzzle', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (56, 1, 'Street Basketball', '<p><span style="color: rgb(0, 0, 0);">Select your favorite player and show your free throws skills! You have one minute and 25 shots to get as many balls as possible into the basket! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Striped balls are worth 2 points (instead of 1): concentrate on these special balls for extra points!</span></p>', '', 'Click at the right time so the ball lands at the half.', '<ul><li>Click/Tap at the right time.</li></ul>', '');
INSERT INTO public.game_texts VALUES (56, 2, 'Street Basketball', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (57, 1, 'Street Dunk', '<p><span style="color: rgb(0, 0, 0);">Street Dunk is a simple but very addictive game which bases on realistic physics. Street Dunk is an exciting basketball game where you can shoot a basketball in two modes of games, high score and training sessions. Good Luck!</span></p>', '', 'Aim the ball in the right direction and score as much points as you can.', '<ul><li><span style="color: rgb(0, 0, 0);">Click/Tap and drag to aim. </span></li><li><span style="color: rgb(0, 0, 0);">Release to shoot.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (57, 2, 'Street Dunk', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (58, 1, 'Football Legends 2021', '<p>Choose your favorite team and join a tournament where only the best fight for the title. Control your favorite player! You can play solo against AI opponents or play with or against your friend.</p>', '', 'Play soccer alone or with a friend.', '<ul><li>AD - to move left and right.</li><li>W - to jump.</li><li>S - to slide.</li><li>V - supershot.</li><li>B - shot.</li></ul>', '<ul><li>⬅️➡️ - to move left and right.</li><li>⬆️ - to jump.</li><li>⬇️ - to slide.</li><li>K - supershot.</li><li>L - shot.</li></ul>');
INSERT INTO public.game_texts VALUES (58, 2, 'Football Legends 2021', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (59, 1, 'Cycling Hero', '<p><span style="color: rgb(0, 0, 0);">The ultimate pro cycling race game. Use the rear wheel to knock out your pro cyclist rivals. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">- Endless bicycle race. Score as many points as you can with 3 lives.</span></p>', '', 'Race by bike and win against your opponents!', '<p><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️ - move up.</span></p><p><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬇️ - move down.</span></p><p><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬅️ - break</span></p><p><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">➡️ - accelerate</span></p>', '');
INSERT INTO public.game_texts VALUES (59, 2, 'Cycling Hero', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (60, 1, 'Drift to right', '<p><span style="color: rgb(0, 0, 0);">On a long winding road, you can drift as much as you can without hitting the side of the road. There is one thing you should pay attention to: This car is only going to the right. In sharp bends, you must maintain good control.</span></p>', '', 'Click to drift on time.', '<ul><li>Click/Tap to drift to the right.</li></ul>', '');
INSERT INTO public.game_texts VALUES (60, 2, 'Drift to right', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (61, 1, 'Super Friday Night vs Neon', '<p><span style="color: rgb(0, 0, 0);">Have fun with this new game Super Friday Night Funkin vs Neon a new game in this fabulous saga !! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play the ritual of each music, with a new 3D animated backgrounds improvement, press the game buttons at the right time and accumulate the points to show that you are the best. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">All your favorite characters are here Huggy, Sonic and many others are waiting for you. Enjoy the new 3D backgrounds and music with new characters and more levels from easy to hard.</span></p>', '', 'Use the keyword arrows to hit the notes at the right time.', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">Use ⬅️⬆️➡️⬇️ or WASD to hit the notes at the right time.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (61, 2, 'Super Friday Night vs Neon', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (70, 1, 'Pick-a-Path The Loud House', '<p>Play Pick-a-Path The Loud House Game online in your web browser and mobile at Superkidgames.com for free and more html5 games. We know for a fact that The Loud House Games is currently one of our most beloved games of Nickelodeon Games online, so, of course, we are always down to offering you new and awesome games to play in it, games such as the one you will play right now and is called Pick-a-Path The Loud House, a new point-and-click adventure game unlike it has ever been added for you!&nbsp;</p><p><br></p><p>For this kind of game, with each new part of it, you will be given two paths to choose from, two courses of action, and you have to select the one that you want. Depending on what you pick, the story is going to unfold differently, with the first story being about trying to get money and donations to make roofs for birdhouses in the park. Now, make sure to not waste too much time picking your path, because you only get 20 seconds.&nbsp;</p><p><br></p><p>Also, for some stages of the game, you have puzzles to solve, and you do it by dragging items around, such as putting the banana peels into the trash cans, since littering is not something nice. This is how your new The Loud House adventure starts, after you pick if you want to be Lincoln, Ronnie Anne, or Clyde, so start playing right now, and we hope to see you play even more of our cool new games of the day, or more Nick Games like only here can be found!</p>', '', 'You will be given two paths to choose from that will define the story.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (70, 2, 'Pick-a-Path The Loud House', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (71, 2, 'Head Soccer Pro - Head Ball 2', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (72, 1, 'Pill Soccer', '<p>Get ready for the most challenging soccer matches with Pill Soccer. Play against dozens of real players or challenge your friends on “2 Player” mode.&nbsp;</p>', '', 'Relax at a good soccer game with your friend.', '<ul><li>⬅️➡️ - to move.</li><li>⬆️ - to jump.</li><li>P or ⬇️ - to kick.</li><li>K - super bonus.</li></ul>', '<ul><li>AD - to move.</li><li>W - to jump.</li><li>S - to kick.</li></ul>');
INSERT INTO public.game_texts VALUES (72, 2, 'Pill Soccer', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (73, 1, 'Paper Fold', '<p>Fold and Create Pictures. Game with very simple mechanics, where you can only tap to fold. Once you start, it will be hard to stop. This will be one of the most relaxing times of your life.</p>', '', 'Fold the paper so the picture is whole.', '<ul><li>Click/Tap on the piece of paper you want to fold</li></ul>', '');
INSERT INTO public.game_texts VALUES (73, 2, 'Paper Fold', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (74, 1, 'Match 3D - Matching Puzzle', '<p>Get ready for a new, challenging, and original matching pairs game. You need to match 3D objects on the ground and pop them all! When you clear a level, you will find new objects to pair.</p>', '', 'Match different 3D objects.', '<ul><li>Click/Tap and Drag.</li></ul>', '');
INSERT INTO public.game_texts VALUES (74, 2, 'Match 3D - Matching Puzzle', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (75, 1, 'Tom & Jerry Run', '<p>Tom and Jerry Run is a fun endless runner game such as subway surfers! Run with Jerry through subway city and jump over obstacles to collect gold coins as in talking tom gold run!</p>', '', 'Run away from Tom and collect as much cheese as you can.', '<ul><li>⬅️➡️ - to move left and right.</li><li>⬆️ - to jump.</li><li>⬇️ - to duck.</li><li>Spacebar - for slow motion.</li></ul>', '');
INSERT INTO public.game_texts VALUES (75, 2, 'Tom & Jerry Run', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (71, 1, 'Head Soccer Pro - Head Ball 2', '<p>Enjoy exciting and fun soccer games at Head Soccer Pro. A great game that combines agility, skill, and tournaments so you can prove you can be a champion.</p><p><br></p><p>Compete in a cup against 32 teams, in group stage and elimination. Countries or Clubs, you choose. Make luxury goals, from a distance, head, or free-kick and Penalty. But beware of injuries and yellow cards.</p>', '', 'Compete in a cup against 32 teams and become a soccer champion!', '<ul><li>AD or <span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️ - to move.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">W or ⬆️ - to jump.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">Spacebar - to kick.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (76, 2, 'Zumba Mania', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (77, 2, 'Castle Defense', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (80, 1, 'Mahjong Sweet Connection', '<p>It is necessary to gradually remove two identical candies, while they should not be blocked. That is, they should have a free left or right side, and others do not lie on top. The path from one candy to its pair may not be short, but the main thing is to connect at right angles, no more than two bends.</p>', '', 'Gradually remove two identical candies by pairing them.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (77, 1, 'Castle Defense', '<p>Defend your castle in a relentless battle against hordes of terrifying enemies! Play as a range of characters, including Severidric the wizard and Gendra the princess, and stop orcs, trolls, bats, and other scary creatures from invading your castle. </p><p><br></p><p>Along the way collect coins that allow you to buy special power-ups, such as magical staffs, fireballs, and poison.&nbsp;</p><p><br></p><p>You’ll need to use all the magical spells in your power to help you succeed in your quest to keep the evil forces away!</p><p><br></p><p>Defend your castle in a relentless battle against hordes of terrifying enemies! </p><p><br></p><p>Cast your spells, destroy the enemies and increase your magical powers. The fate of the kingdom depends upon you and your powerful magic!</p>', '', 'Defend your castle and upgrade it with the awards from each win!', '<ul><li>Click/Tap to shoot at enemies and upgrade.</li></ul>', '');
INSERT INTO public.game_texts VALUES (78, 1, 'Amelies Mahjong', '<p>Endless random generated Mahjong Solitaire game.</p>', '', 'Endless random generated Mahjong Solitaire game.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (78, 2, 'Amelies Mahjong', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (79, 1, 'Mahjong FireFly', '<p>What do you know about Fireflies? Small, but strong: use the power of these tiny creatures to enlighten your path to victory in our new classic mahjong! You''re also empowered with unusual special tiles to help you progress through the challenging levels. Explore the game and play around with all of them!</p>', '', 'A classic mahjong game, where you have find the matching cards.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (79, 2, 'Mahjong FireFly', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (80, 2, 'Mahjong Sweet Connection', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (94, 2, 'Yarn Untangled', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (121, 1, 'Wedding Planner', '<p>Wedding Planner is a fun girl''s game with multiple game modes and amazing graphics. The player can customize the bride and the groom. Play Wedding Planner for a fun dress-up game!&nbsp;</p>', '', 'Plan a wedding, from dressing up to decorating the cake.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (121, 2, 'Wedding Planner', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (84, 1, 'Advent Mahjong', '<p><span style="color: rgb(0, 0, 0);">Advent Mahjong is a connect Mahjong in a Christmas setting. By passing a level you get one day closer to Christmas and the closer you get the more challenging the levels are.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Clear the game field by clicking on pairs of identical tiles. Tiles can be removed only if between them you can draw not more than 3 lines. You can rotate the tiles by clicking on the boxes with the rotation sign and moving the tiles by pressing on the arrows.</span></p>', '', 'Advent Mahjong is a connect Mahjong in a Christmas setting.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (84, 2, 'Advent Mahjong', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (85, 1, 'Mahjong Crush Saga', '<p><span style="color: rgb(0, 0, 0);">An addictive game to train your eyes and brain. Match the pairs of the same tiles to clear them. You need to clear all the tiles before the time runs out, then play as fast as possible. Have fun!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Features: 36 levels to play!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Tap each pair of the same tile to clear them.</span></p>', '', 'An addictive mahjong game to train your eyes and brain.', '<ul><li><span style="color: rgb(0, 0, 0);">Click/Tap on each pair of the same tile to clear them.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (85, 2, 'Mahjong Crush Saga', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (86, 1, 'Valentine Mahjong', '<p><span style="color: rgb(0, 0, 0);">Valentine Mahjong is a fun and exciting game of Mahjong with extra servings of love! Use your skills, strategy, and luck to complete the game! There are some handy features to help you complete the full game.</span></p>', '', 'Pair the same love cards in time and win the game.', '<ul><li>Click on the cards you want to pair.</li></ul>', '');
INSERT INTO public.game_texts VALUES (86, 2, 'Valentine Mahjong', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (87, 1, 'Mahjong Dynasty', '<p>"Mahjong Dynasty" is a journey through Asia.&nbsp;</p><p><br></p><p>Connect the tiles to clear the board and complete all the levels with 3 stars.</p>', '', 'Connect the tiles to clear the board and complete the levels.', '<ul><li>Click/Tap on the tiles to pair them</li></ul>', '');
INSERT INTO public.game_texts VALUES (87, 2, 'Mahjong Dynasty', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (88, 1, 'Tile Mahjong', '<p><span style="color: rgb(0, 0, 0);">Tile Mahjong is a fun tile connect matching game! Casual and Fun! The aim of the game is to match each tile with the same symbol, only opened tile can be connected which makes it more challenging.</span></p>', '', 'You have only 3 minutes to pair lots of tiles.', '<ul><li>Click/Tap on the tiles to pair them.</li></ul>', '');
INSERT INTO public.game_texts VALUES (88, 2, 'Tile Mahjong', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (89, 2, 'Solitaire Story Tripeaks 3', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (90, 1, '4 Colors Classic', '<p><span style="color: rgb(0, 0, 0);">Do you miss the fun and addictive game 4 Colors Classic? Or have you never played this great game? Then go ahead, choose a character and take part in wonderful friendly competitions. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">A perfectly recreated atmosphere of the game, detailed instructions, simple controls, and many interesting opponents who are ready at any time to keep your company are waiting for you.</span></p><p><br></p><p><br></p><p><span style="color: rgb(0, 0, 0);">• Addictive gameplay • Bright and colorful graphics • Detailed game rules • Convenient controls</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Choose the number of players. Match cards by color or number and be the first to get rid of them. Action cards run the game. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The next player in sequence draws two cards and misses a turn. </span></p><p><span style="color: rgb(0, 0, 0);">The skip card stops the player. </span></p><p><span style="color: rgb(0, 0, 0);">The reverse card switches the direction of the turn to the opposite.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">A wild card can be placed on any card at any time and allows you to change the color of the card. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>The wild draw four is a special card, that allows you to change the color of the card and forces the next player to pick 4 cards.</span></p>', '', 'Play the addictive game of 4 colors classic.', '<ul><li>Tap/Click on the cards.</li></ul>', '');
INSERT INTO public.game_texts VALUES (90, 2, '4 Colors Classic', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (91, 1, 'Fun Halloween Memory', '<p><span style="color: rgb(0, 0, 0);">Fun Halloween Memory is a free online game from the genre of memory and Halloween games. Flip the tiles and try to match them up in pairs. Pair up all the tiles to win. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Try to complete the game in as few moves as possible! There are is 14 levels. Use the mouse to click or tap to screen on the squares. Concentrate and start to play. Enjoy!</span></p>', '', 'Flip the tiles and match them in as few moves as you can!', '<ul><li>Click/Tap on the cards to flip them.</li></ul>', '');
INSERT INTO public.game_texts VALUES (91, 2, 'Fun Halloween Memory', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (92, 1, 'Blackjack Vegas 21', '<p><span style="color: rgb(0, 0, 0);">A classic blackjack game. Play against the house. Stack your chips up high. Simple and straight-to-the-point gameplay. Ran out of chips? Wait to receive more. Double, hit, or stand. What do you do?</span></p>', '', 'A classic blackjack game where you play against the house.', '<ul><li>Click/Tap on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (92, 2, 'Blackjack Vegas 21', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (93, 1, 'Mansion Solitaire', '<p><span style="color: rgb(0, 0, 0);">A solitaire game to build a mansion from bottom to top by placing cards through calculation. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>There are two difficulties in this game. In the normal mode and hard mode. In normal mode, you need to build a 4-floor mansion, in hard mode, you need to build a 5-floor mansion.</span></p>', '', 'Build a mansion of cards.', '<ul><li>Click/Tap on the cards.</li></ul>', '');
INSERT INTO public.game_texts VALUES (93, 2, 'Mansion Solitaire', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (94, 1, 'Yarn Untangled', '<p><span style="color: rgb(0, 0, 0);">Yarn untangled is a cute puzzle game with unlimited levels. Can you untangle all the yarns? The kitties are ready to accompany you to solve all the levels.</span></p>', '', 'Untangle all the yarns, unlimited levels.', '<ul><li>Click/Tap on a ball to move it.</li></ul>', '');
INSERT INTO public.game_texts VALUES (95, 1, 'MathPup Golf 4 Algebra', '<p>MathPup loves golf and algebra. This educational golf game combines both of those. 30 holes to play without any time limit but you will have to answer basic algebra questions to play each hole and if you hit the ball in the water or sandtrap you''ll have to answer an algebra problem correctly to remove the penalty. </p><p><br></p><p>If you need help completing a hole or just want to see how to play, click on the Video button on the main menu to see the overview video along with how to complete each hole.</p>', '', 'Test your skills in algebra and golf.', '<ul><li>Click/Tap to select the right answer.</li><li>Swipe to set the angle and power of each shot. Release the ball when you are ready.</li></ul>', '');
INSERT INTO public.game_texts VALUES (95, 2, 'MathPup Golf 4 Algebra', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (96, 1, 'Math Charge Multiplication', '<p>Sink the enemy subs before they sink you. Just dial in their depth (which happens to be the answer to their multiplication problem) and let the depth charges fly. Avoid their torpedoes to keep your health above zero.</p>', '', 'Sink the enemy submarines before they sink you.', '<ul><li>AD or <span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️ - to move the ship.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">Click on the numbers - to write the right answer.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (96, 2, 'Math Charge Multiplication', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (97, 1, 'Worlds Builder', '<p><span style="color: rgb(0, 0, 0);">Command the powerful forces of nature to bring the world of your vision into life! Create earth and divide it from water, erect mountains and fire up volcanoes; spread boundless sands, lush forests, and golden fields all over your land. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Raise a mighty civilization and lead it from ancient times into the space era. Nature, technology, and society: all bend to your will... Explore, trade, procreate!</span></p>', '', 'Create a whole world from the beginning and guide its civilization.', '<ul><li>Click on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (97, 2, 'Worlds Builder', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (98, 1, 'Food Empire Inc', '<p><span style="color: rgb(0, 0, 0);">Grow your sky farm empire and be a high-tech billionaire in this idle farming game. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Grow lettuce, strawberry, watermelon, lavender, mint, carrots, tomatoes, and even GINSENG, in the sky! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The FUTURE is HERE.</span></p><p><span style="color: rgb(0, 0, 0);">Use the coins to upgrade your operations. </span></p><p><span style="color: rgb(0, 0, 0);">Hire sophisticated managers to automate your tasks. </span></p><p><span style="color: rgb(0, 0, 0);">Build new sky farms, high in the sky. Earn money while you sleep, from your Food Empire. </span></p><p><span style="color: rgb(0, 0, 0);">Attract investors to your sky farm venture business, and cash out with tons of profit.</span></p>', '', 'Grow your sky farm empire and be a high-tech billionaire.', '<ul><li><span style="color: rgb(0, 0, 0);">Tap on your lab workers to start farming.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (98, 2, 'Food Empire Inc', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (99, 2, 'Minegame', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (100, 1, 'Building Rush', '<p>The new town is under construction – the perfect opportunity to earn money! Build plants to produce and sell the building materials. Earning medals and achievements will give you upgrade points. Spend them to increase your productivity. Replay levels to improve your result, and receive more upgrade points.</p><p><br></p><p>A bronze medal gives you 100 points, a silver gives +50, a gold +50 more, and every $10 over the golden medal requirements will give you 1 upgrade point.&nbsp;</p>', '', 'Construct a new town and earn money by building plants.', '<ul><li>Click, hold and drag to see the map.</li><li>WASD or ⬅️⬆️➡️ – to move cameras&nbsp;</li><li>Use numbers to quickly select a plant (1 for the first one, 2 for the second one, etc.</li><li><strong>For big maps</strong>: You can select a plant and the game will zoom in on that plant.</li></ul>', '');
INSERT INTO public.game_texts VALUES (100, 2, 'Building Rush', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (101, 1, 'Idle Startup Tycoon', '<p><span style="color: rgb(0, 0, 0);">Grow your startup empire and be a high-tech billionaire tycoon in this idle simulation game. Launch multiple startups which include a food delivery O2O app, a mobile game company, a ridesharing app, a live-streaming app, an Internet of Things (IoT) venture, infosec, drones, Artificial Intelligence (AI), and of course, suborbital space tourism start-up. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Code a start-up idea in a cool co-working space. Transfer it to the cloud servers. Then, pass it on to the Sales Managers to earn cash. Upgrade your cash collection efficiency at multiple strategic stations. Too tired to click? </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Hire sophisticated smartly dressed managers to automate your tasks. Earn coins while you sleep, from your multiple start-up ventures. Attract investors to invest in your start-ups, and cash out with tons of profit. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Did we say, high-tech billionaire? No, we mean trillionaire, because this game is for real.</span></p>', '', 'Build and grow your startup empire.', '<ul><li>Click on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (101, 2, 'Idle Startup Tycoon', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (120, 1, 'Triple Jack', '<p>Triple Jack is a version of Black Jack where you can make three stacks on the playing field. The combo meter rises every time you get 21. Go over 21 and you are bust. Bust three times and it''s game over.</p>', '', 'A version of Black Jack, where you can''t go over 21.', '<ul><li>Click on the cards.</li></ul><p><br></p><ul><li>Try to match up until 21 points, and aim for a Black or Triple Jack!</li></ul><p><br></p><ul><li>All face cards have a value of 10, except for the Ace, which is worth 1 or 11 points.</li></ul><p><br></p><ul><li>If you go over 21, you are busted! If you get busted more than 2 times, you will lose the game.</li></ul>', '');
INSERT INTO public.game_texts VALUES (120, 2, 'Triple Jack', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (122, 1, 'Rainbow Social Media Influencers', '<p><span style="color: rgb(0, 0, 0);">Meet the famous Rainbow Influencers who set the tone for spring fashion! Down with dull colors, long live bright shades! Join the colorful spring fashion, choose from many colorful outfits and hairstyles. Don''t forget bright fresh makeup. Fashion 2022 says yes to bright colors, super-comfortable fabrics, soft textures and simple silhouettes. Sequins is another huge trend that has been all over the catwalks. Everyday glitter in the summer of 2022 will become the norm!</span></p>', '', 'Dress the famous Rainbow Influencers!', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (122, 2, 'Rainbow Social Media Influencers', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (102, 1, 'Video Game Tycoon', '<p><span style="color: rgb(0, 0, 0);">Run your own video game company Become the creator, Tap &amp; Build your game company by making games, hiring employees, making money, upgrading, and building your idle studio! Tap! Tap! Tapped! Upgrade &amp; grow - Plan your cash investments and level up your studio with multiple story upgrades. Create an empire from scratch.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Make different games, customize them, name them and launch them! You can even update them! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Customize game icons using the icon customization tool and create select, edit, modify your game icons, and design the best game icon for your games.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Profit from a smart game or two to boost your economy and create your own video game dev company story. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Make games for PC / Computer, Consoles, Mobiles, and more! Become the best video game creator for PC / Computer Consoles, Mobile. </span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Game analytics and more</strong><span style="color: rgb(0, 0, 0);"> </span></p><p><span style="color: rgb(0, 0, 0);">As a creator, you must check ratings and reviews of your games created on PC / Computer, Console, and Mobile. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Also, check statistics such as the number of installs and uninstalls of your games and become the best video game creator and a leader in the games industry.</span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Hire Employees</strong><span style="color: rgb(0, 0, 0);"> </span></p><p><span style="color: rgb(0, 0, 0);">Hire and manage employees to increase your money per click. Automate your tap tap workflow to increase your idle income. Hire employees, name them, customize them and hire them! Every employee has a special clicker tycoon effect. Get a glimpse of the story of their lives by reading cool and funny messages from employees either thinking or talking. </span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Run Operations &amp; Earn Passive Income</strong><span style="color: rgb(0, 0, 0);"> </span></p><p><span style="color: rgb(0, 0, 0);">Get idle cash, even when you are offline. As a creator of games, you have to buy PCs / Computers, consoles, laptops, mobiles for testing games, get internet, etc. Get whatever it takes to keep the company going and earn benefits in the form of passive income.</span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Customize Your Office</strong><span style="color: rgb(0, 0, 0);"> </span></p><p><span style="color: rgb(0, 0, 0);">Unlock cool items/accessories as you level up followed by in-game cash bonuses. You can re-arrange and move everything from employees to office tables, PC / Computer desks, and all kinds of props that you unlock in the game, very easy to customize your own office the way you want! </span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Prestige Option</strong><span style="color: rgb(0, 0, 0);"> </span></p><p><span style="color: rgb(0, 0, 0);">When the game goes slower than you would want, you can use the prestige option to make the game simulation more interesting by getting multiplier bonuses and working your way back to the top even quicker than you could possibly do before!</span></p><p><br></p>', '', 'Run your own video game company.', '<ul><li>Click to upgrade, make money and games.</li></ul>', '');
INSERT INTO public.game_texts VALUES (102, 2, 'Video Game Tycoon', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (103, 1, 'Smartphone Tycoon', '<ul><li><span style="color: rgb(0, 0, 0);">Run your own mobile smartphone company </span></li><li><span style="color: rgb(0, 0, 0);">Make and design awesome smartphones </span></li><li><span style="color: rgb(0, 0, 0);">Phone customization, create, select, edit, modify your smartphones and design the best smartphone for your business </span></li><li><span style="color: rgb(0, 0, 0);">Manage up to 29 employees to unlock, name them, customize them and hire them! </span></li><li><span style="color: rgb(0, 0, 0);">Unlock cool items/accessories as you level up followed by in-game cash bonuses </span></li><li><span style="color: rgb(0, 0, 0);">Prestige Option to make the game making simulation more interesting</span></li></ul>', '', 'Run your own mobile smartphone company.', '<ul><li>Click to make money and upgrades.</li></ul>', '');
INSERT INTO public.game_texts VALUES (103, 2, 'Smartphone Tycoon', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (104, 1, 'Hotel Tycoon Empire', '<p><strong style="color: rgb(0, 0, 0);">Run your own Hotel like a Business </strong></p><p><span style="color: rgb(0, 0, 0);">Tycoon Idle click and Tap through your way from a small motel to a grand hotel empire, create and build everything from scratch, make smart and strategic business decisions, hire smart employees, expand the hotel, run daily operations, take good care of customers and keep them happy. </span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Expand the Hotel Business</strong><span style="color: rgb(0, 0, 0);"> </span></p><p><span style="color: rgb(0, 0, 0);">Expand your motel to hotel from 1st floor to 10th and more floors! You can make the rooms bigger and better as you expand and grow your business. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Use Tap-tap or idle clicker method and create a gym for customers to workout or let the customers workout by taking a swim in the swimming pool. Create a café or a restaurant, or a casino to play games or go to a Spa to get some skincare or get a massage! </span></p><p><br></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Hire Employees </strong></p><p><span style="color: rgb(0, 0, 0);">To become a hotel tycoon, you need to hire great employees. As the business grows bigger, manage your staff efficiently you will need to hire multiple employees ranging from a receptionist to a gym instructor for helping out with workout sessions for customers, from a café barista to a restaurant waiter, from a cleaning staff manager to casino manager to help customers with games and so on. Employ cooks, bartenders, or porters and recruit maintenance workers and cleaning services. The employees will help grow your clicker empire! </span></p><p><br></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Run Operations &amp; Earn Passive</strong><span style="color: rgb(0, 0, 0);"> Income Run daily business operations such as improving the gym workout sessions or improving the swimming pool or the café, restaurant, casino, spa, and massage centers. Organize special tours, diving courses, ski lessons, spa sessions, fun games, and sightseeing tours around the premises. Don’t forget to enhance the comfort inside your hotel walls. Give the best possible room service, decorate your hall, improve the resting area, offer the best catering and buffet in town, or tender your laundry service to your visitors during the cleaning time. </span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Customize Your Hotel </strong></p><p><span style="color: rgb(0, 0, 0);">Unlock various items and customize your hotel. You will either get them as free gifts or you will unlock them as you progress further. The quicker you expand your business the more reward opportunities you will get! </span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);">Prestige</strong><span style="color: rgb(0, 0, 0);"> </span></p><p><span style="color: rgb(0, 0, 0);">There will be times when after expanding so much, your business slows down a bit, this is the right time to prestige! Prestige helps to reset the progress of the game and opens up additional fun elements of the game. You can, however, choose to start over from scratch again with a speedy incremental and idle clicker boost.</span></p>', '', 'Tap your way through from a small motel to a grand hotel.', '<ul><li>Click to earn money and upgrade.</li></ul>', '');
INSERT INTO public.game_texts VALUES (104, 2, 'Hotel Tycoon Empire', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (105, 1, 'Loving Couple Jigsaw', '<p>Loving Couple Jigsaw is a free online game in the jigsaw puzzle genre. You have 6 images in Valentine''s theme in three modes to play.&nbsp;</p><p><br></p><p>Choose one of the modes for the game that you previously choose and start it playing. Drag and drop the pieces to solve the puzzle and create an image. Enjoy, and have fun!</p>', '', 'A jigsaw with 6 images in Valentine''s theme.', '<ul><li>Click, hold and drag the puzzle piece to its place.</li></ul>', '');
INSERT INTO public.game_texts VALUES (105, 2, 'Loving Couple Jigsaw', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (106, 1, 'Birthday Girl Jigsaw', '<p><span style="color: rgb(0, 0, 0);">Welcome to our newest Birthday Girl Jigsaw game. In this game, you have 6 images. Choose one of the modes for the game that you previously choose and start it playing. Drag and drop the pieces to solve the puzzle and create an image. Enjoy, and have fun!</span></p>', '', ' Drag and drop the pieces to solve the puzzle and create an image.', '<ul><li><span style="color: rgb(0, 0, 0);">Drag and drop the pieces to solve the puzzle and create an image.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (106, 2, 'Birthday Girl Jigsaw', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (107, 1, 'German Fastest Cars Jigsaw', '<p><span style="color: rgb(0, 0, 0);">German Fastest Cars Jigsaw is a free online game in the jigsaw puzzle genre. You have 6 images in three modes to play. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Choose one of the modes for the game that you previously choose and start it to play. Drag and drop the pieces to solve the puzzle and create an image. Enjoy, and have fun!</span></p>', '', 'Solve the puzzles of the German fastest cars.', '<ul><li><span style="color: rgb(0, 0, 0);">Drag and drop the pieces to solve the puzzle and create an image.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (107, 2, 'German Fastest Cars Jigsaw', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (118, 1, 'Fairy Puzzle', '<p><span style="color: rgb(0, 0, 0);">Family jigsaw puzzle with large pieces. The game has 50 levels with different colorful pictures. Knights and dragons, castles and landscapes, pirates and pyramids, and much more is waiting for you in the game!</span></p>', '', 'Family jigsaw fairy puzzle with large pieces.', '<ul><li><span style="color: rgb(0, 0, 0);">Drag and drop a matching puzzle piece onto another to join them and complete the puzzle.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (118, 2, 'Fairy puzzle', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (119, 1, 'Christmas Pop it Jigsaw', '<p><span style="color: rgb(0, 0, 0);">Christmas Pop It Jigsaw is a free online game in the jigsaw puzzle genre. You have 6 images in the Christmas - Winter theme in three modes to play. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Choose one of the modes for the game and start playing. Drag and drop the pieces to solve the puzzle and create an image. Enjoy, and have fun!</span></p>', '', 'Solve Christmas Pop it puzzles in 3 possible modes.', '<ul><li><span style="color: rgb(0, 0, 0);">Drag and drop a matching puzzle piece onto another to join them and complete the puzzle.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (119, 2, 'Christmas Pop it Jigsaw', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (163, 2, 'Word Search', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (123, 1, 'Marie Prepares Treat', '<p><span style="color: rgb(0, 0, 0);">Princess Marie loves to cook. Holidays are approaching and the girl decided to cook her boyfriend a delicious surprise. Join us and find out the recipe for delicious handmade chocolates. Use different types of chocolate: dark, white, and milk. Add nuts and a lot of culinary decorations: sprinkles, fruit, lollipops, and much more! Then comes the turn of baking. Bake cupcakes. Decorate them with cream, fruit, and sprinkles. It remains to choose a festive dress and a cocktail. The threat is ready!</span></p>', '', 'Help Marie cook a delicious surprise for her boyfriend.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (123, 2, 'Marie Prepares Treat', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (124, 1, 'BFFs Trendy Squad Fashion', '<p><span style="color: rgb(0, 0, 0);">Welcome to the BFFs Trendy Squad Fashion. Barbie and her friends have a discussion on the weekend plan. And they come up with an idea to get ready for an upcoming fashion event. It’s a “Squad Fashion”. They all get excited to show their fashion skill. Join and help the girls in preparation. Have fun!</span></p>', '', 'Help the BFFs Squad dress up for the upcoming event.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (124, 2, 'BFFs Trendy Squad Fashion', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (125, 1, 'Tactical Princess', '<p><span style="color: rgb(0, 0, 0);">A holiday dedicated to the defenders of the Fatherland is approaching. The princesses decided to celebrate it with a paintball match. Train your memory and help the princesses collect equipment for the tournament. Which of the girls will become the most stylish tactical princess?</span></p>', '', 'Train your memory and help the princess collect equipment.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (125, 2, 'Tactical Princess', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (126, 1, 'Owl and Rabbit fashion', '<p><span style="color: rgb(0, 0, 0);">Looking for a creative and engaging game for your kids? Look no further than Owl and Rabbit Fashion! With amazing graphics and endless customization options, this game is sure to keep your little ones entertained for hours on end. So hop on and play Owl and Rabbit Fashion – you won''t regret it!</span></p>', '', 'Dress the cute owls and rabbits as you wish.', '<ul><li>Click/Tap</li></ul>', '');
INSERT INTO public.game_texts VALUES (126, 2, 'Owl and Rabbit fashion', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (127, 1, 'Your Favorite Royal Couple', '<p><span style="color: rgb(0, 0, 0);">Choose your pair of favorites for Valentine''s Day! Who will it be? Maybe a wonderful pair of wizards - Princess Eliza and Jack Frost? Or the enamored from distant Agroba - an oriental princess and Prince Ali? Or maybe the rulers of great sea power - Prince Eric and the Little Mermaid? Rather, prepare the participants for the fashion show. Choose luxurious dresses for princesses and gorgeous outfits for princes. Makeup, hair, and accessories complete the look.&nbsp;</span></p>', '', 'Dress royal couples for Valentine''s day.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (127, 2, 'Your Favorite Royal Couple', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (128, 1, 'Korean Supermodel Makeup', '<p><span style="color: rgb(0, 0, 0);">The South Korean model became the star of the catwalks and won the love of millions of compatriots. Deciding to learn a new profession, Jong made her debut on the silver screen and gained worldwide popularity and many times more fans. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The model opened her professional biography on the catwalk at the age of 16. In those years, the aspiring model did not even have an agent, however, when she appeared at Seoul Fashion Week, the girl impressed the representatives of the fashion industry with her fiery red hairdo, cheeky smile, and strong-willed character. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Let''s learn the role of makeup artist and stylist for a young model. Pick up trendy makeup, hairstyle, and accessories for Jong. Take a photo for Instagram and get likes!</span></p>', '', 'Dress up a new young model which impressed everyone.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (128, 2, 'Korean Supermodel Makeup', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (99, 1, 'Minegame', '<p>Build and destroy in the world of Minecraft.</p>', '', 'Build and destroy in the world of Minecraft.', '<ul><li>WASD or <span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move</span></li><li>Left Shift - to sprint.</li><li>Scroll Wheel - to switch block.</li><li>Space - to jump.</li><li>Right Mouse Button - to place a block.</li><li>Left Mouse Button - to destroy a block.</li><li>Middle Mouse Button - to get a block highlighted.</li><li>E - to view inventory.</li><li>Escape: to Pause/Resume.</li></ul>', '');
INSERT INTO public.game_texts VALUES (46, 1, 'Hole.io', '<p><strong style="color: rgb(32, 33, 36);">Control your round hole and consume everything on your path: cars, houses, people! Engage in battles with other holes in the same city</strong><span style="color: rgb(32, 33, 36);">. </span></p><p><br></p><p><span style="color: rgb(32, 33, 36);">Grow bigger and more powerful but beware of other players &amp; their holes may be bigger than yours and pull you in. This game literally sucks you in!</span></p><p><br></p><p><em style="color: rgb(46, 44, 43);">Hole.io</em><span style="color: rgb(46, 44, 43);">&nbsp;is easily one of the most engrossing–and all-around best–.io games on the internet. Taking place in a fully 3D environment, the game presents a more nuanced take on the big-thing-eat-small-thing formula prevalent in .io titles.</span></p>', '', 'Start as a small black hole and expand by absorbing more objects.', '<p>WASD or <span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span> or your mouse cursor - to move.</p>', '');
INSERT INTO public.game_texts VALUES (129, 1, 'Rainbow Insta Girls', '<p><span style="color: rgb(0, 0, 0);">Get to know the students of the Rainbow School better. These girls love trendy clothes and bright hairstyles. This helps them become Instagram stars. The friends even managed to draw the guys into this fashion adventure. Join the fun and try on outfits with the girls. An incredible rainbow whirlpool and a colorful extravaganza await you!</span></p>', '', 'Help the girls dress up and become Instagram stars.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (129, 2, 'Rainbow Insta Girls', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (161, 1, 'Word Guess', '<p><span style="color: rgb(0, 0, 0);">Word Guess is a HTML5 game where you have six chances to guess a randomly selected word. Each time you guess, you''re told which of your chosen letters are in the target word, and whether they are in the right place.</span></p>', '', 'You have 6 chances to guess a word.', '<ul><li>Type the letters with your keyboard or</li><li>Click/Tap on the letters on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (161, 2, 'Word Guess', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (130, 1, 'New Years Kigurumi', '<p><span style="color: rgb(0, 0, 0);">What does it take to make this New Year the coziest holiday? Everything is very simple: instead of a tedious choice of outfit, you can dress in funny home pajamas - Kigurumi! It will be a real New Years'' pajama party! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Join princesses Eliza and Jacqueline, do some fun New Year''s makeup, and choose your favorite pajamas. It can be a Kigurumi-tiger, a Christmas tree, or Santa Claus, or maybe you want to be a funny unicorn or a dragon? </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Put on your pajamas, and cute slippers, and pour some hot chocolate! Celebrate the New Year comfortably by playing the game New Year''s Kigurumi.</span></p>', '', 'Dress the princesses Eliza and Jacqueline for New year.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (130, 2, 'New Years Kigurumi', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (224, 1, 'Robot Awake', '<p><span style="color: rgb(0, 0, 0);">Robot Awake is a puzzle game to wake the robots by directing the laser to power them to complete the level. There are 100 challenging levels that get more difficult as you proceed. Can you solve all levels?</span></p>', '', 'A relaxing puzzle game where you need to find a way to wake the robots.', '<ul><li>Click/Tap on the lasers to direct them in the right way.</li></ul>', '');
INSERT INTO public.game_texts VALUES (131, 1, 'Cute Tiger Cub Care', '<p><span style="color: rgb(0, 0, 0);">Everyone knows that the symbol of this year is the Blue Water Tiger! The blue color symbolizes impermanence, water is moving, and the tiger is one of the most unpredictable and energetic animals. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Therefore, those people who are not afraid of changes, lead an active lifestyle, and like to be constantly on the move will be on the horse. In traditional Chinese astrology, the Water Tiger is a big fan of purposeful and hardworking people. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Let''s help this year''s mascot - a cute tiger cub. He''s a little sick. We need to cure him and prepare him for the new active year! Choose cute outfits and accessories for the tiger cub so that he pleases his fans all year round!</span></p>', '', 'Help the little tiger heal and dress him up for the new year.', '<ul><li>Click/Tap.</li><li>Click, hold and drag.</li></ul>', '');
INSERT INTO public.game_texts VALUES (131, 2, 'Cute Tiger Cub Care', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (132, 1, 'Rainbow Girls Hollywood Story', '<p><span style="color: rgb(0, 0, 0);">Hey girls! Welcome to the new Rainbow Girls Hollywood Story game. Rainbow high school girls Skyler, Sunny, Ruby, and Violet are invited to a Hollywood-themed dress-up party. They are been so excited and planned to be the best at the party. Join the girls and have fun!</span></p>', '', 'Dress up Skyler, Sunny, Ruby and Violet for the party!', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (132, 2, 'Rainbow Girls Hollywood Story', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (133, 1, 'Funny Daycare', '<p>Funny Daycare is a fun, loving game to play with various cute animal characters in a daycare center. You''ll become a babysitter and take care of them. This game provides some creative tasks like bathing the babies, playing with them, preparing delicious meals, and dressing them up. Let your imagination fly by exploring and playing with Funny Daycare!</p>', '', 'Take care of various cute animals at the daycare center!', '<ul><li>Click/Tap.</li><li>Press.</li><li>Hold and drag.</li></ul>', '');
INSERT INTO public.game_texts VALUES (133, 2, 'Funny Daycare', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (154, 1, 'Monster Popsy Surprise Dolls', '<p><span style="color: rgb(0, 0, 0);">Meet popsy - surprise dolls in extraordinary images of fairy monsters. But our monsters are very cute and completely harmless! Just look at this centaur, the little mermaid, and the satyr! Horns, tails, and hooves fit them very well. Match your dolls with magical hairstyles, fabulous makeup, and fashionable clothes. Now our monster-popsy - surprise dolls are the most stylish in the fairy kingdom!</span></p>', '', 'Match the dolls with magical hairstyles, makeup and clothes.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (154, 2, 'Monster Popsy Surprise Dolls', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (155, 1, 'Angela All Season Fashion', '<p><span style="color: rgb(0, 0, 0);">Dress up Angela the cat for all of the seasons in the year!</span></p>', '', 'Dress up Angela the cat for all of the seasons in the year!', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (155, 2, 'Angela All Season Fashion', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (156, 1, 'Princess Maid Academy', '<p><span style="color: rgb(0, 0, 0);">The princess needs a new maid because she has so many things to do - receptions, meeting ambassadors of other states, charity balls. And someone at this time must maintain order in the palace and in the wardrobe of the princess. Where can you find the right person? Of course at the princess maid academy! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Only there are maids of the highest class trained, their outfits are only slightly inferior in beauty to the dresses of princesses, and their hairstyle and posture are always impeccable. The strict black and white style of outfits can sometimes be diluted with pink, blue, and lilac shades. A white apron is a must-have for a diligent maid. Choose the most stylish and flawless maid for your princess!</span></p>', '', 'Prepare the new maid so she can start working for the princess.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (156, 2, 'Princess Maid Academy', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (157, 1, 'Jasmine Beauty Salon', '<p><span style="color: rgb(0, 0, 0);">If you''re looking for a total makeover, Jasmine is your girl! With amazing graphics and tons of customization options, Jasmine Beauty Salon is the perfect game for anyone who loves fashion and beauty. So get ready to glam up Jasmine in this exciting new makeover game!</span></p>', '', 'If you''re looking for a total makeover, Jasmine is your girl!', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (157, 2, 'Jasmine Beauty Salon', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (158, 1, 'Perfect Salon', '<p><span style="color: rgb(0, 0, 0);">Some people need a stylist. This is you who will help them out and win their hearts! In this game, you can make a diverse makeup for completely different people, receive rewards for this and see the sincere emotions of people who are grateful to you for your work.</span></p>', '', 'Create diverse makeup for completely different people.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (158, 2, 'Perfect Salon', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (159, 1, 'Love Horoscope For Princesses', '<p><span style="color: rgb(0, 0, 0);">Do you like horoscopes? What is your zodiac sign? Let''s have fun with the princesses and pick them a romantic outfit for Valentine''s Day, corresponding to their zodiac sign. Fiery Aries, Blooming Capricorn, or Sweet Virgin - only you decide who our princess will reincarnate into. Hurry up, Star Prince is already waiting for a date with the princess!</span></p>', '', 'Pick a romantic outfit for the Princesses.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (159, 2, 'Love Horoscope For Princesses', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (160, 1, 'College Toga Party Dressup', '<p><span style="color: rgb(0, 0, 0);">Princess Emma, Mia, and Belle are going to attend their college Toga party tonight.  Could you help them choose the best looks for each of them?</span></p>', '', 'Can you help the princesses choose the best looks for each of them?', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (160, 2, 'College Toga Party Dressup', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (162, 1, 'Type or Die', '<p><span style="color: rgb(0, 0, 0);">Type Or Die plays like a typing racing puzzle game. Both your character and AI opponents are going to climb top of the ladders and win. Every checkpoint has a question with the same first letter word of the whole current level. You need to remember the words from vegetables, fruits, countries, and so on. If you can''t offer the correct answer quickly, you will be covered by the flood. Good luck and have a good time!</span></p>', '', 'Type the right words quickly and win the race.', '<ul><li>Type the words.</li></ul>', '');
INSERT INTO public.game_texts VALUES (162, 2, 'Type or Die', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (163, 1, 'Word Search', '<p><span style="color: rgb(0, 0, 0);">Welcome to Word Search, a puzzle game that will put your sleuth skills to the test in a fun way. Sift through a sea of letters to find the words on the list and scratch them out. Challenge yourself and try to solve each puzzle in the shortest time each time.</span></p>', '', 'Find the words on the list as fast as you can.', '<ul><li>Click/Tap, hold and drag.</li></ul>', '');
INSERT INTO public.game_texts VALUES (164, 1, 'Circus Words', '<p><span style="color: rgb(0, 0, 0);">Play Circus Words to begin training your brain and to become a vocabulary master! It’s time to discover mystery hidden words and build as many words as possible! Workout your brain in our brain puzzle with many challenging levels. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">✜ Simple, easy, and intuitive gameplay! ✜ Hundreds of Levels with Thousands of Words await you! </span></p><p><span style="color: rgb(0, 0, 0);">✜ Discover extra words for bonus gold ✜ Invite your friends and receive daily prizes </span></p><p><span style="color: rgb(0, 0, 0);">✜ Use Hints or Ask your friend to help </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Share the fun with your family and friends and enjoy Circus Words together!</span></p>', '', 'Discover as many words as possible.', '<ul><li>Click/Tap, hold and drag.</li></ul>', '');
INSERT INTO public.game_texts VALUES (164, 2, 'Circus Words', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (165, 1, 'Fishing Guru', '<p><span style="color: rgb(0, 0, 0);">You''re sitting on a boat in the middle of a lake. Calm waters. Suddenly, a mob of angry-looking fish starts coming at you. Type the words in time, to catch the fish. Don''t let them get to the boat! This is the time when you step up. Be the fishing guru that you are. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Features:</span></p><ul><li><span style="color: rgb(0, 0, 0);">Basic tutorial to start playing </span></li><li><span style="color: rgb(0, 0, 0);">Unlimited waves </span></li><li><span style="color: rgb(0, 0, 0);">Calm theme, suitable for virtual fishing</span></li></ul>', '', 'Type the words as quickly as possible to survive.', '<ul><li>Type as quickly as possible.</li></ul>', '');
INSERT INTO public.game_texts VALUES (165, 2, 'Fishing Guru', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (166, 1, 'Word Chef', '<p><span style="color: rgb(0, 0, 0);">Are you ready for a great adventure with the chef in the kitchen? Find all the words best.</span></p>', '', 'Find all the words that contain the letters on the screen.', '<ul><li>Drag.</li></ul>', '');
INSERT INTO public.game_texts VALUES (166, 2, 'Word Chef', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (167, 1, 'Kitty Scramble', '<p><span style="color: rgb(0, 0, 0);">Help cute kitty to find hidden words - discover them on the board with letters. Use hints, search the words on the board, and swipe through them to open! Invite your friends and play together. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">✜ Addicting and fun gameplay </span></p><p><span style="color: rgb(0, 0, 0);">✜ So many exciting and challenging word puzzles! </span></p><p><span style="color: rgb(0, 0, 0);">✜ Connect to Facebook to share your progress and receive bonuses! </span></p><p><span style="color: rgb(0, 0, 0);">✜ Log in often to receive prizes and beat the puzzles </span></p><p><span style="color: rgb(0, 0, 0);">✜ Easy and fun to play, but challenging to master </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Become a word expert while enjoying Kitty Scramble! Play Kitty Scramble NOW!</span></p>', '', 'Help the cute kitty to find hidden words.', '<ul><li>Drag to connect letters.</li></ul>', '');
INSERT INTO public.game_texts VALUES (167, 2, 'Kitty Scramble', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (168, 1, 'Memoji Puzzle', '<p><span style="color: rgb(0, 0, 0);">Guess emoji! A new puzzle in which you need to match strangers one by one to phrases about their identities. Can you guess the personality by attribute, profession, emotion, or achievement?</span></p>', '', 'Match strangers to phrases about their identity.', '<ul><li>Drag, click/tap or hold.</li></ul>', '');
INSERT INTO public.game_texts VALUES (168, 2, 'Memoji Puzzle', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (169, 1, 'Hangman Adventure', '<p><span style="color: rgb(0, 0, 0);">Can you guess the words? You are only given the category and the number of letters. Try to guess as many words and phrases as possible in this unique Hangman game.</span></p>', '', 'Guess the word without wasting too many letters.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (169, 2, 'Hangman Adventure', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (170, 1, 'Waffle Game', '<p><span style="color: rgb(0, 0, 0);">The goal of the game is to compose as many words as possible in two minutes.</span></p>', '', 'Find as many words as possible in two minutes.', '<ul><li>Drag to connect letters.</li></ul>', '');
INSERT INTO public.game_texts VALUES (170, 2, 'Waffle Game', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (171, 1, 'Free words', '<p><span style="color: rgb(0, 0, 0);">Mix up the letters available and create as many words as possible before the time runs out.</span></p>', '', 'Create as many words as possible with the available letters.', '<ul><li>Drag to connect the letters.</li></ul>', '');
INSERT INTO public.game_texts VALUES (171, 2, 'Free words', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (172, 1, 'Gems Junction', '<p><span style="color: rgb(0, 0, 0);">Stop the gem troops to come forward by shooting a similar gem at them. There are 2 modes. In beginner mode, a group of two gems can be eliminated while in expert mode you need at least 3 gems. Collect all the stars to win this game. Falling down a gem will take one out of four lives. Enjoy this game with great power-ups.</span></p>', '', 'Eliminate gems before they fall down.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (172, 2, 'Gems Junction', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (173, 2, 'Jungle Bubble Shooter', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (174, 2, 'Amazing Jewel', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (174, 1, 'Amazing Jewel', '<p><span style="color: rgb(0, 0, 0);">You just got the perfect gems and jewels matching game where you match and swap gorgeous jewels to complete the challenging levels. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Amazing Jewels Match 3 Game is a brand new high-quality puzzle jewel matching game with the most innovative gameplay.</span></p>', '', 'Swap the jewels to complete the levels.', '<ul><li>Drag to swap the jewels.</li></ul>', '');
INSERT INTO public.game_texts VALUES (196, 1, 'Eternal Fury', '<p><span style="color: rgb(0, 0, 0);">A strategic turn-based RPG in HTML5 that combines SLG action and classic interactions. Players can summon random acquisitions of different quality mercenaries and customize the base attributes of the mercenary growth system. The game with different genres perfectly combined will definitely blow your mind!</span></p><p><br></p><p>Play Eternal Fury on Vedia Games. We offer the best online action games.</p>', '', 'Follow the story of your character and finish the tasks.', '<ul><li>Click/Tap to play.</li></ul>', '');
INSERT INTO public.game_texts VALUES (196, 2, 'Eternal Fury', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (224, 2, 'Robot Awake', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (233, 1, 'Kill The Zombies', '<p><span style="color: rgb(0, 0, 0);">“Kill The Zombies” is a game created in Construct 3 with the new 3D feature, making it a very cool FPS game! Kill the Zombies and look for the keys to open the steel gates and advance to the end. Try to win in the shortest time possible! Beware of Zombies, they are terrifying! Enjoy 3D immersion!<span class="ql-cursor">﻿</span></span></p>', '', 'Try this fun snack FPS game where you''re hunted by zombies.', '<ul><li>WASD - move</li><li>Left click - shoot</li><li>C - collect key and open the gates</li><li>Try to find keys to escape</li></ul>', '');
INSERT INTO public.game_texts VALUES (233, 2, 'Kill The Zombies', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (89, 1, 'Solitaire Story Tripeaks 3', '<p><span style="color: rgb(0, 0, 0);">The 3rd installation of one of the most popular Solitaire Card Games. Foxy, the game’s main cute little character, will take you on a journey through distant countries, fantastic landscapes, and famous landmarks including Paris, Berlin, Bali, Italy, Egypt, and many more! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">With incredible 2750+ levels, Solitaire Story Tripeaks 3 is one of the deepest Solitaire games of all time. Enjoy Daily Missions, Weekly Air Balloon Challenges, and dozens of new card designs!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You have to draw cards one at a time from your stockpile. Select the cards that are one higher or one lower in value than your drawn card to remove them from the playing field. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">To complete a level you need to remove all the cards from the playing field without running out of cards from your stockpile. Complete the daily missions and events to unlock new deck designs and prizes that help you solve those tricky levels.</span></p>', '', 'With 2750+ levels, this is one of the best solitaire games of all time!', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (173, 1, 'Jungle Bubble Shooter', '<p><span style="color: rgb(0, 0, 0);">Aim, match and smash all the colorful bubbles in this relaxing color-matching adventure. To break the bubbles, you need to connect three or more bubbles of the same color together by shooting the bubbles you are given into a bunch of bubbles stacked in the play area. Try to pop all the bubbles with as few shots as possible. It''s time to raise your name on the leaderboard. Enjoy!</span></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">4 maps to play 15 levels in each map (hence 60 levels in total) </span></li><li><span style="color: rgb(0, 0, 0);">Many features (bombs, rainbows, thunders, stars) </span></li><li><span style="color: rgb(0, 0, 0);">Many types of bubbles (colorful bubbles, Skull bubbles, Shielded bubbles, Glass bubbles, Clock bubbles, Question bubbles, Rock bubbles, Spiked bubbles...).</span></li><li><span style="color: rgb(0, 0, 0);">Leaderboard support. </span></li><li><span style="color: rgb(0, 0, 0);">Cool designs.</span></li></ul>', '', 'Aim, match and smash all the colorful bubbles.', '<ul><li><span style="color: rgb(0, 0, 0);">Tap and drag to change direction. Release to shoot. </span></li><li><span style="color: rgb(0, 0, 0);">Move the pointer to change direction. Click to shoot.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (175, 1, 'Just Farm', '<p><span style="color: rgb(0, 0, 0);">Try yourself as a farmer! Want to taste the romance of rural life? Buy and raise sheep, sell wool, and breed new breeds. Create the pastures of your dreams! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">What awaits you in the game? </span></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Many levels with exciting tasks and bonuses for completing; </span></li><li><span style="color: rgb(0, 0, 0);">Cute and funny sheep, drawn with love; </span></li><li><span style="color: rgb(0, 0, 0);">Intense gameplay; </span></li><li><span style="color: rgb(0, 0, 0);">Kind and cozy game world; </span></li><li><span style="color: rgb(0, 0, 0);">Ability to save experience; </span></li><li><span style="color: rgb(0, 0, 0);">Simple controls; </span></li><li><span style="color: rgb(0, 0, 0);">Bright graphics.</span></li></ul>', '', 'Buy, grow, trade, sell, and collect chicken eggs! Try yourself as a farmer.', '<ul><li>Click/Tap on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (175, 2, 'Just Farm', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (176, 1, 'Super Candy Jewels', '<p><span style="color: rgb(0, 0, 0);">Try this candy matching puzzle game. Enjoy the sweet adventure full of candies and try to finish all levels. Be rewarded with delicious candy combos.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Swap and match 3 candies of the identical color to remove them. Match 3 or more candies in a row to create candy bombs and get more points. If you need help, try using the obtained boosters. Gather enough candies to win before you run out of moves or time.</span></p>', '', 'Enjoy the sweet adventure full of candy and try to finish all levels.', '<ul><li><span style="color: rgb(0, 0, 0);">Swap and match 3 candies of the identical color to remove them</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (176, 2, 'Super Candy Jewels', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (177, 2, 'Tile Master Match', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (178, 1, 'City Blocks', '<p><span style="color: rgb(0, 0, 0);">City Blocks is a match-3 puzzle game. Strategically place new buildings and upgrade them to build the largest possible city before you run out of space.</span></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Addictive merge mechanics </span></li><li><span style="color: rgb(0, 0, 0);">Simple but challenging to master </span></li><li><span style="color: rgb(0, 0, 0);">Highscore</span></li></ul>', '', 'Strategically place new buildings and upgrade before you run out of space.', '<ul><li><span style="color: rgb(0, 0, 0);">Click on an empty tile where you want to add a new building.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (178, 2, 'City Blocks', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (179, 1, 'Yummy Tales 2', '<p>Yummy Tales 2 is here with its new and amazing match 3 puzzles!&nbsp;</p><p>Meet Oscar, your best friend and a clever little dog! He''ll help you in feeding and caring for your farm animals. To remove them from the board, you must match three or more fruits or vegetables of the same kind. Continue mixing and matching fruits and vegetables until your animals are completely saturated.</p><p><br></p><p>If you don''t finish the level before you run out of moves, you''ll have to start over! Play through over 900 different levels of puzzles.&nbsp;</p><p><br></p><p>Complete Daily Missions and Challenges to earn fantastic rewards and gifts such as coins and boosters to help you beat even the hardest levels. Stop wasting time and play Yummy Tales 2 for free right now!</p>', '', 'To clear the board, match 3 or more fruits or vegetables of the same kind.', '<ul><li>Swap at least 3 of the same items to clear them from the board.</li><li>If you match 4 or more items you get boosters and power-ups.</li></ul>', '');
INSERT INTO public.game_texts VALUES (179, 2, 'Yummy Tales 2', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (180, 1, 'Happy Fruits Match3', '<p><span style="color: rgb(0, 0, 0);">Solve 1000+ challenging levels in this delicious puzzle adventure. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Take yourself on a wild journey and experience the Match-3 adventure with fruit mania in kingdoms of orange, lemon, cherry and other delicious fruit. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Never ending game and never ending fun with daily bonus every day!</span></p>', '', 'Connect the delicious fruits to reach each level goal.', '<ul><li>Connect the delicious fruits to reach each level goal.</li></ul>', '');
INSERT INTO public.game_texts VALUES (180, 2, 'Happy Fruits Match3', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (181, 1, 'Pets Rush', '<p><span style="color: rgb(0, 0, 0);">In this addicting Match3 game you have to combine 3 lovely and cute animals to make it to the next level. Use powerful items to gain extra points or try to open the chest for a mighty power-up and also additional points.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Beat your own highscore and improve level to level. But be careful! If the blocks touch the top of the screen, there will be not much time to react. So be fast and clever! How many points are you gonna earn?</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Features</span></h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Highscore, </span></li><li><span style="color: rgb(0, 0, 0);">Endless levels,</span></li><li><span style="color: rgb(0, 0, 0);">Cute animals, </span></li><li><span style="color: rgb(0, 0, 0);">Suitable for all ages</span></li></ul><p><br></p><h3><span style="color: rgb(0, 0, 0);">Instructions</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">You have to combine 3 or more of blocks of the same color to make them disappear and free 3 cute animals and combine them aswell to make it to the next level.</span></p>', '', 'Click to connect 3 or more items before they get to the top.', '<ul><li>Click to combine 3 or more blocks of the same color.</li></ul>', '');
INSERT INTO public.game_texts VALUES (181, 2, 'Pets Rush', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (182, 1, 'Fish Story', '<p><span style="color: rgb(0, 0, 0);">Welcome to Fish Story - the newest iteration of the beloved underwater match-3 game that comes with fresh new graphics, a catchy tune, and lots of improvements! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Meet your new host, Poseidon himself. He will be pleased to guide you on your adventure through more than 700 splashy levels and teach you all the tricks you need to know to solve even the most complicated puzzles. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Complete Daily Missions to earn extra coins and Boosters, or play the Daily Challenge to earn extra stars that might help you unlock treasure chests and gates to new levels.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"> Make sure to come back and play every day to receive your Daily Rewards. Take part in regular Treasure Hunt events to collect sunken pirate treasures. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿Play Fish Story now for free and enjoy tons of addictive match-3 challenges.</span></p>', '', 'Match undersea creatures and complete the levels.', '<ul><li><span style="color: rgb(0, 0, 0);">Match at least 3 of the same undersea creatures to get full stars. </span></li><li><span style="color: rgb(0, 0, 0);">Match more than 4 same-colored ones and collect various boosters.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (182, 2, 'Fish Story', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (183, 1, 'Resolve a Math Game', '<p><span style="color: rgb(0, 0, 0);">If you like math, or not... you will definitively love RESOLVE, the best online math game ever. It is a fun game, it is quick and easy to play, and it is also challenging for everyone. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">At the bottom of the screen, you can see unfilled equations. The solution is on the top of the screen. Just link the correct numbers together so you can complete the equation. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Easy, isn''t it? Really? Well play RESOLVE now and find out if you are a true math genius.</span></p>', '', 'Link the correct numbers together so you can complete the equation.', '<ul><li><span style="color: rgb(0, 0, 0);">Link the correct numbers together so you can complete the equation.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (183, 2, 'Resolve a Math Game', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (184, 1, 'Merge to Million', '<p><span style="color: rgb(0, 0, 0);">The online game "Merge to Million" is a multiplying puzzle. Drag &amp; drop blocks with numbers on them next to an identical block on the grid to merge and multiply them. Your objective is to reach one million! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You will start easy with 2, but things will get more exciting once you are at thousands, and even more. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">There are 6 types of power-ups you can use to make the game easier. Use power-ups, make combos, and enjoy the thrill of playing with big numbers. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>If you enjoy games like 2048, Merge to Million is right up your alley!</span></p>', '', 'Merge numbers to multiply them and reach 1 million.', '<ul><li><span style="color: rgb(0, 0, 0);">Click or tap on a tile to select it, and click on an empty place on the grid to drop it. Make sure the tile you''ve selected touches an identical tile.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (184, 2, 'Merge to Million', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (62, 1, 'Chicken Egg Challenge', '<p><span style="color: rgb(0, 0, 0);">Are you ready for a fun competition with your friends? Before your friends fill your basket with 10 eggs. The first to fill his basket wins. Losing players have to make the bets! If you don''t want to smell your friends'' socks, don''t want to eat onions, or don''t want to do a chicken dance, press the button quickly! Have fun!</span></p>', '', 'Fill the basket with 10 eggs first to win. Be quick!', '<ul><li><span style="color: rgb(0, 0, 0);">J - to produce an egg.</span></li></ul><p><br></p><p><strong style="color: rgb(0, 0, 0);">Player 2:</strong></p><p><br></p><ul><li>W or <span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️ - to produce an egg</span></li></ul><p><br></p><p><strong>Player 3:</strong></p><p><br></p><ul><li>W or J or <span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️ - to produce an egg.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (185, 1, 'Winter Warm Up Math', '<p><span style="color: rgb(0, 0, 0);">Winter Math Warm-up is an online math puzzle game. In this game, you need to find the values of some winter items by solving given equations. </span></p><p><span style="color: rgb(0, 0, 0);">Operations in the problems consist of addition, subtraction, multiplication, and division. </span></p><p><span style="color: rgb(0, 0, 0);">Once you find the values of items, use these values to find the answer to a simple math question. </span></p><p><span style="color: rgb(0, 0, 0);">Occasionally you can use hints using the button in the left panel!</span></p>', '', 'Find the values of given items by solving the equations.', '<ul><li>Click/Tap on the right answers.</li></ul>', '');
INSERT INTO public.game_texts VALUES (185, 2, 'Winter Warm Up Math', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (186, 1, 'True and False Math Game', '<p><span style="color: rgb(0, 0, 0);">This is an educational online game in which maths questions appear quickly on the screen and you must answer them as fast as you can or you will lose the game!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">As you progress, your time limit will decrease and so the game will get more and more difficult.</span></p>', '', 'Solve math equations as quickly as you can.', '<ul><li>Click/Tap on the right answer quickly.</li></ul>', '');
INSERT INTO public.game_texts VALUES (186, 2, 'True and False Math Game', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (204, 1, 'Retro Kick Boxing', '<p>Play this Latest Retro KickBoxing game and make it your favorite kickboxing game now! This is going to be your challenging game journey and interesting boxing game. You will find Retro Kick Boxing easy to handle, fun to play, and simple to learn. You will discover that The Retro Kick Boxing has smooth graphics and awesome images! Wish you enjoy and have fun with this particular Retro Kick Boxing Game!</p>', '', 'Play to win in the good game of kickbox.', '<ul><li>⬅️➡️ - to move.</li><li>Z - to punch.&nbsp;</li><li>X - to kick.</li><li>C - to block.&nbsp;</li></ul>', '');
INSERT INTO public.game_texts VALUES (187, 1, 'Hexologic', '<p><span style="color: rgb(0, 0, 0);">Immerse yourself in the beautiful world of Hexologic. Solve challenging, yet rewarding puzzles, listen to relaxing music and dive deep into the game’s atmosphere! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Hexologic is very easy to learn and at the same time a highly addictive language-independent logic puzzle game. A simple gameplay mechanics adorned with a beautiful graphic design, relaxing music, and challenging yet not unbeatable puzzles, will guarantee long hours of fun for gamers of all ages.</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Features</span></h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Challenging yet not unbeatable puzzles </span></li><li><span style="color: rgb(0, 0, 0);">Relaxing, putting one’s mind to ease the atmosphere </span></li><li><span style="color: rgb(0, 0, 0);">Over 45 beautiful levels</span></li><li><span style="color: rgb(0, 0, 0);">The atmospheric soundtrack emphasizes the game’s ambiance.</span></li></ul>', '', 'Solve challenging, yet rewarding puzzles, listen to relaxing music.', '<ul><li><span style="color: rgb(0, 0, 0);">Combine the dots inside the hexes in three possible directions, so that their sum matches the one given at the edge!</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (187, 2, 'Hexologic', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (188, 1, 'Math Candies', '<p><span style="color: rgb(0, 0, 0);">''Math Candies'' is an online math puzzle game. In this game, you need to find the price of some candies by solving given equations. Operations in the problems consist of addition, subtraction, multiplication, and division. Once you find the values of candies, use these values to find the answer to a simple math question.</span></p>', '', 'Figure out the values of each candy to solve the end equation.', '<ul><li>Click/Tap on the right answers.</li></ul>', '');
INSERT INTO public.game_texts VALUES (188, 2, 'Math Candies', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (189, 2, 'Pirate Adventure', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (190, 2, 'Moto X3M Original', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (191, 2, 'Moto X3M Winter', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (192, 1, 'Basketball Legends', '<p>Basketball Legends 2020 is a cool 2-player basketball game. Choose your team and enter a challenging tournament against the CPU or play fun quick matches against your best friend. </p><p><br></p><p>Control your player to perform awesome dunks and 3-pointers to win the game. </p><p><br></p><p>Feel free to block and slap your opponent to knock him out and get the ball, and pay attention to the super shot bar on the top of the screen, once it’s fully loaded, you can use the hot special dunk from wherever you are standing, it never fails. </p><p><br></p><p>Be the best player on the field. Enjoy Basketball Legends!</p>', '', 'A 2 player basketball game with an engaging gameplay.', '<ul><li>WSD - to move.&nbsp;</li><li>A - to jump.</li><li>X - to slap.</li><li>Z - to throw.</li><li>V - to dunk.</li></ul>', '<ul><li>⬅️➡️ = to move.</li><li>⬆️ to jump.</li><li>K - to slap.</li><li>L - to throw/dunk.</li></ul><p><br></p>');
INSERT INTO public.game_texts VALUES (192, 2, 'Basketball Legends', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (193, 1, 'Soccer Masters', '<p>Play the free online game Soccer Masters on Vedia Games!</p><p><br></p><p>Choose your favorite team and join a tournament where only the best fight for the title. Control your favorite player! You can play solo against AI opponents or play with or against your friend. Show them, real football masters!</p>', '', 'Choose your favorite player and play the best game of soccer.', '<ul><li>⬅️➡️ - to move.</li><li>⬆️ - to jump.</li><li>⬇️ - to slide.</li><li>Z - supershot.</li><li>X - shot.</li></ul>', '<ul><li>AD - to move.</li><li>W - to jump.</li><li>S - to slide.</li><li>K - supershot.</li><li>L - shot.</li></ul>');
INSERT INTO public.game_texts VALUES (193, 2, 'Soccer Masters', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (194, 1, 'Moto X3M Halloween', '<p>Moto X3M is a bike racing game with crazy stunts and a twist on deadly obstacles and explosive crashes. With the different levels in challenges, and the extremely dangerous but no less attractive high speed, the game will blow you away with its exciting features. Welcome to the special "Spooky Land" version of this awesome bike stunt game. Have fun with Moto X3M 6 Spooky Land!</p><p><br></p><p>Play Moto X3M Halloween on Vedia Games!</p>', '', 'Bike racing with crazy stunts and deadly obstacles, now in Spooky Land.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80);">⬆️➡️</span>&nbsp;= to drive/balance.</li><li>Spacebar = to respawn at the last checkpoint.</li></ul>', '');
INSERT INTO public.game_texts VALUES (194, 2, 'Moto X3M Halloween', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (195, 2, 'Moto X3M Pool Party', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (190, 1, 'Moto X3M Original', '<p>Moto X3M is an awesome online bike racing game with 25 challenging levels. So grab your motorbike, strap on your helmet and grab some airtime over obstacles and beat the clock on amazing off-road circuits. Enjoy Moto X3M!</p>', '', 'Grab your motorbike, strap on your helmet, and beat the clock.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span> = to drive / balance.</li><li>Spacebar = to respawn at the last checkpoint.</li></ul>', '');
INSERT INTO public.game_texts VALUES (195, 1, 'Moto X3M Pool Party', '<p>Moto X3M is an ultimate online bike racing game, which is very suitable for players who love extreme sports.</p><p><br></p><p>With the different levels in challenges, and the extremely dangerous but no less attractive high speed, the game will blow you away with its exciting features. It can help you to have an interesting relaxing time.</p><p><br></p><p>Welcome to the special "Pool Party" version of this awesome bike stunt game. Have fun with Moto X3M 5 Pool Party!</p>', '', 'Bike racing with crazy stunts and deadly obstacles, Pool Party version.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80);">⬆️➡️</span>&nbsp;= to drive/balance.</li><li>Spacebar = to respawn at the last checkpoint.</li></ul>', '');
INSERT INTO public.game_texts VALUES (189, 1, 'Pirate Adventure', '<p><span style="color: rgb(0, 0, 0);">Blackbeard has hidden the treasure and you need to collect map pieces from him in order to find it! Solve math puzzles to recover missing parts and find the treasure!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play the online game Pirate adventure for free on Vedia Games.</span></p>', '', 'Find the treasure by solving math problems.', '<ul><li>WASD/<span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ to move.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">E - to interact with people.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (205, 1, 'Fireboy and Watergirl I Forest Temple', '<p><span style="color: rgb(0, 0, 0);">Fireboy and Watergirl, made by Oslo Albet, are exploring the Forest Temple in search of diamonds. Switch between Fireboy &amp; Watergirl and play alone or together as 2 players. The goal is to reach the exit safely, so be careful. Fireboy cannot touch the water and Watergirl cannot touch fire.</span></p>', '', 'Search for diamonds in the Forest Temple.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li></ul>');
INSERT INTO public.game_texts VALUES (205, 2, 'Fireboy and Watergirl I Forest Temple', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (197, 1, 'Mortal Cage Fighter', '<p><span style="color: rgb(0, 0, 0);">We present the online game Mortal Cage Fighter.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Fight your way to victory. Punch or kick to attack. Move backward to block. Jump over your opponents to surprise them from the back. Once your power bar is full, execute special abilities unique to the character you choose. Best of 3 round wins. Can you be the king of fighters?</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Features</span></h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Simple controls for desktops, smartphones, and tablets </span></li><li><span style="color: rgb(0, 0, 0);">Choose between 4 different fighters: Marshall, Paulson, Xiao Li, and Keesha. </span></li><li><span style="color: rgb(0, 0, 0);">Fight in 3 distinct environments: Back Alley, Downtown, and the Subway </span></li><li><span style="color: rgb(0, 0, 0);">Choose a random opponent </span></li><li><span style="color: rgb(0, 0, 0);">Realistic combat animations </span></li><li><span style="color: rgb(0, 0, 0);">No blood or gore in this version (clean version)</span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">Play the best boxing games on Vedia Games!</span></p>', '', 'Choose your unique character and find your way to victory.', '<ul><li>WAD - to move.</li><li>J - to punch.</li><li>K - to kick.</li></ul>', '');
INSERT INTO public.game_texts VALUES (197, 2, 'Mortal Cage Fighter', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (198, 1, 'Boxing Random', '<p><span style="color: rgb(0, 0, 0);">The most fun and random challenges begin with Boxing Random. Each round starts another fun with its own options. Sometimes long arms, sometimes icy fields, or rocket punches greet you. Send punches to the enemy''s head. You can score this way. The first to reach a score of 5 wins the game!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">To steer the character, press the button at the moment it swings. In this way, you can both punch and move the character in the direction you want.</span></p>', '', '', '<ul><li><span style="color: rgb(0, 0, 0);">W or click - to play.</span></li></ul>', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️ or click - to play.</span></li></ul>');
INSERT INTO public.game_texts VALUES (198, 2, 'Boxing Random', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (199, 1, 'Boxing Stars', '<p>Play Boxing Stars on Vedia Games!</p><p><br></p><p><span style="color: rgb(0, 0, 0);">Rise from the box underground to the championship and become a boxing star. Improve your skills with rewards to compete in better tournaments. Put your boxing gloves on and box like there’s no tomorrow. Defeat all your opponents in fights and collect all trophies.</span></p><p><br></p><p><br></p><h3>Features</h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Different game modes various boxers to choose from simple controls stunning graphics</span></li></ul><p><br></p><p><br></p><h3>Instructions</h3><p><br></p><p><span style="color: rgb(0, 0, 0);">Win matches by knocking out your opponent. Use various attacks, blocking, and movements to create your own strategy and form your own story. Train your abilities to compete in better tournaments.</span></p>', '', 'Rise to championship and become a boxing star.', '<ul><li>⬅️➡️ - to move.</li><li>A - knockdown punch.</li><li>S - to block enemy attacks.</li><li>B - knockback punch.</li></ul>', '');
INSERT INTO public.game_texts VALUES (199, 2, 'Boxing Stars', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (200, 2, 'Boxing Hero Punch Champions', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (200, 1, 'Boxing Hero: Punch Champions', '<p><span style="color: rgb(0, 0, 0);">In BOXING HERO: PUNCH CHAMPIONS: </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Fight 8 epic boxers in intense combats. Jab, cross, uppercut, use all possible tricks, give in all you have, but don’t forget to dodge or you''ll be KO. Punch out all opponents, and win the world belt in this superb arcade game.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play the best online boxing games on Vedia Games.</span></p>', '', 'Fight 8 epic boxers in intense combats. ', '<p>You can tap on-screen controls to control your boxer or if you use the keyboard:</p><ul><li>E- block</li><li>S - slide left</li><li>D - slide right</li><li>J - basic strike</li><li>K - uppercut</li><li>I - power strike</li></ul>', '');
INSERT INTO public.game_texts VALUES (201, 1, 'Street Fight 3D', '<p><span style="color: rgb(0, 0, 0);">You are welcome to fight for your survival in this epic game. Goons up your alley, save yourself by beating some thugs along the way. And do not forget to bring a gun to this knives fight. Remember no rules in love and war. You are the captain and all we have to say is aye aye Captain!</span></p>', '', 'Fight for your survival on the street.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️</span><span style="color: rgb(0, 0, 0);"> - to move.</span></li><li><span style="color: rgb(0, 0, 0);">Spacebar - to jump. </span></li><li><span style="color: rgb(0, 0, 0);">Z or X - to attack.</span></li><li><span style="color: rgb(0, 0, 0);">C - to defend.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (201, 2, 'Street Fight 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (202, 2, 'Punch Box', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (202, 1, 'Punch Box', '<p><span style="color: rgb(0, 0, 0);">You are a boxer with very low money and because you can’t afford to train at gyms, you train by punching boxes! You have to tap on the sides of the screen to punch and destroy boxes and be careful to avoid sharp wood that is on some boxes or otherwise you will get knocked out! Also, remember that there is a time limit and you have to punch boxes to earn more time. So punch as fast as you can and earn more scores!</span></p><p><br></p><p>Play Punch Box on Vedia Games.</p>', '', 'Carefully punch boxes without running into the spiky wood.', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬅️➡️ - to move to the left or right side.﻿</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (203, 1, 'Drunken Boxing', '<p><span style="color: rgb(0, 0, 0);">The Drunken battles continue with the new online game.&nbsp;In Drunken Boxing, the Drunken Boxers come to the arena and try to knock out each other.&nbsp;You can make quick punches in the game, but watch out for your Energy Bar! Drunken Boxing game has 1P and 2P modes. You can play the game from both PC and mobile devices. The first to reach a score of 5 in the game wins the match!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">If you run out of energy, it will take a while for you to recover.&nbsp;Surely you will be vulnerable in this situation.&nbsp;So don''t forget to calculate your energy while determining your fighting strategy!</span></p>', '', 'The first to reach a score of 5 wins the match.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span><span style="color: rgb(0, 0, 0);"> - to play.</span></li></ul><p><br></p>', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to play.</span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>You can use the left and right sides on touch screens.</span></p>');
INSERT INTO public.game_texts VALUES (203, 2, 'Drunken Boxing', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (204, 2, 'Retro Kick Boxing', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (227, 2, 'Circuit Car Racing', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (512, 1, 'Roll Sky Ball 3D', '<p><span style="color: rgb(0, 0, 0);">Fast-paced ball rolling game with various and unexpected tracks and obstacles. Can you reach the goal each time? Slide to move the ball and focus on the track, have a blast!</span></p>', '', 'Fast-paced ball rolling game with various and unexpected obstacles.', '<ul><li>Hold click and slide to move the ball.</li></ul>', '');
INSERT INTO public.game_texts VALUES (512, 2, 'Roll Sky Ball 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (206, 1, 'Fireboy and Watergirl II Light Temple', '<p><span style="color: rgb(0, 0, 0);">This time, Fireboy and Watergirl (made by Oslo Albet), are exploring the Light Temple. Use the temple light to reach the exit safely. Switch between Fireboy &amp; Watergirl, but be careful, Fireboy cannot touch the water and Watergirl cannot touch fire.</span></p>', '', 'Search for diamonds in the Light Temple.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li></ul>');
INSERT INTO public.game_texts VALUES (206, 2, 'Fireboy and Watergirl II Light Temple', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (207, 1, 'Fireboy and Watergirl III Ice Temple', '<p><span style="color: rgb(0, 0, 0);">Fireboy and Watergirl (by Oslo Albet) are having a very "cool" time on their journey in the Ice Temple! A lot of dangers are lurking inside the ice temple. You must complete many challenges to get these brave heroes to the exit safely. Switch between Fireboy &amp; Watergirl- but watch out; Fireboy cannot touch water, and Watergirl cannot touch fire.</span></p>', '', 'Search for diamonds in the Ice Temple.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li></ul>');
INSERT INTO public.game_texts VALUES (207, 2, 'Fireboy and Watergirl III Ice Temple', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (208, 1, 'Fireboy and Watergirl 4 Crystal Temple', '<p><span style="color: rgb(0, 0, 0);">Fireboy and Watergirl (by Oslo Albet) on an adventure through the Crystal Temple! Teleport from one side to the other. Complete all challenging levels. Watch out for all dangers and observe the colors of the teleporters. Switch between Fireboy &amp; Watergirl- but watch out; Fireboy cannot touch water, and Watergirl cannot touch fire.</span></p>', '', 'Search for diamonds in the Crystal Temple.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li></ul>');
INSERT INTO public.game_texts VALUES (208, 2, 'Fireboy and Watergirl 4 Crystal Temple', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (209, 2, 'Fireboy and Watergirl 5 Elements', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (210, 1, 'Fireboy and Watergirl 6 Fairy Tales', '<p><span style="color: rgb(0, 0, 0);">Fireboy and Watergirl need help to explore this new temple. This time Fairies will help them solve the puzzles, beat the times, and collect all the diamonds! Play alone or with a friend to join Fireboy and Watergirl in this new adventure! Turn levers and push buttons to complete these 30 new levels of the official Fireboy and Watergirl series.</span></p>', '', 'Fireboy and Watergirl need help to explore this new temple.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li></ul>');
INSERT INTO public.game_texts VALUES (210, 2, 'Fireboy and Watergirl 6 Fairy Tales', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (209, 1, 'Fireboy and Watergirl 5 Elements', '<p><span style="color: rgb(0, 0, 0);">Explore the Elemental Temples in Fireboy and Watergirl 5 (by Oslo Albet)! Solve many puzzles, collect all the diamonds and beat the time. Fireboy and Watergirl Elements is a completely new game with lots of new elements. Travel to all temples in the Fireboy Watergirl series. Enter the new Fire Temple, The Forest Temple, The Ice Temple, The Light Temple, The Wind Temple and The Crystal Temple. In FBWG5 you can play the adventure alone or with a friend. Reach the exit safely.</span></p>', '', 'Watch out for all dangers and observe to get safely to the exit.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li></ul>');
INSERT INTO public.game_texts VALUES (211, 1, 'Rally Champ', '<p><span style="color: rgb(0, 0, 0);">Compete across the world as you race in the Rally Car Championship. Dodge opponents, boost around twisting corners, collect coins, and upgrade your car for the next race. Are you the Rally Champ? Rally Champ is designed to run on any device at 30fps - which can be a challenge when dealing with pseudo-3D (no WebGL here, just lots of sprites!). We''re always keen to make things better - let us know how it plays for you.</span></p>', '', 'Compete across the world. Dodge opponents and win the race.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️ - left and right.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (211, 2, 'Rally Champ', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (212, 1, 'Draw Race IO', '<p><span style="color: rgb(0, 0, 0);">A new race in which you draw a path for a car. Just draw with your finger and the car will go that way. You participate in a competition with other machines, and the goal is to push everyone. Push other opponents, collect coins, and become the winner in this competition!</span></p>', '', 'Draw in the direction your car should go and collect coins.', '<ul><li>Drag to draw in the field.</li></ul>', '');
INSERT INTO public.game_texts VALUES (212, 2, 'Draw Race IO', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (213, 1, 'Unblock Parking Puzzle', '<p><span style="color: rgb(0, 0, 0);">In this fun and colorful game, you challenge your logic skills, critical thinking, and timing precision. Unblock Parking Puzzle is a very addictive puzzle game. During the rush hour, there are too many cars in the parking area. Your task is to unblock the car and move it out of the traffic chaos.</span></p>', '', 'Unblock the car so it can leave the parking place.', '<ul><li><span style="color: rgb(0, 0, 0);">Unblock the car so it can leave the parking place by dragging each car in the direction you want it to go.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (213, 2, 'Unblock Parking Puzzle', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (214, 1, 'Monster Truck High Speed', '<p><span style="color: rgb(0, 0, 0);">Cut bends at high speed and make drift to intrigue everybody! Put forth a strong effort and accelerate your truck! Race like the breeze in this new Monster Truck High-Speed game.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play Monster Truck High-speed on Vedia Games.</span></p>', '', 'Race with your truck to the finishing point.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️ - to steer.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (214, 2, 'Monster Truck High Speed', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (215, 2, 'City Ambulance Simulator', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (216, 1, 'Ambulances Slide', '<p>Play this slide puzzle game of the emergency services trucks. It includes 3 images and 3 modes to play.</p><p><br></p><p><strong>Features:</strong></p><ul><li>Easy mode with 3x3</li><li>Medium mode with 4x4</li><li>Hard mode with 5x5</li><li>Three different puzzles</li></ul><p><br></p><p>Play this and more sliding puzzle games online at vediagames.com!</p>', '', 'An awesome sliding puzzle web game with emergency services trucks.', '<ul><li>Mouse left click or touch to select pieces and swap them</li></ul>', '');
INSERT INTO public.game_texts VALUES (216, 2, 'Ambulances Slide', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (217, 1, 'Stacking Color', '<p>Stacking Color is a web online free-to-play game. It is an endless hypercasual stack-like game that will provide you with tons of quick entertainment. It will help your reaction and perspective skills. Both of those traits will help you in the day-to-day stuff.</p><p><br></p><p>There are many more hypercasual online games like this that you can play on vediagames.com</p>', '', 'Hypercasual addicting stack-like game online for endless entertainment.', '<ul><li>Left mouse click or tap</li></ul>', '');
INSERT INTO public.game_texts VALUES (217, 2, 'Stacking Color', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (218, 2, 'Round 6: The Game', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (219, 1, 'Space Pursuit', '<p>Space Pursuit is a fun hypercasual web game where you''re the prey being chased by predators. You have to avoid your predators or otherwise, your spaceship will explode.&nbsp;</p><p><br></p><p>Try to shoot all of the enemies trying to chase you down. Collect weapons and power-ups to help you stay alive for as long as possible. Keep flying, dodging, and doing whatever it takes to survive in this epic retro-themed space game.</p><p><br></p><p>Play more online web games like Space Pursuit on vediagames.com</p>', '', 'Try this fun but challenging web game where you''re the prey.', '<ul><li>Tap/click on the right half of the screen to rotate to the right</li><li>Tap/click on the left half of the screen to rotate to the left</li></ul>', '');
INSERT INTO public.game_texts VALUES (215, 1, 'City Ambulance Simulator', '<p><strong>City Ambulance Simulator</strong> is an addictive driving game. Your role is to act as an ambulance driver who has a special sympathy for injured people in ambulance games. This act of kindness may prove life-saving for the person of city car driving games who is in some painful condition due to some careless move on the road.</p><p><br></p><p>Play this awesome driving web simulator game on vediagames.com!</p>', '', 'Drive and save people with your ambulance car in this web simulator.', '<ul><li>W or <span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️</span> to move forward</li><li>A or <span style="color: rgb(0, 0, 0);">⬅️</span> to move left</li><li>S or ⬇️ to move backward</li><li>D or <span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">➡️</span> to move right<span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);"><br></span></li></ul>', '');
INSERT INTO public.game_texts VALUES (219, 2, 'Space Pursuit', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (220, 1, 'Cute Elements', '<p>Play Cute Elements on Vedia Games - stimulate your brain by solving the puzzle each level has to offer. This is a great game, that will help you forget about time.</p><p><br></p><p><span style="color: rgb(0, 0, 0);">Elemental characters with special powers have been caged, use the water element to free the rest of the team and combine their powers, beat the levels by getting keys and locks, unlock many funny costumes, win elemental cards, beat the missions, and get trophies for your achievements. ARE YOU READY?</span></p>', '', 'Use your special powers to free the rest of the team and combine powers.', '<ul><li>Drag and drop to place the element in the place you want it to be.</li><li>Click on items to destroy them.</li></ul>', '');
INSERT INTO public.game_texts VALUES (220, 2, 'Cute Elements', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (221, 1, 'Heavy Combat', '<p>Heavy Combat is an epic third-person shooter game where you take on the role of an elite mercenary tasked to stop the evil terrorists that are running rampant in three different locations.</p><p><br></p><p>Features:</p><ul><li>Three different maps</li><li>Each map has +10 levels</li><li>Multiple weapons</li><li>Multiple game modes/missions</li></ul><p><br></p><p>Play this awesome and cool third-person shooter web online game on vediagames.com</p>', '', 'Take role of an elite mercenary and stop the terrorists in this shooter.', '<ul><li>C - switch perspectives (FPS or third person)</li><li>V - melee attack</li><li>1,2,3 or Mouse scroll - switch weapons</li><li>WASD or Arrows - move</li><li>Space - Jump</li><li>F - interact (pick up, open...)</li><li>LShift - sprint</li><li>R - reload</li><li>E - lean right (only in FPS mode) </li><li>T - special power</li></ul>', '');
INSERT INTO public.game_texts VALUES (221, 2, 'Heavy Combat', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (222, 1, 'Worms Zone a Slithery Snake', '<p><span style="color: rgb(0, 0, 0);">Worms Zone is an online game with a dynamic storyline. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Start growing your worm right now. Having tried to get a real anaconda, a small worm never gets stuck in one place – he’s ready to bite everyone. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>However, there is a danger to be eaten by a more successful player. The Worms are real gourmets. They love trying various gelatinous goodies and everything they meet on their route.</span></p>', '', 'Start growing and survive as long as you can to become an anaconda.', '<ul><li><span style="color: rgb(0, 0, 0);">Use the mouse to control the worm''s direction and the space bar to speed up it.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (222, 2, 'Worms Zone a Slithery Snake', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (223, 2, 'Rabbids Volcano Panic', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (218, 1, 'Round 6: The Game', '<p>If you are a Squid Game fan, this game will more than sure be of your top games. After playing levels like Red Light, Green Light, or Marble, is the time to play all the levels and rounds from the real show!</p><p><br></p><p>In this amazing game, you will have 7 Rounds to complete, including Red Light - Green Light, Marble, Glass Tower, Rope Tower, The Big Fight, Honeycomb, and the last game - Squid Game!</p><p><br></p><p>What do you think about this stunning game? There are many more web games like this that you can play on vediagames.com</p>', '', 'Hypercasual squid-game-type online web game for your enjoyment.', '<ul><li>Left mouse click or touchscreen to play</li><li>WASD or arrows to move</li><li>M for boost</li></ul>', '');
INSERT INTO public.game_texts VALUES (225, 1, 'Hidden Lands', '<p><span style="color: rgb(0, 0, 0);">Majestic floating lands hide countless relics. Look carefully and solve visual challenges to discover what happened to these civilizations. Hidden Lands is a visual puzzle game mixing Spot the difference and Hidden Object mechanics with infinite levels to play.</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Features</span></h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">More than 100 Quests to complete </span></li><li><span style="color: rgb(0, 0, 0);">3 ancient civilizations to discover</span></li><li><span style="color: rgb(0, 0, 0);">Infinite levels to play </span></li><li><span style="color: rgb(0, 0, 0);">Comfortable Zoom and Rotation</span></li><li><span style="color: rgb(0, 0, 0);">Share your favorite islands and relics.</span></li><li><span style="color: rgb(0, 0, 0);">Dynamic and relaxing music</span></li><li><span style="color: rgb(0, 0, 0);">Dynamic weather</span></li></ul>', '', 'Spot the difference to find out what happened to old civilizations.', '<ul><li><span style="color: rgb(0, 0, 0);">Click - to find differences.</span></li><li><span style="color: rgb(0, 0, 0);">Scroll - to zoom in and out.</span></li><li><span style="color: rgb(0, 0, 0);">Click &amp; Drag - to move the camera.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (225, 2, 'Hidden Lands', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (226, 1, 'Shot Trigger', '<p>Shot Trigger is a simple but very entertaining 2D web game where you play the hero. This game will enhance and truly test your reaction skills. It is a true hypercasual game that will you with endless entertainment</p><p><br></p><p>Play Shot Trigger, a online hypercasual game on vediagames.com</p>', '', 'Our hero will rescue the civilians from the underworld. Can you help him?', '<ul><li>Tap/click when the laser is over enemy</li></ul>', '');
INSERT INTO public.game_texts VALUES (226, 2, 'Shot Trigger', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (228, 1, 'Circle Down', '<p>Circle Down is a funny arcade shooter game. The goal of this game is to shoot the rings to become balls before hitting the beam. The rings will fall to the beam. Aim and shoot them with the balls. If rings hit the beam three times the game will be over. Try to transform more as you can ring to balls and gave fun.</p>', '', 'Try your aiming skills with this hypercasual snack online game ', '<ul><li>Tap/click on the screen to shoot a ball</li></ul>', '');
INSERT INTO public.game_texts VALUES (228, 2, 'Circle Down', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (229, 1, 'Noob vs Pro Challenge', '<p><span style="color: rgb(0, 0, 0);">Noob vs Pro Challenge is a game in which you wake up in the morning and there is a zombie apocalypse around and you are a noob? This is a real challenge! Why not? The task will be to save the Noob and the Princess and troll the evil Herobrine with the help of various traps. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Are you ready to go through the labyrinth and go down to the dungeon and there, having passed all the tests, find a secret portal and save the dragon, on whose back to fly to a desert island, and then arrange a jailbreak?</span></p><p><br></p><h3>Features</h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Upgrade the levels of the character Noob vs Pro and get unique abilities. </span></li><li><span style="color: rgb(0, 0, 0);">Fun animations with your favorite monster school characters. An arsenal of pixel weapons. </span></li><li><span style="color: rgb(0, 0, 0);">Unique bosses. From the evil Herobrine and the zombie cleaner to the mummy and the toilet monster. </span></li><li><span style="color: rgb(0, 0, 0);">Craft items on the workbench for Pro set traps for Noob.</span></li></ul><p><br></p><h3>Instructions</h3><p><br></p><p><span style="color: rgb(0, 0, 0);">Pass small tests at the levels. Kill zombies using the hero''s weapons and abilities. When killing monsters, your hero''s level increases, and new abilities are unlocked. </span></p><p><br></p><p><br></p>', '', 'You wake up and there is a zombie apocalypse. Save the princess.', '<ul><li><span style="color: rgb(0, 0, 0);">Joystick or WASD - to walk. </span></li><li><span style="color: rgb(0, 0, 0);">1/2/3 to use abilities (or just. click on them)</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (229, 2, 'Noob vs Pro Challenge', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (230, 2, 'Blocky Parkour Ninja', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (231, 1, 'Where is the Water', '<p><span style="color: rgb(0, 0, 0);">Feed the little crocodile enough with water by activating mechanisms and puzzles. Use your imagination and arrange the puzzle pipes and obstacles to create a perfect piping connection between the two points. Drag the terrain, move objects, collect all the stars and complete more than 20 amazing levels.</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Features</span></h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Amazing physics </span></li><li><span style="color: rgb(0, 0, 0);">Terrain system </span></li><li><span style="color: rgb(0, 0, 0);">Free to play, play it anywhere anytime. </span></li><li><span style="color: rgb(0, 0, 0);">Suitable for all ages. </span></li><li><span style="color: rgb(0, 0, 0);">The graphics, visuals, music &amp; sounds are outstanding. </span></li><li><span style="color: rgb(0, 0, 0);">Use your brain to solve the puzzles. </span></li><li><span style="color: rgb(0, 0, 0);">High-quality sounds. </span></li><li><span style="color: rgb(0, 0, 0);">Collect stars</span></li></ul><p><br></p><h3><span style="color: rgb(0, 0, 0);">Instructions</span></h3><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Draw on the platforms to complete the levels with the mouse on PC Draw on platforms with touch on mobile devices and tablets.</span></p>', '', 'Solve the levels by feeding the crocodile with enough water.', '<ul><li>Draw on the platforms to complete the levels, and do it so the crocodile will get enough water. Complete as many stars as you can.</li></ul>', '');
INSERT INTO public.game_texts VALUES (231, 2, 'Where is the Water', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (232, 1, 'Survival Shooting Xtreme Crazy blocky Combat', '<p>Survival Shooting Xtreme Crazy block Combat is a browser FPS multiplayer online web game. You can create your own servers and play against other players. </p><p><br></p><p>Features:</p><ul><li>Campaign</li><li>Zombies </li><li>Bots</li><li>Multiple guns</li><li>And much much more!</li></ul><p><br></p><p>Try this awesome FPS free shooter on vediagames.com</p>', '', 'An awesome 3D online multiplayer FPS game with zombies. ', '<ul><li>WASD - move</li><li>Left mouse click - shoot</li><li>Right mouse click - aim</li><li>Scroll wheel - switch gun</li><li>Space - jump</li><li>TAB - menu</li><li>Shift - Sprint</li></ul>', '');
INSERT INTO public.game_texts VALUES (232, 2, 'Survival Shooting Xtreme Crazy blocky Combat', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (234, 1, 'Squid Gun Fest', '<p><span style="color: rgb(0, 0, 0);">Squid Game legend continues with the Gun Fest game. Two of the most popular games of recent times are now gathered in one game. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Gun Fest game is with you with Squid Game theme. Try to increase your weapons by doing math operations and destroy the Squid Game employees that you come across! The killer doll may appear sometimes and you must increase your weapon count as much as possible to destroy it. You have to shoot and destroy the obstacles in order to pass many obstacles. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">When you reach the final line, you can have the proceeds by destroying the robber''s car. You can buy new weapons with the money you earn. Start the game right away with endless levels and 6 different weapons. Have fun!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play more Gun Fest games on vediagames.com!</span></p>', '', 'This hypercasual 3D Gun Fest game will have you entertained for hours!', '<ul><li>Use mouse or touch to slide left or right</li></ul>', '');
INSERT INTO public.game_texts VALUES (234, 2, 'Squid Gun Fest', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (235, 1, 'Gun Master 3D', '<p>Gun Master 3D is a classic shoot-em-up game where you''re thrown into an arena with knights that try to cut you down with their swords. In this brand new FPS web game, you will have to survive wave after wave of attacks and kill as many knights as you can with GUNS!</p><p><br></p><p>In each stage, you will get a new and better weapon that will allow you to kill knights more efficiently. </p><p><br></p><p>P.S. a little tip from me, use the knife as much as possible, it is seriously OP :P but don''t tell the developer, otherwise, he might nerf it.</p>', '', 'In this FPS game you kill knights with guns. What else do you need?', '<ul><li>WASD - move</li><li>Left-click - shoot / use weapon</li><li>R - reload</li><li>P - pause</li><li>Space - jump</li><li>Shift - sprint</li></ul>', '');
INSERT INTO public.game_texts VALUES (235, 2, 'Gun Master 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (236, 2, 'FPS Shooting Survival Sim', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (237, 1, 'Warfare Area', '<p>It''s war and enemies have captured your base. You are the last soldier from your troop in the base so only you can fight it back. Take the rifle and get ready for the battle.</p><p><br></p><p>In this web shooter game, you have to hunt down all the enemies and destroy them before they destroy you. There are three modes that change the difficulty of the game. Another great way to play this game is to try and speedrun it.</p><p><br></p><p>This game will help your reaction and aiming skills. You will enhance both of those skills by playing this game.</p><p><br></p><p>Play Warfare Area and games like it on vediagames.com.  </p>', '', 'It''s war and enemies have captured your base. Will you prevail?', '<ul><li>WASD - movement</li><li>L - lock screen</li><li>Left-click - shoot</li><li>Shift - sprint</li><li>Mobile: use joysticks</li></ul>', '');
INSERT INTO public.game_texts VALUES (237, 2, 'Warfare Area', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (239, 1, 'Yummy Super Burger', '<p><span style="color: rgb(0, 0, 0);">Everybody likes burgers! Now is the time for you to make your own yummy super burger! Prepare the ingredients by following every part on the task list until your burgers are ready to sell. Make a yummy burger as fast as you can. Serve your customers on time.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Cooking burgers was never more fun!</span></p>', '', 'Prepare the ingredients and cook some delicious burgers.', '<ul><li>Mouse/Tap to play the game.</li><li>Drag.</li></ul>', '');
INSERT INTO public.game_texts VALUES (236, 1, 'FPS Shooting Survival Sim', '<p>The zombie virus has gotten completely out of hand! Zombies that are evolving are threatening to take over the planet! You are a highly trained special forces commando, and your objective is to combat zombies to save the world. To live and gain combat survival experience, you must eliminate all zombies in this assassination game. Choose from an incredible assortment of fighting weapons and engage in battle against the walking dead in various horrifying settings all around the world.</p><p><br></p><p>There are many types of weapons that you can pick up and have in your armory which will allow you to cut down your enemies even faster.</p><p><br></p><p>Play this awesome free first-person shooter game and more on vediagames.com</p>', '', 'An awesome open world web FPS game where you kill aliens and zombies.', '<ul><li>WASD - walk</li><li>Space - jump</li><li>Left-click - shoot</li><li>Shift - sprint</li><li>F - interact (pick up weapons, etc..)</li><li>Scroll wheel - switch weapons</li><li>V - melee</li><li>C - switch perspective</li><li>X - lay down</li><li>CTRL - crouch</li><li>G - throw grenade</li></ul>', '');
INSERT INTO public.game_texts VALUES (69, 1, 'Stick Man', '<p>Stretch the stick in order to reach and walk on the platforms. Watch out! If the stick is not long enough, you will fall down!</p><p>Try this stickman game on vediagames.com</p>', '', 'Click & Hold to make the ladder. If it is not long enough - you will fall.', '<ul><li>Click and hold to make the ladder.</li></ul>', '');
INSERT INTO public.game_texts VALUES (238, 1, 'Yummy Chocolate Factory', '<p><span style="color: rgb(0, 0, 0);">Hey chocolate lovers! Ready for this yummy and chocolaty-making game? In this cooking game, you will be able to prove your skills to make tasty chocolate. There are some tasks included to make this cooking game more interesting. That''s going to be totally awesome and really yummy!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play the cooking game Yummy Chocolate Factory on Vedia Games! </span></p>', '', 'Follow the tasks to cook the tastiest chocolate.', '<ul><li>Drag.</li><li>Drag &amp; Drop.</li><li>Click.</li></ul>', '');
INSERT INTO public.game_texts VALUES (238, 2, 'Yummy Chocolate Factory', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (239, 2, 'Yummy Super Burger', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (240, 1, 'Penguin Diner', '<p><span style="color: rgb(0, 0, 0);">Penny the Penguin goes off track during an Antarctic trek and finds herself completely lost and broke. Help Penny earn enough money to get her home to her family.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Seat the pinguins, take their orders, and serve their meals. Don''t forget to collect the money when they leave. Keep them happy and they will pay more, just as in a real restaurant.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Keywords: Penguins, cooking, cook, restaurant, orders, meals.</span></p>', '', '', '<ul><li>Click on the customers so they can order.</li><li>Click on the meal once it arrives, then on the customer that ordered it, so the meal gets delivered.</li></ul>', '');
INSERT INTO public.game_texts VALUES (240, 2, 'Penguin Diner', '', '', '', '', '');
