INSERT INTO public.game_texts VALUES (256, 1, 'Over the Bridge', '<p><span style="color: rgb(0, 0, 0);">Build a bridge to help get your vehicles across to the other side.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play Over the Bridge on Vedia Games! For different vehicles to pass, there needs to be a bridge. How will you create it? Use logic to go through all the interesting levels. </span></p>', '', 'Build a bridge to help get your vehicles across to the other side.', '<ul><li>Drag &amp; Drop the elements where they are supposed to be to build the bridge.</li></ul>', '');
INSERT INTO public.game_texts VALUES (246, 2, '8 Ball Pool Challenge', '', '', '', '', '');
