INSERT INTO public.game_texts VALUES (242, 1, 'Popcorn Master', '<p><span style="color: rgb(0, 0, 0);">Burst popcorn and complete all the popcorn-making levels! Pop the popcorn bursting and shoot the popcorn out of it. Best ASMR casual puzzle game to get you relaxed. Relax with a casual puzzle popcorn-bursting game and pop your way to the top!</span></p>', '', 'Fill the cup with popcorn without them falling down.', '<ul><li>Click and hold for the popcorn to start flowing.</li></ul>', '');
INSERT INTO public.game_texts VALUES (244, 1, 'Hello Kitty and Friends Restaurant', '<p><span style="color: rgb(0, 0, 0);">Step into a cute cafe in Hello Kitty and Friends: Restaurant. It’s time to make some really yummy meals in this free online Hello Kitty and Friends game. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">It’s another busy afternoon at Hello Kitty’s restaurant. Can you quickly prepare a few scrumptious lunches for her and her friends in this restaurant game for kids of all ages? </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Everything you’ll need is ready and waiting for you in the kitchen. You’ll get to make terrifically tasty sandwiches, soups, salads, cakes, and more!</span></p>', '', 'Quickly create lunch for Hello Kitty and her friends in the restaurant.', '<ul><li><span style="color: rgb(0, 0, 0);">Left Click / Tap to select ingredients, use different kitchen items, and more.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (247, 1, '9 Ball Pro', '<p><span style="color: rgb(0, 0, 0);">9 Ball Pro is a pool variant where the aim is to pocket the lowest numbered-ball every turn, leaving the nine-ball till last. You can challenge a bot, choosing from 3 levels of difficulty, or play against a friend on the same device.</span></p>', '', 'Pocket the lowest numbered ball every turn, leaving the nine ball last.', '<ul><li><span style="color: rgb(0, 0, 0);">Click-drag and release to launch the ball. </span></li></ul><p><strong style="color: rgb(0, 0, 0);">Mobile:</strong></p><ul><li><span style="color: rgb(0, 0, 0);">Drag your finger to rotate the stick, then tap-drag and release to launch the ball.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (245, 1, 'Hello Kitty and Friends Xmas Dinner', '<p><span style="color: rgb(0, 0, 0);">Hello Kitty and friends get together for the most wonderful time of the year: Christmas! Can you help Hello Kitty prepare the Christmas Dinner? All the ingredients are there, now it''s just a matter of putting them together and transforming it into delicious dishes.</span></p>', '', 'Help Hello Kitty prepare the Christmas dinner.', '<ul><li><span style="color: rgb(0, 0, 0);">Tap or click the ingredients to prepare the dish. Swipe left to move to a different room in the game</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (262, 1, 'Save Pilot ', '<p>In this game, you need to control the plane and avoid bullets and rockets. Collect shields and speeds and sometimes you can shoot on your opponent too.</p>', '', 'Fly and avoid the rockets that are coming in your way to survive.', '<ul><li>Click in the direction you want your plane to go.</li></ul><p>You must avoid the rockets as long as you can to survive.</p>', '');
INSERT INTO public.game_texts VALUES (257, 1, 'Idle Zoo Safari Rescue', '<p><span style="color: rgb(0, 0, 0);">In the online game "Idle Zoo: Safari Rescue" you rescue animals and build your own zoo with them. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">While they are in the zoo, they generate coins for you. These coins can be used to upgrade the habitats and to buy new ones.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play Idle Zoo: Safari Rescue on Vedia Games!</span></p>', '', 'Rescue animals and build your own Zoo.', '<ul><li>Click/Tap on animals to get money.</li><li>Upgrade later and automate your process.</li></ul>', '');
INSERT INTO public.game_texts VALUES (248, 1, 'Pool Mania', '<p><span style="color: rgb(0, 0, 0);">Challenge your intellect and skills in this one-of-a-kind pool game. Collect stars and unlock stronger cues so you can beat harder levels. Play pool, roam through levels and collect all the special cues.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Use your cue to shoot balls into holes, gain score and stars so you can progress further, and unlock more powerful cues. Use your skill and intellect to solve the levels, but beware, they get harder as the game goes on.</span></p>', '', 'Play billiard and unlock more and more skills and upgrades as you go.', '<ul><li><span style="color: rgb(0, 0, 0);">Click-drag and release to launch the ball.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (248, 2, 'Pool Mania', '', '', '', '', '');
