INSERT INTO public.game_texts VALUES (252, 1, 'Pool Club', '<p><span style="color: rgb(0, 0, 0);">Pool Club is a smooth solo player pool game. Join our club and let time fly while sinking some balls.<span class="ql-cursor">﻿</span></span></p>', '', 'Join the club and let the time fly while playing this pool game.', '<ul><li><span style="color: rgb(0, 0, 0);">Choose the power and direction of the ball and shoot.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (252, 2, 'Pool Club', '', '', '', '', '');
