INSERT INTO public.game_texts VALUES (254, 2, 'Mafia Billiard Tricks', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (255, 2, 'Imperia Online', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (249, 1, 'Billiards.io', '<p><span style="color: rgb(0, 0, 0);">Enjoy the feeling of hitting your enemies and being the last winner on the pool tables. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>How to play: Drag your pool ball and hit other pool balls off the pool tables.</span></p>', '', 'Bump into your enemies to throw them off the table. The last wins.', '<ul><li><span style="color: rgb(0, 0, 0);">Drag your pool ball and hit other pool balls off the pool tables.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (250, 1, 'Pool 8 Ball Mania', '<p><span style="color: rgb(0, 0, 0);">The classic eight-ball pool for your phone! Play against a computer-controlled opponent or against a friend. Enjoy realistic ball physics and dynamic gameplay. Focus and using the aiming help to shoot the most precise shots.</span></p>', '', 'Classic 8-ball pool game, focus and make precise shots.', '<ul><li><span style="color: rgb(0, 0, 0);">Aim and hit the cue ball to hit and pot the colorful balls into the pockets. </span></li><li><span style="color: rgb(0, 0, 0);">Be careful to pot only your own balls (solids or stripes, depending on the first one your pot) and the black one afterward.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (251, 1, 'Ball Clash', '<p><span style="color: rgb(0, 0, 0);">Put your skills to the test in this new puzzle game! Plan your shots carefully in dozens of levels! Strike all balls and drop them into the hole without leaving any ball.</span></p>', '', 'Finish the level by dropping every ball into the holes. Think.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (253, 1, 'Billiard Golf', '<p><span style="color: rgb(0, 0, 0);">A fun golf game, Billiard Golf offers a billiard-style golf game experience. In a simple and enjoyable game to play, your aim is to stretch the ball into the hole. If you overstep the ball, the ball goes too fast and you may not be able to catch the hole. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Compete in different planes with the 30+ Level and try to get the highest score. It supports you to have a good time with nice sounds in the fun and ambitious Billiard Golf game.</span></p>', '', 'A billiard-style golf game experience.', '<ul><li><span style="color: rgb(0, 0, 0);">Set enough power by pulling towards you by clicking the mouse or touching the finger and release the ball.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (254, 1, 'Mafia Billiard Tricks', '<p><span style="color: rgb(0, 0, 0);">Mafia Billiard Tricks is a great game for both pool experts and newbies. Each Mafia henchman will introduce us to a new set of pool puzzles with their particular game mechanics and we will eventually play a regular pool match against all of the family members.</span></p>', '', 'Learn billiard by playing with all of the family members.', '<ul><li><span style="color: rgb(0, 0, 0);">Move the cue with the mouse to shoot the balls.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (255, 1, 'Imperia Online', '<p><span style="color: rgb(0, 0, 0);">ENTER the Medieval era! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">BUILD your empire from the ground up, GUIDE its great rulers and LEAD it to prosperity! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Experience vast amounts of gameplay mechanics, which give you total freedom of how to become the ultimate Emperor, competing with thousands of other players in a totally realistic strategic simulation! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Will you be a mighty conqueror, a cunning diplomat, or a fearless warrior? Will you lead your allies towards a common goal? </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿Imperia Online gives you unlimited choices of how to shape your destiny and leave your legacy!</span></p>', 'THIS WAS DELETED BECAUSE IT IS NO LONGER GOING TO BE ON GAMEDISTRIBUTION', 'Build your empire from the ground up and lead it to prosperity!', '<ul><li><span style="color: rgb(0, 0, 0);">Click around to interact with the game.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (258, 1, 'Harvest Honors', '<p><span style="color: rgb(0, 0, 0);">It''s time to head down to this farm for a fun puzzle challenge. How quickly can you match up all of the carrots in Harvest Honors Classic? </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You’ll be competing against other gamers from all around the planet while you try to prove that you''ve got a superior green thumb. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Can you harvest more carrots than them in this cute multiplayer game? The first one to make it to 100 will win each round.</span></p>', '', 'How quickly can you match up all of the carrots in this Match-3 game?', '<ul><li>Match 3 or more elements.</li><li>By matching 4 (or more) elements you get an extra turn</li></ul>', '');
INSERT INTO public.game_texts VALUES (258, 2, 'Harvest Honors', '', '', '', '', '');
