INSERT INTO public.game_texts VALUES (263, 1, 'Chop Hand', '<p>Time yourself well and grab the money before the guillotine cut off your hand.</p>', '', 'Grab the money before the guillotine cut off your hand.', '<ul><li>Click to grab the money.</li></ul>', '');
INSERT INTO public.game_texts VALUES (263, 2, 'Chop Hand', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (264, 2, 'Police Chase', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (265, 1, 'Frog Road', '<p>In this online game, your goal is to survive. You need to cross the road successfully by avoiding the passing vehicles.</p><p>Be extra careful and make decisions quickly, since the road is very busy. Can you do it?</p><p><br></p><p>Play Frog Road on Vedia Games!</p>', '', 'Cross the road successfully by avoiding the passing vehicles.', '<p>Successfully cross the road by avoiding the passing vehicles.</p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ or WASD - to move.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (266, 1, 'Flow Lines', '<p>Flow lines is an addicting game, where you need to connect all the matching colors on the board.</p><p><br></p><p>To solve each level, you need to pair all colors and cover the entire board.</p><p><br></p><p>This game has 50 levels. As you play the levels get more and more complex to solve. Good luck!</p><p><br></p><p>Play Flow Lines on Vedia Games!</p>', '', 'Pair all the colors and cover the entire board to win.', '<ul><li>Connect the matching colors on the board. </li></ul><p><br></p><p>To win the level, the entire board needs to be covered.</p>', '');
INSERT INTO public.game_texts VALUES (265, 2, 'Frog Road', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (266, 2, 'Flow Lines', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (267, 2, 'Bumper Ball io', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (260, 1, 'Stickman Warriors', '<p><span style="color: rgb(0, 0, 0);">An exciting game about a stickman''s escape from prison. A stickman is framed and imprisoned, but he never gives up and plans to self-salvation. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Persevere, day after day, year after year. Hope can set him free. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Finally, he can take a breath of freedom.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">♥ Simple, easy rules, cut wood to build a bridge to win a game! </span></p><p><span style="color: rgb(0, 0, 0);">♥ All levels, skins, and roles are free for all users! </span></p><p><span style="color: rgb(0, 0, 0);">♥ No time limit, adjust your pace at any level, and keep playing! </span></p><p><span style="color: rgb(0, 0, 0);">♥ Train logic skills and spatial imagination.</span></p>', '', 'Help Stickman escape from prison!', '<ul><li><span style="color: rgb(0, 0, 0);">Cut the block, so it can fall on the ground and the Stickman can get to the door.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (264, 1, 'Police Chase', '<p>Police Chase is a fun driving game suitable for all ages. The aim of the game is to collect all diamonds in the game and stay away from the police. Use rockets to eliminate the police cars. Drive, shoot, and have fun.</p>', '', 'Avoid police cars to survive and collect the diamonds.', '<p>Avoid the police cars to survive.</p><p>Collect the diamonds to fulfill the goal.</p><p>Use rockets to eliminate police cars.</p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80);">⬆️➡️ -&nbsp;</span><span style="color: rgb(0, 0, 0);">to move</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (261, 1, 'Rocky the Jetpack Boy', '<p>Welcome to this addicting game "Rocky the Jetpack Boy". Fly around with your weapon and try to survive.</p><p><br></p><p>Kill as many monsters and earn as much money as you can without dying.</p>', '', 'Kill as many monsters and earn as much money as you can without dying.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80);">⬆️➡️ -&nbsp;</span><span style="color: rgb(0, 0, 0);">to move</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (267, 1, 'Bumper Ball io', '<p><span style="color: rgb(0, 0, 0);">Knock opponents off the stage with your bumper ball. A fun and fast-paced hyper-casual .io game. Every time you beat an opponent, you will change your size and try to be the last laughing person on the map.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Bravely smash other players in action-packed competitive matches with simple one-finger controls.</span></p>', '', 'Knock components off the stage with your bumper ball.', '<ul><li>Hold and point your mouse in the way where you want your ball to go.</li></ul><p><br></p><p>Knock components off the stage with your bumper ball.</p>', '');
INSERT INTO public.game_texts VALUES (268, 2, 'Police Chase Motorbike Driver', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (287, 1, 'Red Impostor vs. Crew', '<p>Red Imposter vs. Crew is a fun and engaging Action game. Your mission is simple: Execute all living crewmates in the spaceship. Let no one survive. When you kill everyone without getting noticed, the level is completed. Be careful with crewmates, they may discover you are The Imposter</p>', '', 'Super fun hyper casual online game where you hunt down your crewmates', '<ul><li>WASD or touch and drag to move</li><li>Space to knife</li><li>Click on UI popups</li><li>For mobile, you can use the joystick</li></ul>', '');
INSERT INTO public.game_texts VALUES (269, 2, 'Time Shooter 3: SWAT', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (269, 1, 'Time Shooter 3: SWAT', '<p><strong>Time Shooter 3: SWAT</strong> is the sequel to a first-person shooting game in which time only passes when you move, inspired by SuperHot. In the new part, you will play as a SWAT operative. The terrorists stole SWAT gear and took hostages. You must destroy them and save the hostages. The terrorists will use shields and wear body armor with helmets. Breach doors with a battering ram. Dodge bullets in slow motion and destroy enemies with shots from a pistol, machine gun, or shotgun.</p><p><br></p><h3><strong>Features:</strong></h3><ul><li>Unique gameplay</li><li>Variety of weapons</li><li>Minimalistic graphics</li><li>Interactive items</li><li>Realistic physics</li></ul><p><br></p><p>Time Shooter 3: SWAT is an online web shooter game that was inspired by <strong>SUPERHOT</strong>.</p>', '', 'Online web FPS game inspired by SUPERHOT', '<ul><li>Left-click - shoot or pick up</li><li>Right-click - throw</li><li>WASD - Move</li><li>F - Pick up or throw the shield</li></ul>', '');
INSERT INTO public.game_texts VALUES (270, 1, 'Ragdoll Fighter', '<p>Get ready for the ragdoll battle! Choose your ragdoll character and start fighting right away. In Ragdoll Fighter, you earn some mines and diamonds at the end of each battle. </p><p><br></p><p>With these mines, you can produce new weapons or strengthen your current weapon. </p><p><br></p><p>You can also buy one of many different characters and increase your power. Character abilities are also designed to be upgradeable. Start the battle with multiplayer mode, story mode, survival mode, and training mode!</p>', '', 'Super fun fast-paced hypercasual online web game', '<h3>PC: </h3><ul><li>WASD or arrow keys - move</li></ul><p><br></p><h3>Mobile:</h3><ul><li>Touch and drag - move</li><li>On-screen buttons</li></ul>', '');
INSERT INTO public.game_texts VALUES (270, 2, 'Ragdoll Fighter', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (271, 2, 'Mr Gunslinger', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (489, 1, 'Chess Grandmaster', '<p><span style="color: rgb(0, 0, 0);">Chess Grandmaster is the perfect travel companion for brainy gamers. Enjoy the two different game modes: classic matches against a custom AI and chess problems. A wide array of checkmate puzzles with two, three, and four moves will ensure hours of stimulating mental activity.</span></p>', '', 'Chess Grandmaster is the perfect travel companion for brainy gamers. ', '<ul><li><span style="color: rgb(0, 0, 0);">Click a piece you want to move, a possible tile move in green color will be shown, then click one of them.</span></li></ul>', '');
