INSERT INTO public.game_texts VALUES (290, 1, 'Spiderman Motorbike', '<p>Do you want to race on challenging tracks with Spider-Man? If you want, race with your friend or pass the tracks alone. Collect coins to choose the engine or color you want. Let''s play!</p>', '', 'Moto X3M but spiderman, and worse', '<ul><li>WASD or arrows to move</li><li>On mobile use a joystick</li></ul>', '');
INSERT INTO public.game_texts VALUES (290, 2, 'Spiderman Motorbike', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (291, 1, 'Speed Moto Racing', '<p><span style="color: rgb(0, 0, 0);">Speed Moto Racing is a 3D motorbike hustling game in which you''ll go up against other bikers on different race tracks. Is it true that you are passionate about the most recent GP Motorcycle events? Then, at that point, we have an astonishing game for you, enjoy Speed Moto Racing now!</span></p>', '', '3D motorbike game where you go against other bikers on different tracks', '<ul><li>Arrow or WASD to drive</li><li>Space for break</li><li>CTRL for nitro</li></ul>', '');
INSERT INTO public.game_texts VALUES (291, 2, 'Speed Moto Racing', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (288, 1, 'Jack-O Gunner', '<p>Jack-O Gunner is a casual action and survival game with a Halloween theme. Your aim is to kill all the skeletons, upgrade your skills and survive as long as possible.</p><p><br></p><p>Jack O Gunner is an awesome online shooter that will help you kill your time. It has tons of upgrades for you and drops, so you''ll be entertained for hours!</p>', '', 'Super fun shooter game with tons of upgrades and drops.', '<ul><li>Tap and move your finger to move the character</li></ul>', '');
INSERT INTO public.game_texts VALUES (489, 2, 'Chess Grandmaster', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (497, 1, 'Zonic Rush Toilet', '<p><span style="color: rgb(0, 0, 0);">It''s a fun casual game Zonic Rush Toilet Have fun guiding the little Zonic straight to the bathroom before he wins! Can you help the little Zonic to arrive on time? The little hedgehog is eager to get to the bathroom before disaster strikes. In this new game you will have to get to the little sonic to find the bathroom but be careful that you do not have much time to solve the different puzzles in each level you will be able to complete the game!</span></p>', '', 'Help Zonic get to the bathroom before disaster strucks!', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span>⬆️➡️ or WASD - to move.</li></ul>', '');
INSERT INTO public.game_texts VALUES (497, 2, 'Zonic Rush Toilet', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (271, 1, 'Mr Gunslinger', '<p>The lone gunman, you must defeat a group of zombies who want to catch you. The game has a variety of classic gun battle modes, exquisite graphics, smooth shooter combat actions, fierce and exciting shooting effects, and amazing game effects!</p><p><br></p><h3><strong>Features</strong></h3><ul><li>Explore to become a great gunman and possess powerful weapons.</li><li>Try to defeat the opponent within the specified time.</li><li>Customize characters and upgrade a lot of equipment.</li><li>Abundant weapon systems: sniper rifles, submachine guns, shotguns, light machine guns, pistols, endless weapon upgrades!</li><li>Various scenes: various scenes of seaside towns, snow parks, battle stars, fantasy castles, desert wilderness, you can enjoy the unique fun of shooting on different terrains, as well as a variety of exotic experiences.</li><li>Perfect user interface: first-person shooter game, simple finger operation on the full touch screen, beautiful music shocking.</li></ul><p><br></p><p>Be careful! You are surrounded! To stand out from the siege, you must defeat groups of zombies who want to catch you. Entering a world where being itself is destroying you! You are a lone gunman, the only force capable of resisting and defeating the coming wave of evil. This is more difficult than you think! As you pass through various levels, your enemies will become stronger and stronger.</p>', '', 'The lone gunman, you must defeat a group of zombies who want to catch you.', '<ul><li>Use touch or click with a mouse</li></ul>', '');
INSERT INTO public.game_texts VALUES (272, 2, 'Gangster Hero Grand Simulator', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (294, 1, 'REAL BICYCLE RACING GAME 3D', '<p><span style="color: rgb(0, 0, 0);">Power up your muscles, wear the sports kit and tighten up against your shoes. Get your sports cap on the head, kick your sports bicycle and come on to the city streets. Because a very exciting bike cycle racing championship is just a click away.</span></p>', '', 'Power up your muscles, wear the sports kit and drive bikes.', '<ul><li>WASD for movement</li><li>Shift to speed up</li></ul>', '');
INSERT INTO public.game_texts VALUES (292, 1, 'Wheelie Biker', '<p><span style="color: rgb(0, 0, 0);">Pop a wheelie to beat the level! Fill the wheelie meter and do not crash before reaching the finish line to complete each level in this fun online bike game. Unlock new bikes and keep advancing through all of the different levels.</span></p><p><br></p><h3>Features:</h3><ul><li><span style="color: rgb(0, 0, 0);">Reward ads to unlock new bikes and skip levels, </span></li><li><span style="color: rgb(0, 0, 0);">20+ bikes to unlock, </span></li><li><span style="color: rgb(0, 0, 0);">50 levels to beat.</span></li></ul>', '', 'Super addicting hypercasual biking game. You must try it.', '<ul><li><span style="color: rgb(0, 0, 0);">Tap left/right to move and wheelie</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (293, 2, 'Cycle Extreme', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (292, 2, 'Wheelie Biker', '', '', '', '', '');
