INSERT INTO public.game_texts VALUES (283, 1, 'Silent Asylum', '<p><span style="color: rgb(0, 0, 0);">You are trapped in silent asylum crowded with scary monsters and your mission is to shoot your way through dark corridors and find all keys to unlock the exit.</span></p>', '', 'The scaries online web game we''ve ever played.', '<ul><li>WASD - movement</li><li>Left-click - shoot</li><li>R - reload</li><li>P - pause</li><li>C - crouch</li><li>Space - jump</li></ul>', '');
INSERT INTO public.game_texts VALUES (295, 1, 'Trials Ice Ride', '<p><span style="color: rgb(0, 0, 0);">Ride a motorbike on an icy outdoor trial track and pass many complex obstacles. Keep the trial bike balanced and avoid falling off the motorcycle. Complete the track in the shortest time to get higher score points and unlock various achievements.</span></p>', '', 'Ride a motorbike on an icy outdoor trial track and pass obstacles.', '<h3><strong>Desktop: </strong></h3><p>Arrow keys or W,A,S,D to control the motorbike.</p><p><br></p><h3><strong>Mobile:</strong></h3><p>Use on-screen buttons to ride and balance the motorcycle.</p>', '');
INSERT INTO public.game_texts VALUES (296, 1, 'Hugie Wugie Runner', '<p><span style="color: rgb(0, 0, 0);">If you like sports games then this game is for you. Hugie Wugie runs away from people, but he needs to collect the battery to charge his power. The difficulty is always the hill of the mountain, he needs the best player to complete the work.</span></p>', '', 'If you like sports games then this game is for you.', '<ul><li>W or UP arrow - forward</li><li>S or Down arrow - back</li><li>D or Right arrow - balance to the right</li><li>A or Left arrow - balance to left</li></ul>', '');
INSERT INTO public.game_texts VALUES (296, 2, 'Hugie Wugie Runner', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (272, 1, 'Gangster Hero Grand Simulator', '<p>If you like superhero games or gangster crime simulator games, then the Super Gangster Hero Grand simulator is the game for you. where you drive a car or a motorbike. You play as a thug and the whole city fears you. The style of the city is similar to Miami or Las Vegas but actually, it''s New York.</p><p><br></p><p>Get ready to take your passion to the next level! Purchase a huge variety of guns and damage enemies with bullets and place explosives. Use the minimap to figure out the rivals arriving towards you and survive till the end. This is a power-pack shooter game where you play as a dangerous gangster on a task to complete all the missions. In this gangster theft auto game, the gangster has all tools to fight and unfold auto city crime. Thus entertain yourself by defeating the criminal gangster crime city and save the town by victimizing your powers.</p><p><br></p><h3><strong>Key Game Features: </strong></h3><ul><li>It''s a free game</li><li>Many vehicles (trucks, tanks, sports cars, and other autos)</li><li>Plenty of weapons from the auto machine gun, rocket launcher to jet packs and grenade</li><li>3D open-world environment</li><li>Different mission types: robbery, theft, killing, saving, etc.</li><li>Unlock new powerful guns</li><li>You can join gangster mafia city life.</li><li>Character and Costume selection</li><li>Realistic sounds and gangster cars</li><li>Smooth controls</li><li>New Night Club to meet new people around the world.</li><li>You could participate in grand action</li><li>Unlock different cars - sounds are interactive and appealing</li><li>Multiple camera views.</li><li>Customize your character to your own style of a real gangster. - you can select your profile by your own name.</li></ul>', '', 'Open world free roaming game where you do whatever you want', '<ul><li>WASD - movement</li><li>C - crouch</li><li>R - reset the car</li><li>Space - jump</li><li>L Shift - Sprint / nitro</li><li>M - map</li><li>F - car enter/exit</li><li>I - instructions</li><li>P or ESC - pause</li><li>H - horn</li><li>Q - roll</li><li>E - inventory</li><li>Z -radio</li></ul>', '');
INSERT INTO public.game_texts VALUES (498, 2, 'Nail Salon for Animals', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (499, 1, 'Taxi Driver', '<p><span style="color: rgb(0, 0, 0);">Taxi Driver is a fun driving simulation game where you control a taxi and drive passengers to their destination. You are the craziest driver in the world! Run through the craziest traffic, but be careful with the traffic, they are a bit disoriented. The good news is, if you are fast as a comet you gain more money.</span></p>', '', 'A taxi simulation game. Pick up and drive passengers to a destination.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span>⬆️➡️ or WASD - to drive.</li></ul><p><br></p><p>Follow the arrows in the game to find your customers.</p><p>Drive carefully to not lose stars.</p>', '');
INSERT INTO public.game_texts VALUES (499, 2, 'Taxi Driver', '', '', '', '', '');
