INSERT INTO public.game_texts VALUES (274, 1, 'Poke.io', '<p>Play Poke.io on Vedia games!</p><p><br></p><p>Poke.io is an online game where your ultimate goal would be to become the number 1 player on the leaderboard. Take your poke and chase the top score players to defeat them and collect their remains.</p><p><br></p><p>Good luck!</p>', '', 'Take your poke and defeat the best players to become the no.1 player.', '<ul><li>Hold the click and point your mouse in the direction you want to go.</li></ul>', '');
