INSERT INTO public.game_texts VALUES (275, 1, 'Spinner io', '<p><span style="color: rgb(0, 0, 0);">Spinner Io is an exciting io game. You will battle on a platform with other online players! The rule is very simple. Control your spinning top to strike others. When you touch, you will bounce each other. Make them out of the platform, and stay until the end. You will be the winner.</span></p>', '', 'Spin around and bump into others to kick them off the board.', '<ul><li>Hold click and point the mouse in the direction you want to go.</li></ul><p><br></p><p>Bump into other players to push them off the board.</p>', '');
INSERT INTO public.game_texts VALUES (279, 2, 'Vampire Survivors DEMO', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (278, 1, 'Diep.io', '<p><span style="color: rgb(51, 51, 51);">Welcome to the massive online .io game Diep.io. Having the same creator as its famous predecessor - Agar.io, this game has a great promise.</span></p><p><br></p><p><span style="color: rgb(51, 51, 51);">Your goal is to ultimately survive as long as you can and get to the top of the leaderboard.</span></p><p><span style="color: rgb(51, 51, 51);">Shoot and destroy polygons and other players to earn XP and upgrade within the game.</span></p><p><br></p><p><span style="color: rgb(51, 51, 51);">As with every other .io game, this one''s concept is very easy to understand. However, it is also very difficult to master - are you up to the challenge?</span></p><p><br></p><h3><span style="color: rgb(51, 51, 51);">Level up and upgrade</span></h3><p>As you play and earn XP, you can choose how you upgrade. You may want faster movement or more shooting damage - you choose!</p><p><br></p><h3>Tank classes</h3><p><span style="color: rgb(51, 51, 51);">There are tons of machine guns, guided missiles, and cannons around you. What will you be?</span></p><p><br></p><h3><span style="color: rgb(51, 51, 51);">Massive multiplayer action</span></h3><p><span style="color: rgb(51, 51, 51);">What makes this .io game exciting is the ability to play and connect with dozens of players on different servers around the world.</span></p><p><br></p><h3>Game modes</h3><p><br></p><ul><li><strong>Free For All, or FFA</strong>, is a Game Mode in which players attempt to reach #1 on the leaderboard with no team or base for support; instead, they must rely on themselves. To gain a position on the leaderboard players must destroy Polygons and other players to increase their score and level. The players with the top 10 highest scorers appear on the Scoreboard. It is the first and original game mode added to the game. <a href="https://diepio.fandom.com/wiki/Free_For_All" rel="noopener noreferrer" target="_blank">Source: Free for All - Diep.io Wiki - Fandom</a></li></ul><p><br></p><ul><li><strong style="color: rgb(14, 16, 26);">Survival</strong><span style="color: rgb(14, 16, 26);">&nbsp;is just like FFA, except that no players can spawn after the game starts, and when players die they can''t respawn. Every player gets triple XP. You win if you are the last in the arena.</span><a href="https://diepio.fandom.com/wiki/Survival" rel="noopener noreferrer" target="_blank" style="color: rgb(14, 16, 26);"> Source: Survival</a></li></ul><p><br></p><ul><li><strong style="color: rgb(14, 16, 26);">2 Teams and</strong><span style="color: rgb(14, 16, 26);">&nbsp;</span><strong style="color: rgb(14, 16, 26);">4 Teams</strong><span style="color: rgb(14, 16, 26);">, is a game mode in Diep.io, where players work in opposing teams rather than fighting against each other individually. This game mode has regular EXP gain and is one of the two versions of the expired Team Deathmatch. </span><a href="https://diepio.fandom.com/wiki/2_Teams" rel="noopener noreferrer" target="_blank" style="color: rgb(14, 16, 26);">Source: 2 teams</a> or <a href="https://diepio.fandom.com/wiki/4_Teams" rel="noopener noreferrer" target="_blank">4 teams</a></li></ul><p><br></p><ul><li><strong style="color: rgb(14, 16, 26);">Domination</strong><span style="color: rgb(14, 16, 26);">&nbsp;is like 2 Teams, but with a win condition. Players start as level 1 tanks on either team''s base. At opposite ends of the map and with only just one goal in mind. "Capture all four Dominators before the other team does" </span><a href="https://diepio.fandom.com/wiki/Domination" rel="noopener noreferrer" target="_blank" style="color: rgb(14, 16, 26);">Source: Domination</a></li></ul><p><br></p><ul><li><strong style="color: rgb(14, 16, 26);">Tag</strong><span style="color: rgb(14, 16, 26);">&nbsp;is where the goal is to defeat all of the enemy team’s players and become the last Team standing. Players who are killed will be “tagged” and will join the team of the Tank that killed them. </span><a href="https://diepio.fandom.com/wiki/Tag" rel="noopener noreferrer" target="_blank" style="color: rgb(14, 16, 26);">Source: Tag</a></li></ul><p><br></p><ul><li><strong style="color: rgb(14, 16, 26);">Maze -&nbsp;</strong><span style="color: rgb(14, 16, 26);">there are large gray walls that are scattered around the arena, giving the arena the appearance of a maze. These walls are impenetrable by Tanks or their Bullets/Traps/Drones. The maze walls are also visible on the minimap. </span><a href="https://diepio.fandom.com/wiki/Maze" rel="noopener noreferrer" target="_blank" style="color: rgb(14, 16, 26);">Source: Maze</a></li></ul><p><br></p><ul><li><strong style="color: rgb(14, 16, 26);">Sandbox</strong><span style="color: rgb(14, 16, 26);"> - </span>Unlike other game modes, Sandbox includes cheats — players can change their Level and/or Class with the simple press of a button. This makes Sandbox useful for testing Builds and for finding/killing Bosses. <a href="https://diepio.fandom.com/wiki/Sandbox" rel="noopener noreferrer" target="_blank">Source: Sandbox</a></li></ul><p><br></p><p>Enjoy other .io games on our platform:</p><p><br></p><ul><li><a href="https://vediagames.com/game/richup-io" rel="noopener noreferrer" target="_blank">Richup.io</a></li><li><a href="https://vediagames.com/game/starblast-io" rel="noopener noreferrer" target="_blank">Starblast.io</a></li><li><a href="https://vediagames.com/game/hole-io" rel="noopener noreferrer" target="_blank">Hole.io</a></li><li><a href="https://vediagames.com/game/skribbl-io" rel="noopener noreferrer" target="_blank">Skribbl.io</a></li><li><a href="https://vediagames.com/game/krunker-io" rel="noopener noreferrer" target="_blank">Krunker.io</a></li><li><a href="https://vediagames.com/game/kirka-io" rel="noopener noreferrer" target="_blank">Kirka.io</a></li></ul><h3><br></h3>', '', 'Shoot and destroy polygons and other players to earn XP and upgrade.', '<ul><li>WASD or <span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80);">⬆️➡️ -&nbsp;</span><span style="color: rgb(0, 0, 0);">to move</span></li><li>Left-click - to target the pointer with ammo.</li><li>Spacebar - to shoot.</li></ul><p><br></p><p>More useful controls on. <a href="https://diepio.fandom.com/wiki/Controls" rel="noopener noreferrer" target="_blank">Controls - Diep.io - Wiki</a></p>', '');
INSERT INTO public.game_texts VALUES (276, 1, 'Dont Fall io', '<p>Welcome to the exciting online game Don''t Fall io. </p><p><br></p><p><span style="color: rgb(0, 0, 0);">You will compete with other players, each fighting for survival. The one who will be the last to stay on the platform will be the winner. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Don’t let the character fall into the water.  Are you up to the challenge?</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play .io games on Vedia Games! </span></p>', '', 'Be the last to stay on the platform by not falling into the water. Can you?', '<ul><li>Hold click and point your mouse in the direction you want to go.</li></ul>', '');
INSERT INTO public.game_texts VALUES (281, 1, 'Zombie Shooter 3D', '<p><span style="color: rgb(0, 0, 0);">Go to the closed dark forest. Clear the area from crowds of zombies. Watch as enemies are blown apart. In your arsenal: pistol, machine guns, grenades, shotgun, sniper rifle, and grenade launcher. Protect the world from the zombie invasion. Destroy them all!!!</span></p><p><br></p><h3><strong>Features:</strong></h3><ul><li><span style="color: rgb(0, 0, 0);">Dismemberment of enemies</span></li><li><span style="color: rgb(0, 0, 0);">Tons of weapons</span></li><li><span style="color: rgb(0, 0, 0);">Addictive gameplay</span></li><li><span style="color: rgb(0, 0, 0);">Dark atmosphere</span></li><li><span style="color: rgb(0, 0, 0);">Unique enemies</span></li></ul>', '', 'An epic zombie survival FPS web game that will help you kill time', '<ul><li>Mouse - look around</li><li>Left-click - shoot</li><li>Right-click - aim</li><li>Shift - sprint</li><li>WASD - movement</li><li>Mouse wheel - switch weapons</li><li>1-7 - switch weapons</li><li>R - reload</li><li>G - grenade</li></ul>', '');
INSERT INTO public.game_texts VALUES (281, 2, 'Zombie Shooter 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (280, 1, 'GRAND BANK: ROBBERY DUEL', '<p><span style="color: rgb(0, 0, 0);">Smart fire at the appropriate time, aim at your opponent, follow the red laser and press the trigger at the right angle in this bank robbery themed game - More than 20 specially crafted handmade levels - excellent game physics - improve character and weapon with the money you earn Conquer all your opponents and become the most feared robber in town in this modern western-style awesome</span></p><p><br></p><p>Play this free online shooter game and more on vediagames.com</p>', '', 'Short hypercasual shooter where you duel the opponent', '<ul><li><span style="color: rgb(0, 0, 0);">Mouse left Click</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (280, 2, 'GRAND BANK: ROBBERY DUEL', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (282, 1, 'Mountain Operation', '<p><span style="color: rgb(0, 0, 0);">This is a third-person shooter on the mountain location. The mission of the game is to clear military locations from armed enemies. To fight the enemies you have 6 types of weapons, grenades, as well as military vehicles. You can explore the terrain and apply your best physical fitness skills.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play more free online shooters like this on vediagames.com</span></p>', '', 'As a lone wolf soldier, you''re tasked to bring down enemy operations.', '<ul><li>WASD or arrows - movement</li><li>Shift - sprint</li><li>Space - jump or car brake</li><li>Left-click - shoot</li><li>Right-click - aim</li><li>2-7 - weapon change</li><li>G - grenade</li><li>F - Get in or out of the car</li><li>Esc - pause</li></ul>', '');
INSERT INTO public.game_texts VALUES (282, 2, 'Mountain Operation', '', '', '', '', '');
