INSERT INTO public.game_texts VALUES (284, 1, 'Fantasy Sniper', '<p><span style="color: rgb(0, 0, 0);">Fantasy Sniper features great graphics and a vast fantasy world where you must use your modern sniper rifle to shoot all fantasy creatures in order to complete each level.</span></p>', '', 'Shoot fanatasy mobs with sniper, and you''ll feel great about it.', '<ul><li>Right-click - aim</li><li>Left-click - shoot</li><li>P - pause</li></ul>', '');
