INSERT INTO public.game_texts VALUES (285, 1, 'Special Forces Sniper', '<p><span style="color: rgb(0, 0, 0);">Special Forces Sniper is a fun 2D sniper game with amazing graphics and fun gameplay. You have 20 levels to shoot in. Play Special Forces Sniper for a great sniper experience!</span></p><p><br></p><h3>Features:</h3><ul><li>Tons of enjoyable levels</li><li>Good looking cartoonish graphics</li><li>3D illusion</li></ul>', '', 'Shoot enemies with your sniper from the rooftop.', '<ul><li>Click and hold to aim</li><li>Release click to shoot</li></ul>', '');
INSERT INTO public.game_texts VALUES (286, 1, 'Monster Reform', '<p>Monster Reform is a 3D survival shooter game. It is a game that has a level system, and the monsters get stronger at each level. All monsters are mighty, and you have to destroy them to move to the new map.</p>', '', 'survival shooter game where you shoot monsters', '<ul><li>WASD - move</li><li>Left-click - shoot</li><li>Right-click - switch perspective</li><li>U - bazooka</li><li>R - reload</li><li>C - crouch</li><li>1-3 - switch weapons</li></ul>', '');
INSERT INTO public.game_texts VALUES (510, 1, 'Temporary Tattoo', '<p><span style="color: rgb(0, 0, 0);">Become a great tattoo artist and follow the path to success! Have you always wanted to learn how to draw tattoos? Now you can do it in our Temporary Tattoo. Move your virtual tattoo studio from one city to another.</span></p>', '', 'Become a great tattoo artist and follow the path to success!', '<ul><li>Follow the in-game instructions.</li></ul>', '');
INSERT INTO public.game_texts VALUES (510, 2, 'Temporary Tattoo', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (531, 1, 'Rule Your City', '<p><span style="color: rgb(0, 0, 0);">Allow the experience to begin. Take your weapon and your old western assault rifle and begin wandering the urban areas. Kill the troublemakers in the city, right when they are planning to attack.</span></p>', '', 'Wander an old western city and kill all the troublemakers.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move. </span></li><li><span style="color: rgb(0, 0, 0);">Left click - to aim &amp; shoot. </span></li><li><span style="color: rgb(0, 0, 0);">R - to reload.</span></li><li><span style="color: rgb(0, 0, 0);">123 - to change weapons. </span></li><li><span style="color: rgb(0, 0, 0);">ALT - to crouch.</span></li><li><span style="color: rgb(0, 0, 0);">L - lock screen.</span></li><li><span style="color: rgb(0, 0, 0);">P - pause.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (531, 2, 'Rule Your City', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (532, 1, 'Slashville3D', '<p><span style="color: rgb(0, 0, 0);">Slash and Collect Tomatoes. Craft Your Town. Upgrade Your Character. Go on Adventures. Kill Enemies! Buy Pets! Slash and Collect Tomatoes. Craft Your Town. Upgrade Your Character. Go on Adventures. Kill Enemies! Buy Pets!</span></p>', '', 'Slash and Collect Tomatoes. Craft Your Town. Upgrade. Kill enemies.', '<ul><li>Use your mouse to play the game.</li></ul>', '');
INSERT INTO public.game_texts VALUES (532, 2, 'Slashville3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (533, 1, 'Bee Careful', '<p><span style="color: rgb(0, 0, 0);">Bee has been attacked by an unknown creature. Avoid its bullets and pay the creature back with the same coin! It''s not so far, you have to fly just for five minutes without being hit. Find your way to the enemy and sting it!</span></p>', '', 'Protect the bee by avoiding the bullets in the air.', '<ul><li>Drag to move up and down and avoid the bullets.</li></ul>', '');
INSERT INTO public.game_texts VALUES (533, 2, 'Bee Careful', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (297, 1, 'Motorcycle Stunts Drive', '<p>Stunt superbike doesn''t get any better than racing against a friend or a random stranger on the internet. Maintain complete control of your motorbike, keep an eye out for the chance of an incoming stunt or gigantic ramp, and always keep an eye out for your competitors who are attempting to whistle past you in the race for the top bike rider honors. You don''t have to be in high gear all of the time, but some tricks will demand that you be particularly careful and strategic in your approach. </p><p><br></p><p>Apart from multiplayer, there are a variety of interesting modes to play; make sure you try them all to unlock all of the superbikes and give yourself a greater chance against the insanely fast bikers who are waiting until you''re on both sides of the globe to attempt to educate you on a lesson that will last a lifetime. So best of luck, and enjoy yourselves.</p>', '', 'Super 3D free online motor racing game. Trust me, you''ll enjoy it', '<ul><li>WASD - movement</li><li>C - change camera perspective</li><li>Space - break</li></ul>', '');
INSERT INTO public.game_texts VALUES (297, 2, 'Motorcycle Stunts Drive', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (298, 1, 'Blocky Bike Racing', '<p>This pixel Bmx trial motorcycle racing simulator game is called "Blocky Incredible Bike Race Game," You may play it for free. In this competition, in which you may pick between fast motorbikes racing around a 3D block city environment, With this customized bike simulator and motorcycle challenge, you will get the ultimate 3D motorbike racing challenge experience in a beautiful sandbox-style setting.</p>', '', 'Entertaining fast paced hypercasual avoid-obstacles type game', '<p>Control bike on mobile with touch and for PC use arrow left and right.</p>', '');
INSERT INTO public.game_texts VALUES (298, 2, 'Blocky Bike Racing', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (299, 2, 'Motorcycle Pet Delivery', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (300, 1, 'Scooter XTreme 3D', '<p>Scooter Xtreme 3D is a cool scooter racing game where you must drive your scoot forward and race against other riders with the goal to be the first one to finish! </p><p><br></p><p>Collect coins and jump on ramps to perform stunts and propel you faster and get ahead but watch your flip so you can land back safely on the ground and watch out for cars and don''t crash on them. Use nitro to boost your acceleration to win the race!</p>', '', 'Awesome 3D hypercasual web game where you drive a scooter!', '<ul><li>Tap and drag to move the scooter</li><li>Tap and hold to spin in the air</li></ul>', '');
INSERT INTO public.game_texts VALUES (300, 2, 'Scooter XTreme 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (301, 2, 'Moto Maniac 3', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (302, 2, 'Smash it 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (303, 1, 'MX OffRoad Master', '<p><span style="color: rgb(0, 0, 0);">Are you ready for a realistic Off-Road Adventure? MX Off-Road continues with its new version. Completely new physics, new bikes, helmets, and third-person camera make the game more enjoyable. The game will give you a realistic bike riding experience. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">There are 2 modes in the game, Mountain Downhill, and Free Roam modes. You can get gold and diamonds by spinning in the air or by finishing mountain tracks. The game has 1 and 2-player modes. You can have fun mountain races with your friends.</span></p>', '', 'Are you ready for a realistic Off-Road Adventure?', '<ul><li>WASD - move</li><li>Space - brake</li><li>C - camera</li><li>R - restart</li></ul>', '<ul><li>ARROW keys - move</li><li>Right shift - brake</li><li>O - camera</li><li>P - restart</li></ul>');
INSERT INTO public.game_texts VALUES (303, 2, 'MX OffRoad Master', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (327, 2, 'Superhero.io', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (360, 1, 'Tricky Puzzle', '<p><span style="color: rgb(0, 0, 0);">A bright, colorful puzzle game that will not let you get bored. Stunning graphics and animation will please your eyes. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">In-game music, sound, and voice-over are created by a professional composer. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">All the puzzles in this game share one great storyline. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>The solution comes through out-of-the-box thinking training your mind and brains at the same time! Save aliens, count bees, pet a dog and much more... Shake, tilt, and rotate your mobile to solve puzzles.</span></p>', '', 'Train your mind with interesting, story connected puzzles.', '<p>Train your mind by solving interesting puzzles.</p><p><br></p><ul><li>Click/Tap on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (360, 2, 'Tricky Puzzle', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (301, 1, 'Moto Maniac 3', '<p>This is a tilty bike game that will challenge your trial skills to the max. The trial competition is set up in the forest, so be ready to climb over trees and rocks. Your main goal is to overcome all the obstacles as fast as you can. But there is a second (yet important) goal - a wild bear was annoyed by the loud engine sounds and it is chasing you, so be quick not to be caught by the beast!</p>', '', 'Drive your motorcycle through woods while being chased by a bear', '<ul><li>Up arrow or W - drive forward</li><li>Down arrow or S - drive backward</li><li>Left arrow or A - tilt left</li><li>Right arrow or D - tilt right</li><li>P - pause</li></ul>', '');
INSERT INTO public.game_texts VALUES (302, 1, 'Smash it 3D', '<p><span style="color: rgb(0, 0, 0);">Are you a good target shooter? Do you enjoy smashing things, chopping wood, or slaying cockroaches? If you''re looking for a way to let off steam or smash things, Smash it 3D is the game for you. You can smash as much as you want without breaking anything. Now is the time to play and have a good time!</span></p><p><br></p><h3><strong>Features:</strong></h3><ul><li><span style="color: rgb(0, 0, 0);"> 3D Design</span></li><li><span style="color: rgb(0, 0, 0);">Easy Gameplay</span></li><li><span style="color: rgb(0, 0, 0);">Amazing Graphics and effects</span></li><li><span style="color: rgb(0, 0, 0);">7 Challenging yet fun Modes</span></li><li><span style="color: rgb(0, 0, 0);">You can unlock 10 or 11 cool and unique weapons in every mode</span></li><li><span style="color: rgb(0, 0, 0);">Try to get the clock to make the time slower</span></li><li><span style="color: rgb(0, 0, 0);">Avoid the bombs or the game will be over</span></li><li><span style="color: rgb(0, 0, 0);">Obtain the hearts to have another life</span></li></ul>', '', 'Cut down wood in this super satisfying 3D hypercasual game.', '<ul><li>Tap/click to chop</li></ul>', '');
INSERT INTO public.game_texts VALUES (304, 1, 'Bike Racing 3', '<p><span style="color: rgb(0, 0, 0);">Bike Racing, the popular and addictive hill-climb racing game goes into the third round! In Bike Racing 3 you will no longer race against the clock. Pick a bike of your choice, select one of the challenging infinite tracks and try to go as far as you can without falling on your head! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Each of the two-wheeled vehicles has its own advantages in the different areas. Use the scooter to cruise over rolling hills, pick the cross-bike to jump over sand dunes, or try the heavy classic bike in arctic conditions! All tracks are filled with an endless number of hills and obstacles. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Collect as many coins as possible, reach checkpoints and perform stunts to earn bonus coins! Spend the prize money to unlock new bikes and tracks or invest in a larger tank, stronger engine, or better tires that will help you go further and to beat the ghost that represents your high score!! Play Bike Racing 3 now for free and experience hours of nerve-racking races!</span></p><p><br></p><h3><strong style="color: rgb(0, 0, 0);">Features:</strong></h3><ul><li><span style="color: rgb(0, 0, 0);">5 different vehicles to choose from </span></li><li><span style="color: rgb(0, 0, 0);">Colorful 2D graphics </span></li><li><span style="color: rgb(0, 0, 0);">5 different tracks to complete </span></li><li><span style="color: rgb(0, 0, 0);">4 different upgradable stats</span></li></ul>', '', 'Addictive hill-climb racing game with tons of features', '<p><span style="color: rgb(0, 0, 0);">Drive as far as you can through obstacles and rough terrain as you collect coins.</span></p><p><br></p><p>Use on-screen controls, to control gas and brakes</p>', '');
INSERT INTO public.game_texts VALUES (304, 2, 'Bike Racing 3', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (305, 2, 'Uphill Offroad Bicycle Rider', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (306, 1, 'XMAS Wheelie', '<p><span style="color: rgb(0, 0, 0);">Wheelie game but Christmas! This is an awesome hypercasual 2D web game that you can play online for free. It really is a time killer which will provide you with tons of entertainment.</span></p>', '', 'Wheelie your way in to the holidays!', '<ul><li><span style="color: rgb(0, 0, 0);">Hold down the mouse or your finger to wheelie.</span></li><li><span style="color: rgb(0, 0, 0);">Try to hold wheelie as much as you can, once you fall down you lose</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (306, 2, 'XMAS Wheelie', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (307, 2, 'Draw and Park', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (308, 2, 'Parking Man', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (308, 1, 'Parking Man', '<p><span style="color: rgb(0, 0, 0);">It''s time to open your own business, but not enough money? You need to work a little as a parking attendant, but be careful! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿This should be done very carefully and carefully because there are a lot of obstacles and dangers in these parking lots! Can you park all the cars without breaking them?</span></p>', '', 'Can you park all the cars without breaking them?', '<ul><li><span style="color: rgb(0, 0, 0);">Mouse click or touch screen to park the car in an empty place</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (309, 1, 'Parking Harder', '<p><span style="color: rgb(0, 0, 0);">If you find games that require skills fun, well then, this game is designed for you. Use the arrow key to move the car to the parking place. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Sounds easy? No. You need to focus to move the car safely, a small mistake will move you to the start point.</span></p>', '', 'Very hard but super fund car parking game', '<ul><li>Use virtual joysticks on mobile</li><li>WASD on PC also works</li></ul>', '');
INSERT INTO public.game_texts VALUES (309, 2, 'Parking Harder', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (358, 1, 'Friday Night Funkin Noob', '<p><span style="color: rgb(0, 0, 0);">Have fun with this new game Friday Night Funkin vs Noob ''a new game in this fabulous saga!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play the ritual of each music with your favorite Minecraft characters and press the game buttons at the right time and accumulate the points to show that you are the best.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">On Vedia Games, you can also play </span><a href="https://vediagames.com/game/super-friday-night-vs-neon" rel="noopener noreferrer" target="_blank" style="color: rgb(0, 0, 0);">Super Friday Night vs Neon</a><span style="color: rgb(0, 0, 0);">.</span></p><p><span style="color: rgb(0, 0, 0);">Check it out!</span></p>', '', 'An addicting music game where you need to hit the notes at the right time.', '<ul><li><span style="background-color: rgb(22, 35, 80);">Use ⬅️⬆️➡️⬇️ or WASD to hit the notes at the right time.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (358, 2, 'Friday Night Funkin Noob', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (359, 1, 'Lost in the Maze', '<p><span style="color: rgb(0, 0, 0);">In the game Lost in the Maze, you are stuck in procedurally generated mazes. Explore each maze before the time runs out and take care of the wandering enemies around you.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">To start exploring the maze, use the arrow keys on your keyboard. The concept of the game is easy, however, it can be pretty challenging to discover all of the mazes in time. Good luck.</span></p>', '', 'Explore the maze in time! Pretty addicting.', '<ul><li>Start exploring the maze using <span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬅️⬆️➡️⬇️ on your keyboard.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (310, 1, 'Fly THIS!', '<p><span style="color: rgb(0, 0, 0);">Fly THIS! is an addictive game of explosive airplane action that will challenge your inner air traffic controller. The sequel to the award-winning Conduct THIS! takes players to the skies in a race against time to bring passengers safely to their destination by drawing flight paths and avoiding collisions in increasingly challenging action puzzles. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Mastering air traffic has never looked this good and been this fun. Upgrade your airport and purchase new planes for your fleet as your little airline expands its reach to faraway destinations. </span></p><ul><li><span style="color: rgb(0, 0, 0);">Control planes in a beautiful 3D world • Simple and intuitive gameplay for everyone</span></li><li><span style="color: rgb(0, 0, 0);">Transport passengers, earn coins, and unlock new airplanes</span></li><li><span style="color: rgb(0, 0, 0);">Progress through exotic islands with unique themes</span></li><li><span style="color: rgb(0, 0, 0);">Fantastic soundtrack by composer Mikkel Gemzøe</span></li><li><span style="color: rgb(0, 0, 0);">From the award-winning team that brought you Conduct THIS!</span></li></ul>', '', 'Transport passengers, earn coins, and unlock new airplanes.', '<ul><li><span style="color: rgb(0, 0, 0);">Press on planes and drag to create a path.</span></li><li><span style="color: rgb(0, 0, 0);">Don''t let planes crash into each other</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (310, 2, 'Fly THIS!', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (311, 1, 'City Parking 2D', '<p><span style="color: rgb(0, 0, 0);">City Parking is a fun 2D parking game with amazing graphics. There are many challenging levels with unique experiences. Play City Parking now for a great car parking simulation!</span></p><p><br></p><h3><strong>Features:</strong></h3><ul><li>20 levels</li><li>Amazing graphics</li><li>Smooth controls</li><li>Friendly UI</li></ul>', '', '', '<ul><li>WASD or arrows to control your vehicle</li></ul>', '');
INSERT INTO public.game_texts VALUES (311, 2, 'City Parking 2D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (312, 2, 'Bus Simulator 2021', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (313, 2, 'Parking Jam Out', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (314, 2, 'Car Parking Math', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (315, 1, 'Monoa City Parking', '<p><span style="color: rgb(0, 0, 0);">The city is all yours to explore. All you have to do is drive fast and reach the parking place before the time is running out Moreover there are obstacles to slow you down Do not hit any obstacle to win more money at the end of a level</span></p>', '', 'A 3D car parking simulator that is beautiful and very entertaining.', '<ul><li>WASD to move </li><li>Space to brake</li></ul>', '');
INSERT INTO public.game_texts VALUES (315, 2, 'Monoa City Parking', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (316, 2, 'Garbage Sanitation Truck', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (317, 2, 'Car Transport Truck', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (318, 1, 'Monster Truck Racing', '<p>Monster Truck Racing is a fun racing game with amazing graphics. Race against AI players and reach first place!</p>', '', 'fun 2D racing game where you race against AI players.', '<ul><li>AD - left or right</li><li>W - jump</li><li>Or onscreen joystick if mobile</li></ul>', '');
INSERT INTO public.game_texts VALUES (318, 2, 'Monster Truck Racing', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (319, 2, 'Bus Driving 3D Simulator 2', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (359, 2, 'Lost in the Maze', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (387, 1, 'Funny Puppy Care', '<p><span style="color: rgb(0, 0, 0);">Are you a puppy lover? Meet a cute little puppy who needs you to take good care of him. let''s rescue this puppy from dirty tar. Give him a shower to wash off the dirt. Cure the puppy''s wound and fix the broken leg. Play mini games and dress up the puppy with various clothes and cute accessories. Enjoy this fabulous pet care game!</span></p>', '', 'Take care of the cute little puppy.', '<ul><li>Follow the instructions within the game.</li></ul>', '');
INSERT INTO public.game_texts VALUES (387, 2, 'Funny Puppy Care', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (313, 1, 'Parking Jam Out', '<p><span style="color: rgb(0, 0, 0);">Parking Jam Out is a puzzle online game that you can play for free. You can operate a parking lot and attract users to park through transformation and upgrading. The gameplay is very simple to play, you can constantly expand the business scale, feel the excitement of it, cultivate your own business means, and transform and upgrade the parking lot through the reasonable allocation of coins.</span></p>', '', 'Simple yet super addicting puzzle game with beautiful graphics.', '<ul><li><span style="color: rgb(0, 0, 0);">Remove the car from the parking spots without collision.</span></li><li><span style="color: rgb(0, 0, 0);">Mouse or tap to play.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (314, 1, 'Car Parking Math', '<p><span style="color: rgb(0, 0, 0);">In this math parking game, drive the car towards asked parking slot. You need to find the slot number by solving the math problem displayed in the bottom right corner. Avoid any collision with other cars or walls. You will have 5 chances to complete a level. Each time you collide with a wall or any other car, you lose 1 chance. Park fast and safely to get more scores.</span></p>', '', 'In this math parking game, drive the car towards calculated parking slot.', '<ul><li>Get the parking spot number where you have to park your car by doing basic arithmetic</li><li>Arrow keys to drive</li><li>On mobile use a virtual joystick (arrows on screen)</li></ul>', '');
INSERT INTO public.game_texts VALUES (316, 1, 'Garbage Sanitation Truck', '<p><span style="color: rgb(0, 0, 0);">No one has ever seen the garbage truck on the street in real life. Now you have a chance to experience the life of a garbage truck driver. You need to drive to the dustbin and load the trash, then get to the refuse processing ground and drop them out at each level. Don''t crash any vehicles on the street!</span></p>', '', 'Try out this 3D garbage truck driving simulator!', '<ul><li>WASD to move</li><li>Use the virtual joystick on the phone</li></ul>', '');
INSERT INTO public.game_texts VALUES (319, 1, 'Bus Driving 3D Simulator 2', '<p>Coach Bus Simulator is the first coach driving game that will teach you to drive a real coach across different scenarios! Take people from one city to another, show them amazing places and landscapes. Open world map, incredible vehicles, and wonderful interiors will make you feel a realistic coach bus driving experience! It''s time to get on board and drive through Europe! Enter the simulation world of bus driving! Get Coach Bus Simulator now!</p>', '', 'If you like driving buses, then this game is for you!', '<ul><li>WASD or arrows to drive</li><li>C to change camera</li><li>Space to brake</li></ul>', '');
INSERT INTO public.game_texts VALUES (320, 1, 'Monster Truck 2022 Stunts', '<p>Do you have a passion for driving a monster truck? So get ready for a crazy off-road truck racing game where there are no limits to the amount of speed you can get. Monster Truck Stunts Offroad Racing Games 2021 is a Monster Truck Stunts Monster Games that take place on off-road terrain and offers an amazing atmosphere to play in. The missions in Mega Ramp Monster Truck Driving Stunts Racing Game are packed with excitement and action, much like the previous monster truck stunts games. </p><p><br></p><p>Monster truck Driving Simulator Game is easy to comprehend; you need to drive and race your genuine monster truck while collecting all checkpoints along the way in Top Monster Truck Stunts huge Ramp Car Stunts Racing games to complete the tasks. </p><p><br></p><p>Offroad Monster Truck Stunt Driving Simulator 2021 is a combination of fun and adventure for monster truck drivers, featuring real heavy destruction monster trucks and a variety of unique and different race track environments. One mode will test your truck stunt skills, while the other will test your truck racing skills.</p>', '', 'For all the people passionate about awesome and cool monster trucks.', '<ul><li>WASD - drive</li><li>Space - brake</li></ul>', '');
INSERT INTO public.game_texts VALUES (320, 2, 'Monster Truck 2022 Stunts', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (321, 1, 'Truck Deliver 3D', '<p>Here is a truck balanced arcade game with 3D art animations called Truck Deliver 3D. The factory needs you to transport different products to the pointed locations on platform tracks at each level. You don''t need to drive yourself, but you need to control the gas and brake of the truck. Never drive too fast, especially on different terrains, maybe you will drive out of the track directly!</p>', '', 'Free online arcade game with 3D art animations where you control a truck. ', '<ul><li>Tap and hold to move</li><li>Release tap to stop</li></ul>', '');
INSERT INTO public.game_texts VALUES (321, 2, 'Truck Deliver 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (322, 2, 'Jumpy Felix', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (323, 1, 'JEEPS DRIVER', '<p>Jeep Driver is a fun driving game with 30 levels and amazing graphics. You can buy new vehicles in the garage and upgrade them! Play this challenging game for great fun!</p>', '', 'A fun 2D driving game with tons of levels and pretty art style.', '<ul><li>AD - left or right</li><li>W - jump</li><li>Try to not destroy your truck! There is a health bar above in the top right corner</li></ul>', '');
INSERT INTO public.game_texts VALUES (323, 2, 'JEEPS DRIVER', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (324, 2, 'Falling Blocks', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (325, 2, 'Top Guns IO', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (326, 1, 'Stack Builder Skyscraper', '<p><span style="color: rgb(0, 0, 0);">Stack Builder is a fun and simple building game, you have to build skyscrapers with a touch of your finger and your dexterity. Build a builder as high as you can, so it''s can be called a skyscraper.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play Arcade games on Vedia Games!</span></p>', '', 'Try to drop as many blocks as possible at the right time so they don''t fall', '<ul><li><span style="color: rgb(0, 0, 0);">Tap/Click when you are ready to drop the block.</span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Try to drop as many blocks as possible at the right time to build a skyscraper.</span></p>', '');
INSERT INTO public.game_texts VALUES (326, 2, 'Stack Builder Skyscraper', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (322, 1, 'Jumpy Felix', '<p><span style="color: rgb(0, 0, 0);">Exciting adventure of the bouncing ball through the helix tower labyrinth. Helix Jump is all new insane ball hop and exceptionally addictive interactivity. Bounce and complete labyrinth and level. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Straightforward controls simply slide the fingers both ways for the winding revolution and bounce of the ball. One-tap easy-to-learn controls, rich visual effects addictive gameplay mechanics.</span></p>', '', 'Move the helix tower so the ball can get to the bottom of it.', '<ul><li>Hold and move the tower to get the ball to the bottom.</li></ul>', '');
INSERT INTO public.game_texts VALUES (324, 1, 'Falling Blocks', '<p><span style="color: rgb(0, 0, 0);">Falling Blocks is a fun physics-based puzzle game inspired by Red Remover with additional features. It''s a fully HD game with unique 30 levels that require a bit of thinking and reaction time to complete. The game is also very pretty and has some beautiful graphics.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Destroy the angry blocks by clicking on them. Keep the happy blue block (or blocks) alive. Can you do it?</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play Board &amp; Puzzle games on Vedia Games!</span></p>', '', 'Destroy all of the angry blocks. Be careful, the blue one should stay alive', '<ul><li><span style="color: rgb(0, 0, 0);">Click/Tap on the angry blocks to get rid of them. Keep the happy block alive.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (317, 1, 'Car Transport Truck', '<p>Car Transport Truck is a 3D game where you drive a car carrier truck and your job is to load the cars in it and take them where it needs.</p><p><br></p><h3><strong>Features:</strong></h3><ul><li>Multiple missions</li><li>Control cars and trucks</li></ul>', '', 'Online web 3D truck simulator where you transport different cars.', '<ul><li>WASD or Arrows to drive</li><li>C - change the camera</li><li>Escape - pause</li></ul>', '');
INSERT INTO public.game_texts VALUES (293, 1, 'Cycle Extreme', '<p><span style="color: rgb(0, 0, 0);">Take part in a mountain bike downhill racing challenge. You control a bicycle rushing down from the mountains. Be careful - the track is very steep, and there are several obstacles and deadly holes ahead. Be careful and finish each of the 20 levels as fast as you can to gain 3 stars! </span></p><p><span style="color: rgb(0, 0, 0);">Version: 1.0.16</span></p><p><br></p><h3>Features:</h3><ul><li><span style="color: rgb(0, 0, 0);">20 fast downhill levels</span></li><li><span style="color: rgb(0, 0, 0);">mobile-friendly</span></li><li><span style="color: rgb(0, 0, 0);">mountain bicycle free-ride action</span></li></ul>', '', 'Take part in a mountain bike downhill racing challenge.', '<ul><li>Up or W - speed up</li><li>Down or S - break</li><li>Left or A - lean left</li><li>﻿Right or D - lean right</li></ul>', '');
INSERT INTO public.game_texts VALUES (328, 2, 'Paper.io 2', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (327, 1, 'Superhero.io', '<p>Superhero.io is one of the most interesting games that can be a way of relaxing your mind and challenging yourself simultaneously.</p><p><br></p><p>You are in the arena with multiple players, each one of them is a different superhero and level.</p><p><br></p><p>Your task is to collect gems and kill other players to upgrade into stronger superheroes.</p><p><br></p><p>As you upgrade you can be IronMan, Black Panther, Captain America, Spiderman, and other amazing superheroes.</p><p><br></p><p>Be careful to not be killed by stronger players.</p><p><br></p><p>Play the best .io games on Vedia Games!</p>', '', 'Kill other players and upgrade into strong superheros like Ironman.', '<ul><li>Direct the player with your mouse.</li><li>Get close to a player and Click to kill them.</li></ul>', '');
INSERT INTO public.game_texts VALUES (329, 2, 'Impostor.io', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (328, 1, 'Paper.io 2', '<p>Capture new territories and defeat enemies in the new exciting game Paper.io 2.</p><p><br></p><p>Each player starts out with a small island, make it larger by adding new areas to it, but watch out for enemies.</p><p><br></p><p>You are safe on your own turf but once you are outside you become vulnerable. Protect your tail from opponents and don''t hesitate to counterattack!</p><p><br></p><ul><li>Be aware of your environment.</li><li>Everyone is an enemy!</li><li>Do not charge blindly, stay in your zone.</li><li>Compete with other players worldwide.</li></ul><p><br></p><p><span style="color: rgb(48, 48, 48);">Paper.io 2 has witnessed massive downloads and followership. It is extremely easy to start playing, and anyone can access it within 3 clicks. But - it is also hard to master. That is what makes it addicting.</span></p><p><br></p><p><span style="color: rgb(48, 48, 48);">Play Paper.io and other similar games on Vedia Games!</span></p>', '', 'Capture new territories and defeat enemies.', '<ul><li>You can direct your character with the mouse or WASD keys.</li></ul><p><br></p><p>You are safe on your turf, but once you are outside, be aware of your surroundings.</p><p><br></p><p>Protect your tail from enemies.</p>', '');
INSERT INTO public.game_texts VALUES (330, 2, 'Parkour Block 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (331, 2, 'Vex3', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (332, 2, 'Stick Duel Battle', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (76, 1, 'Zumba Mania', '<p>Get better at marble shooting and try to complete all the levels with three stars in each level. This marble game is easy to play and addicting at the same time.</p><p><br></p><p>Tap to shoot. Match 3 or more same-colored marbles to eliminate them.</p><p><br></p><p>Destroy all marbles in the chain before it hits the end.</p><p><br></p><p>Tap the frog to swap between the current and the next marble. Use power-ups to clear the board faster.</p>', '', 'Match 3 or more same-colored marbles to eliminate them. ', '<ul><li>Click/Tap - to shoot.</li><li>Tap the frog to swap between the current and the next marble.</li></ul>', '');
INSERT INTO public.game_texts VALUES (330, 1, 'Parkour Block 3D', '<p>Parkour Block 3D is a satisfying &amp; addicting parkour game, that represents a good challenge. Jump from one block to another, and be careful to not fall into the lava.</p><p><br></p><p><span style="color: rgb(0, 0, 0);">Skill game, classic mode from your favorite games right in the browser on your computer and phone! 35 unique levels, varied mechanics, and real hardcore awaits you.</span></p><p><br></p><p>Play Parkour Block 3D on Vedia Games!</p><p><br></p>', '', 'Jump from one block to another, and be careful to not fall into the lava.', '<ul><li>Spacebar - to jump.</li><li>WASD - to move.</li><li>Left Shift - to run.</li><li>Double escape - go to the menu.</li></ul>', '');
INSERT INTO public.game_texts VALUES (332, 1, 'Stick Duel Battle', '<p><span style="color: rgb(0, 0, 0);">Stick Duel Battle is a funny and crazy stickman battle game! You can fight with realistic weapons and physics on many maps. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Each different map requires different tactics. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Stick Battle Duel can be played with both 1 player and 2 players. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The one who reaches 5 scores first, and wins the game.</span></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">If you want to fly, go towards the walls. </span></li><li><span style="color: rgb(0, 0, 0);">You can use your skateboard as a shield. </span></li><li><span style="color: rgb(0, 0, 0);">Stay away from fire pools!</span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">Play multiplayer games on Vedia Games!</span></p>', '', 'Find and collect a weapon to shoot & kill the opponent before they kill you', '<p>Find and collect a weapon to shoot &amp; kill the opponent before they kill you.</p><ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80);">⬆️➡️ -&nbsp;</span><span style="color: rgb(0, 0, 0);">to move.</span></li><li><span style="color: rgb(0, 0, 0);">L - to shoot.</span></li></ul>', '<ul><li>WASD - to move.</li><li>F - to shoot.</li></ul>');
INSERT INTO public.game_texts VALUES (331, 1, 'Vex3', '<p>Vex 3 is an addictive online game that puts you through different challenges. You must avoid traps by running, jumping, sliding, and swimming. Vex3 promises easy and addictive gameplay since it teaches you in a simple way how to play.</p><p><br></p><p><span style="color: rgb(0, 0, 0);">Can you go through all of the 10 levels and the 9 extra challenge modes? Let''s try.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play Vex3 on Vedia Games!</span></p>', '', 'Avoid the deadly traps by running, jumping, sliding and swimming. Can you?', '<p><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️ - to jump.</span></p><p><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️ - to move left and right.</span></p><p>⬇️ &amp; <span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">➡️ - to run and slide.</span></p><p><br></p>', '');
INSERT INTO public.game_texts VALUES (333, 2, 'Cat Runner', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (334, 2, 'Bubble Game 3', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (345, 1, 'Fruit Ninja', '<p><span style="color: rgb(0, 0, 0);">Welcome to the dojo, ninja! Your objective is to achieve mastery at the original fruit-slicing mobile hit game! Believe in the hype of Fruit Ninja, enjoyed by 1 billion gamers globally. Slice fruit, Dodge bomb, Win! What are you waiting for? </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Whether you''re playing for some mindless fun and trying to relax and pass the time or trying to improve your skills as a master ninja, this is the game for you. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Enjoy the awesomeness and believe the hype of Fruit Ninja – chop chop! ⚔️</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play Fruit Ninja on Vedia Games!</span></p>', '', 'Slice the flying fruit! Do not slice the bombs.', '<ul><li>Use your mouse (drag) - to slice.</li></ul>', '');
INSERT INTO public.game_texts VALUES (345, 2, 'Fruit Ninja', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (352, 1, 'Make 5 Hexa', '<p>Merge and win points! We have hexagons with numbers and colors and you need to decide the correct placement to merge them to score. You can also rotate the Hexa''s before using them as per your logic to get the maximum score! Go for it!</p>', '', 'Fun 2048/match-3 like game where you place hexagons and combine numbers.', '<ul><li>Place three or more hexa blocks with the same number and color next to each other to merge them and get a score. You can also rotate blocks before placing them on the grid!</li><li>Use touch or mouse click to control the screen</li></ul>', '');
INSERT INTO public.game_texts VALUES (352, 2, 'Make 5 Hexa', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (346, 1, 'Pop it Master', '<p><span style="color: rgb(0, 0, 0);">Meet the popular anti-stress toy Pop it Master! Play Pop It Simulator for free and collect the entire collection of 140 Pop It and Simple Dimple toys! Relieve stress after school or a day at work with this simple game!</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Features</span></h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Relaxing and stress-relieving game</span></li><li><span style="color: rgb(0, 0, 0);">Collection of Pop-it and simple dimple of various shapes and colors </span></li><li><span style="color: rgb(0, 0, 0);">Secret game mode.</span></li></ul><p>		</p><p><span style="color: rgb(0, 0, 0);">Click on all the bumps to open the next toy! Collect all 140 toys to unlock Secret Mode!</span></p>', '', 'Click on all the bumps to unlock the next toy. Over 140+ toys!', '<ul><li>Click on all of the bumps to open the next toy.</li></ul>', '');
INSERT INTO public.game_texts VALUES (346, 2, 'Pop it Master', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (347, 1, '5roll', '<p><span style="color: rgb(0, 0, 0);">See if you have the hot hand today and roll for a high score in this classic 5-dice game. Try your hand at the poker of dice games, roll your dice and look for pairs, 3 of a kind, full houses, and straights. See if you can’t beat your own odds in 5 rolls!</span></p>', '', 'Try your hand at the poker of dice games.', '<ul><li>Click / Tap on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (347, 2, '5roll', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (348, 1, 'Solitaire Classic', '<p><span style="color: rgb(0, 0, 0);">Solitaire (also known as Klondike or patience) is the most famous and the best card game on mobile, tablets, and desktops. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Playtouch is bringing to you a fresh and free solitaire cards game that you can play for hours thanks to its original and fun gameplay. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You can choose the level of difficulty for your solitaire game: 1 draw (most games are winnable), or 3 draws (more difficult challenge). </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>In this solitaire, you can customize the backdrop of the cards and the background.</span></p>', '', 'Play one of the most famous card game: solitaire - and forget about time.', '<ul><li>Click / Tap on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (348, 2, 'Solitaire Classic', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (349, 1, 'Love Tester 3', '<p><span style="color: rgb(0, 0, 0);">How compatible are you with your crush? Based on names, this game calculates your compatibility. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Try it out for yourself - Love Tester 3D.</span></p><p><br></p><h3>Alert</h3><p><br></p><p>This is only for fun. It doesn''t have any meaning beyond having fun.</p>', '', 'How compatible are you with your crush?', '<ul><li>Write your name and that of your crush to see how compatible you are.</li></ul>', '');
INSERT INTO public.game_texts VALUES (349, 2, 'Love Tester 3', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (350, 1, 'Jewels Blitz 4', '<p><span style="color: rgb(0, 0, 0);">Jewels Blitz 4, the long-awaited fourth installment of the legendary Match 3 puzzle series, takes you deep into the jungles of Central America. Meet Maya, the young Mayan princess, and help her find her people''s lost treasures. Combine the colorful gems and use their secretive powers to remove jungle obstacles or magical seals, soothe volcanoes, and secure Mayan relics. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Go treasure hunting and complete daily missions and challenges to earn gold, magical items, and other rewards that will help you solve the more than 600 levels. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Immerse yourself in the mysterious world of the Maya and play Jewels Blitz 4 now for free. Many hours of puzzle fun are guaranteed!</span></p><h3><br></h3><h3>Instruction</h3><p><br></p><p><span style="color: rgb(0, 0, 0);">Match at least 3 of these precious jewels and get full stars. If you match more than 4, you can enjoy various boosters and power-ups to help you out. All you need is to swap with touch controls or your mouse.</span></p>', '', 'Match at least 3 of the precious jewels and win the levels.', '<ul><li>Match at least 3 of the jewels to make them disappear.</li></ul>', '');
INSERT INTO public.game_texts VALUES (350, 2, 'Jewels Blitz 4', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (435, 1, 'Lazy Jumper', '<p><span style="color: rgb(0, 0, 0);">Lazy Jumper is an arcade game to make the lazy guy jump around and enter the swimming pool. Destroy everything in front of your way in a satisfying way with cool and nice design and effects to get stars.</span></p>', '', 'Make the lazy guy jump around and arrive to the swimming pool. ', '<ul><li>Spacebar / Left Click - to jump.</li></ul>', '');
INSERT INTO public.game_texts VALUES (435, 2, 'Lazy Jumper', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (334, 1, 'Bubble Game 3', '<p>A classic bubble shooter game for everyone who needs a bit of challenge or to fill out their time.</p><p><br></p><p>The objective is to try to clear as many bubbles as you can, without them crossing the bottom line.</p><p><br></p><p>Match colors together for bubbles to disappear. Aim with your mouse, and click when you are ready to shoot.</p><p><br></p><p>Good luck!</p>', '', ' Clear as many bubbles as you can without them crossing the bottom line.', '<ul><li><span style="color: rgb(0, 0, 0);">Use your mouse - to aim. </span></li><li><span style="color: rgb(0, 0, 0);">Click - to shoot.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (540, 2, 'RSLocator - Easy', '', 'osrs geoguessr runescape old school runescape rune scape', '', '', '');
INSERT INTO public.game_texts VALUES (540, 1, 'RSLocator - Easy', '<p>How many locations in the world of Gielinor do you know? Test your RuneScape game-knowledge and pinpoint all the locations on the map in a game of RSLocator.</p>', 'osrs geoguessr runescape old school runescape rune scape geo guessing guesser geoguesser', 'Guess the locations of Old School Runescape (easy mode)', '<h1><strong>PLAY IN FULLSCREEN!</strong></h1><ul><li>Drag and click with touch or mouse</li></ul>', '');
INSERT INTO public.game_texts VALUES (541, 1, 'RSLocator - Hard', '<p>How many locations in the world of Gielinor do you know? Test your RuneScape game-knowledge and pinpoint all the locations on the map in a game of RSLocator.</p>', 'osrs geoguessr runescape old school runescape rune scape geo guessing guesser geoguesser', 'Guess the locations of Old School Runescape (hard mode)', '<h1><strong>PLAY IN FULLSCREEN!</strong></h1><ul><li>Drag and click with touch or mouse</li></ul>', '');
INSERT INTO public.game_texts VALUES (541, 2, 'RSLocator - Hard', '', 'osrs geoguessr runescape old school runescape rune scape', '', '', '');
INSERT INTO public.game_texts VALUES (351, 1, 'Galaxy Warriors', '<p>Watch out for enemies shooting back and strong Bosses! Hordes of enemies can also be handled with various boosters at your disposal. Dodge the bullet hell and shoot ''em up!"</p><p><br></p><p>Shoot down all enemy ships in each wave while evading their shots. Enemies have various behaviors and also drop some credits and boosters. Use credits to upgrade your ships.</p><p><br></p><p>Tons of upgrades to be unlocked that will make levels easier and super satysfing.</p>', '', 'Shoot down all enemy ships in each wave while evading their shots.', '<ul><li>Tap and drag left and right to move your spaceship</li><li>Avoid projectiles and enemies</li></ul>', '');
INSERT INTO public.game_texts VALUES (351, 2, 'Galaxy Warriors', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (353, 1, 'Uphill Rush 10', '<p><span style="color: rgb(0, 0, 0);">Uphill Rush 10 takes you all across New York City in 20 exhilarating levels. Your first vehicle will be the iconic yellow cab, but there will be 38 other vehicles for you to unlock. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Race through NYC on a skateboard, scooter, motor, horse, hovercraft, and more! Not sure what to wear? We got you covered! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>There are 66 different outfits to choose from! Make sure to upgrade your vehicles to set the quickest times in each level. The faster you go, the more likely you win those 3 stars!</span></p>', '', 'Race through NYC and be quick to get the best scores.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️ - to move.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️ - to accelerate.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (353, 2, 'Uphill Rush 10', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (354, 2, 'Stupid Zombies', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (355, 2, 'SuperHero.io 2 Chaos Giant', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (356, 2, 'Count Master', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (356, 1, 'Count Master', '<p><span style="color: rgb(0, 0, 0);">Try your counting skills! Count Master is a dynamic runner game, where in you are the leader of a crowd of stickmen. Collect and gather your clash gang, lead, and win!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Be smart and make quick decisions about how much you want your group of stickmen to get bigger. If you have fewer stickmen than the opponent, you die.</span></p>', '', 'Lead your stickmen, grow the group to win against opponents.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️/Drag - to move left and right.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (357, 1, 'BFFs Fresh Spring Look', '<p><span style="color: rgb(0, 0, 0);">Welcome to the BFF''s Fresh Spring Look. BFFs have some plans for welcoming their favorite season spring. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">They already filled their cupboard with new spring fashion. But they have a dilemma is to choose the best outfits. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Browse the wardrobe and pick the suitable outfits for each one.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play make-up games on Vedia Games!</span></p>', '', 'Dress the girls for the season spring. Choose the best outfits for them.', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (357, 2, 'BFFs Fresh Spring Look', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (354, 1, 'Stupid Zombies', '<p>Those stupid zombies are back, and you are humanity''s last hope to keep them brainless. But beware, ammo is limited so you will have to get crafty and use the straight bullets, grenades, split- and buckshots in the most effective way possible to survive the 60 levels.</p><p>One man, one shotgun, and lots of stupid zombies.</p><p><br></p><h3><strong>Features:</strong></h3><ul><li>Kill Different Kinds Of Monsters</li><li>Experience The Sensation Of Firing Bullets Wildly</li><li>Multiple Powerful Guns &amp; Weapons</li><li>200 Levels Of Fun (More Levels Coming Soon)</li><li>Awesome Blood &amp; Gore Animations</li><li>Realistic &amp; Fun Blood Sounds</li></ul>', '', 'The zombies are back, and you are humanity''s last hope.', '<ul><li>Touch our left mouse click to interact with UI and to shoot</li></ul>', '');
INSERT INTO public.game_texts VALUES (355, 1, 'SuperHero.io 2 Chaos Giant', '<p><span style="color: rgb(0, 0, 0);">The sequel to the globally popular Superheroes game with a new UI design, new gameplay, and four times map size! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">SuperHero.io 2 Chaos Giant is a thrilling online superhero game. This time you can by occupying the enemy''s weapon make battlefield chaos. </span></p><p><br></p><p>Kill or be killed! Anyone can kill you, even if they are at a lower level. Always watch out.</p><p><br></p><p><span style="color: rgb(0, 0, 0);">Use your favorite heroes to collect EXP points to level up, or you can be a giant or invincible by pickup the skill items. Daily bouns and daily tasks will help you manage heroes easily.</span></p><p><br></p><h3>Key features</h3><p><br></p><p><br></p><p><span style="color: rgb(0, 0, 0);">1. The game is available in 16 languages. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">2. 30 famous superheroes and all heroes can be used in games starting by watching videos or collecting by tasks or luck spin. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">3. Level up will increase the character''s size. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">4. Hero will drop his weapon, and another hero can pick them up by colliding it. (Like Captain America wielding Mjolnir). </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">5. New passive skill "Attack Area": the hero can do a big swing by leveling up. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">6. New map element items, like "Speed Up", "Invincible", or "Grow Up". </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">7. The new seven-day reward system, new luck spin, and new task system. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>8. More new features are waiting for you!</span></p><p><br></p><p>Play SuperHero.io 2 Chaos Giant on Vedia Games!</p>', '', '', '<ul><li>Direct your mouse in the way you want your character to go - to move.</li><li>Click left - to attack.</li></ul>', '');
INSERT INTO public.game_texts VALUES (361, 1, 'Lines', '<p><span style="color: rgb(0, 0, 0);">Lines is an abstract ‘zen’ game experience where the form is just as important as function. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Place or remove dots to initiate a colorful race that fills a drawing. The color that dominates the race wins. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Lines is the perfect game to play while commuting or in other short moments of downtime. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play a single session in a matter of seconds or find yourself making a winning streak of 20 games in a row!</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Key Features</span></h3><p><span style="color: rgb(0, 0, 0);">Lines – Physics Drawing Puzzle''s key features include: </span></p><p><span style="color: rgb(0, 0, 0);">- 6 different modes: Point, Erase, Cut, Draw, Portal, and Mix</span></p><p><span style="color: rgb(0, 0, 0);">- Daily Challenges - 26 achievements to unlock </span></p><p><span style="color: rgb(0, 0, 0);">-500 smart levels </span></p><p><span style="color: rgb(0, 0, 0);">- Use your brain and logic to find the solutions </span></p><p><span style="color: rgb(0, 0, 0);">- Bronze, Silver, and Gold medals for each level. </span></p><p><span style="color: rgb(0, 0, 0);">- Infinite fun! Point Mode Tap on a line to place a dot. Be smart and choose and strategic and logical position for the dots. Sometimes you need to place one dot, other times two dots. </span></p><p><span style="color: rgb(0, 0, 0);">-Eraser Mode: Tap on an opponent´s dot to erase it. </span></p><p><span style="color: rgb(0, 0, 0);">- Draw Mode: Draw a line with your fingers to connect lines to your advantage. Use your brain! </span></p><p><span style="color: rgb(0, 0, 0);">- Cut Mode Cut: a line to stop the flow of your opponent´s color. </span></p><p><span style="color: rgb(0, 0, 0);">- Portal mode: Tap the line across 2 places to create a portal. Your line will be teleported from one place to the other. But beware: your opponents can also make use of the portal you have created, so choose its location wisely!</span></p><p><br></p><p><br></p><h3>How to play</h3><p><span style="color: rgb(0, 0, 0);">Click anywhere on the lines to place a dot. Be smart and strategic when placing the dot. Remember, the longest line at the end wins.</span></p>', '', 'Strategically place the dot, so it ends up as the longest line and wins.', '<ul><li><span style="color: rgb(0, 0, 0);">Click anywhere on the lines to place a dot. </span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Be smart and strategic when placing the dot. Remember, the longest line at the end wins.</span></p>', '');
INSERT INTO public.game_texts VALUES (361, 2, 'Lines', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (362, 2, 'Millionaire Trivia Quiz', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (363, 2, 'Towerland', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (364, 2, 'Line Bright', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (377, 1, 'Super Yacht Parking', '<p><span style="color: rgb(0, 0, 0);">Drive these luxuries on water and safely dock it to its designated port. Play, Super Yacht Parking and steer these awesome boats. Avoid all the obstacles and other yachts. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">If you got your yacht hit so many times then it will be game over for you. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Unlock all the achievements and finish all the levels to get the highest points possible, earning your way up to the leaderboard!</span></p>', '', 'Drive a luxurious yacht and safely dock it to its port.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (377, 2, 'Super Yacht Parking', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (378, 2, 'Bon Voyage', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (365, 1, 'Police Car Simulator 2020', '<p><span style="color: rgb(0, 0, 0);">This crazy new “Police Car Simulator 2020” brings some action into your life. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Be a Cop in this Police Car Simulator 2020 and protect your city. We have added 9 super police cars for you and you can choose them according to your driving style. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Drive as fast as you can on wide roads as well as in the Countryside, and enjoy. Do your best. </span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Key Features</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">- Realistic driving simulator </span></p><p><span style="color: rgb(0, 0, 0);">- Realistic physics </span></p><p><span style="color: rgb(0, 0, 0);">- High-quality police vehicles</span></p><p><span style="color: rgb(0, 0, 0);">- Easy to play driving controls! </span></p><p><span style="color: rgb(0, 0, 0);">- 2 Maps to choose from</span></p>', '', 'Be a cop and drive through your city to protect it!', '<ul><li><span style="color: rgb(0, 0, 0);">W – to Accelerate, </span></li><li><span style="color: rgb(0, 0, 0);">S – to Brake, </span></li><li><span style="color: rgb(0, 0, 0);">A – to Steer Left, </span></li><li><span style="color: rgb(0, 0, 0);">D – to Steer Right </span></li><li><span style="color: rgb(0, 0, 0);">C – to Change the Camera, </span></li><li><span style="color: rgb(0, 0, 0);">R – to Reset </span></li><li><span style="color: rgb(0, 0, 0);">Space – Handbrake, </span></li><li><span style="color: rgb(0, 0, 0);">Shift – Nitro</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (365, 2, 'Police Car Simulator 2020', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (366, 1, '2D Dark Racing', '<p>Play the addicting 2D Dark Racing game.</p><p><br></p><p><span style="color: rgb(0, 0, 0);">Turn on your motor and your lights and race in the dark places, and win ahead of all comers. Contend with quick racers getting around slopes and dim snags. Gather gas to remain in the game and make back and front flips to bring in cash and purchase updates.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Another fun driving game is </span><a href="https://vediagames.com/game/moto-x3m-original" rel="noopener noreferrer" target="_blank" style="color: rgb(0, 0, 0);">Moto X3M</a><span style="color: rgb(0, 0, 0);">, check it out!</span></p>', '', 'Turn your motor, race in the dark and win against the opponents.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span><span style="color: rgb(0, 0, 0);"> - to Drive, </span></li><li><span style="color: rgb(0, 0, 0);">Shift - Nitro </span></li><li><span style="color: rgb(0, 0, 0);">SPACE - to Jump.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (366, 2, '2D Dark Racing', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (363, 1, 'Towerland', '<p><span style="color: rgb(0, 0, 0);">Towerland is a top-down shooter with game mechanics inspired by the famous Binding of Isaac. </span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Features: </span></h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Dozen of monsters </span></li><li><span style="color: rgb(0, 0, 0);">Unlockable Powerups</span></li><li><span style="color: rgb(0, 0, 0);">3 Different game modes </span></li><li><span style="color: rgb(0, 0, 0);">3 Bosses</span></li></ul>', '', 'Shoot all the monsters to get through the level.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬅️⬆️➡️⬇️ -</span><span style="color: rgb(0, 0, 0);"> to shoot.</span></li><li><span style="color: rgb(0, 0, 0);">P - to pause the game. </span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">To start playing the first level go up through the first staircase.</span></p>', '');
INSERT INTO public.game_texts VALUES (364, 1, 'Line Bright', '<p><span style="color: rgb(0, 0, 0);">Linebright is an HTML5 game where you have to solve an elegant puzzle game set in a world of lines. Solve different interesting and mind-blowing levels and increase your IQ.</span></p>', '', 'Move the line and solve the puzzle by getting to the end point.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move the line </span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">Move the line and get to the "end point" to finish each level. Avoid obstacles. On some levels, you will need to collect the crystal to win.</span></p>', '');
INSERT INTO public.game_texts VALUES (522, 1, 'Toy Car Jigsaw', '<p><span style="color: rgb(0, 0, 0);">Toy Car Jigsaw is a fun online puzzle game. Drag the pieces into the right position using the mouse. Solving puzzles is relaxing, rewarding, and keeps your brain sharp. You need to spend $1000 to be able to purchase one of the following pictures. You have three modes for each picture from which the hardest mode brings more money. You have a total of 10 pictures.</span></p>', '', 'Fun online puzzle game. Drag the pieces into the right position.', '<ul><li>Use your mouse to drag the pieces into a picture.</li></ul>', '');
INSERT INTO public.game_texts VALUES (522, 2, 'Toy Car Jigsaw', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (542, 1, 'RSLocator - F2P', '<p>How many locations in the world of Gielinor do you know? Test your RuneScape game-knowledge and pinpoint all the locations on the map in a game of RSLocator.</p>', 'osrs geoguessr runescape old school runescape rune scape geo guessing guesser geoguesser', 'Guess the locations of Old School Runescape (f2p mode)', '<h1><strong>PLAY IN FULLSCREEN!</strong></h1><ul><li>Drag and click with touch or mouse</li></ul>', '');
INSERT INTO public.game_texts VALUES (542, 2, 'RSLocator - F2P', '', 'osrs geoguessr runescape old school runescape rune scape', '', '', '');
INSERT INTO public.game_texts VALUES (367, 1, 'Gun Guys', '<p><span style="color: rgb(0, 0, 0);">The bad guys are back again! Use your gun, brains, and logic to defeat them all! </span></p><p><span style="color: rgb(0, 0, 0);">Take down enemies with a single bullet to get the max reward and unlock new dangerous missions. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Prove you’re the best hit master! </span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">TOUGH PUZZLES </span></h3><h3><br></h3><p><span style="color: rgb(0, 0, 0);">Can you beat every level with three stars? Use the objects around you and different weapons to combat the bad guys and save hostages. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The further you go, the harder the next brainteaser is! Tons of new challenges coming soon.</span></p><p><br></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">ULTIMATE WARRIORS </span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">Rembo, ninja, and other seasoned heroes are ready to take down the bad guys. Unlock every member of the Gun Guys crew! </span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">DEADLY WEAPONS </span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">Think with your head and use different weapons for different tasks. Shoot bullets or launch grenades that ricochet, bounce or fly straight. Don’t forget to collect all the awesome weapon skins for more stylish combos!</span></p>', '', 'Defeat your enemies by shooting strategically.', '<ul><li>Click where you want to shoot.</li></ul><p><br></p><p>Plan your shooting strategically so you kill all of your enemies in the end.</p>', '');
INSERT INTO public.game_texts VALUES (367, 2, 'Gun Guys', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (368, 1, 'Drink Master', '<p><span style="color: rgb(0, 0, 0);">Have you always dreamt of working as a bartender? Do you consider perfectly poured cocktails and drinks to be your life goal? Do you always pour beer perfectly into a glass? Then Drink Master is the game for you! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Pour the liquor and show everyone that you can create the perfect cocktail! Don''t forget to add an ice cube.</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Key Features</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">The game developers have prepared a lot of levels, and in each of them you will mix great cocktails, and their level of difficulty will be constantly increasing! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The right mix of beverages poured from colorful bottles with ice cubes will make you a real drink master (and not just some common bartender).</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">How to play</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">This extremely simple game (yet addictive!) allows you to mix different colored drinks into extremely refreshing compositions! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Give your fantasy free rein – mixing beer with beer? No problem! </span></p><p><br></p><p><strong style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Your task is to mix drinks perfectly, up to the set limit!</strong></p>', '', 'Pour and mix drinks perfectly, to get the best scores. Addictive.', '<ul><li>Click and hold to pour a drink.</li></ul>', '');
INSERT INTO public.game_texts VALUES (368, 2, 'Drink Master', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (369, 2, 'Pony Friendship', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (370, 1, 'Cycle Sprint', '<p>The game Cycle Sprint is now available on Vedia Games.</p><p><br></p><p>Customize your cyclist and perfect your bike for a thrilling adventure! Compete in Italy, France, and Spain. Win all 63 races and earn your spot on the podium of champions!</p><p><br></p><p>With easy controls, do your best to win the race.</p>', '', 'Customize your cyclist and perfect your bike for a thrilling adventure!', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️⬇️ - to move between lanes.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">Spacebar - Nitro (quicker cycling).</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (370, 2, 'Cycle Sprint', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (371, 2, 'Football Superstars 2022', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (372, 1, 'Football Killer', '<p><span style="color: rgb(0, 0, 0);">Have you ever dreamed of being a professional footballer? Do you realize, that in reality, it''s a deadly game? The other footballers, referees, and goalkeepers are just there to make you suffer! Because they know about your past. And they are scared. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Cool different levels are waiting for you to play – you can show the strength of your shot. But not the referee – he is untouchable… Clever guy… </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Graphics and music will take you to the big football stadium! Take part in this football adventure now!</span></p>', '', 'Aim the ball strategically to kill all of the opponents.', '<ul><li><span style="color: rgb(0, 0, 0);">Click and hold in the direction you want to shoot, then release.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (372, 2, 'Football Killer', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (373, 1, 'Penalty Champs 21', '<p><span style="color: rgb(0, 0, 0);">Choose your favorite European national football team and try out this great penalty shootout game. Switch between trying to score, adjusting your aim and power, and goalkeeping. Can you win the championship in a penalty shootout? Good luck!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">When shooting, adjust the position, height, and strength of the shot. When goalkeeping, tap on the target that will appear shortly before the opponent makes a shot.</span></p>', '', 'Choose your favorite European team and win the championship.', '<ul><li>Click.</li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">When shooting, adjust the position, height, and strength of the shot. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">When goalkeeping, tap on the target that will appear shortly before the opponent makes a shot.</span></p>', '');
INSERT INTO public.game_texts VALUES (373, 2, 'Penalty Champs 21', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (374, 1, 'Buggy Wuggy Platformer Playtime', '<p><span style="color: rgb(0, 0, 0);">Welcome to Buggy Wuggy - Platformer! Take a deep breath and dive into a dark scary world with Buggy Wuggy and Poppy the kid, an all-new free game! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Try challenging and scary horror platformer levels with unique monsters as you pass horror levels to survive. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Run as fast as you can, open doors, don''t get caught by buggy wuggy, and pass all levels and biomes. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Hey, your buggy wuggy is waiting for you, so enjoy this amazing scary game named Buggy Wuggy - Platformer Playtime!</span></p><p><br></p><p><br></p><p><span style="color: rgb(0, 0, 0);">● Scary platformer: don''t get caught by buggy wuggy! </span></p><p><span style="color: rgb(0, 0, 0);">● Play a lot of challenging horror levels in 4 biomes </span></p><p><span style="color: rgb(0, 0, 0);">● Explore this dark world with Poppy the kid</span></p>', '', 'Dive into a dark scary world with Buggy Wuggy and Poppy the kid.', '<p>Don''t get caught by the buggy wuggy!</p><ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬅️➡️ - to move.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️ - to jump.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (374, 2, 'Buggy Wuggy Platformer Playtime', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (375, 1, 'Hawaii Match 3', '<p><span style="color: rgb(0, 0, 0);">This beautiful Match 3 Game takes you on a journey through the beautiful nature of Hawaii. Combine and collect exotic fruits and flowers in over 2000+ Exciting Levels! Complete the Daily Missions and Daily Challenges to earn additional coins and other gifts!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The more flowers, fruits, and other items of the same kind you combine with one match, the stronger the power-ups you get in return! Go on an adventure through the beautiful nature of Hawaii. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Help your host remove stones and other obstacles, to collect fruit or go treasure hunting. Beware anyone who tries to stop you on your journey! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Enjoy this beautiful Match 3 Game with 2000+ challenging levels!</span></p>', '', 'Combine and collect exotic fruits and flowers in over 2000 Exciting Levels!', '<ul><li>Match 3 or more of the same fruits.</li></ul>', '');
INSERT INTO public.game_texts VALUES (375, 2, 'Hawaii Match 3', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (376, 1, 'Mr Noob Vs Zombies', '<p><span style="color: rgb(0, 0, 0);">Mr. Noob - Lucky Block story is an official Noob vs Pro vs Hacker-style shooter game on mobile. Help Mr. Noob to kill 1000 zombies and open all Lucky Blocks to get new skins of Noob.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">If you are playing from a phone, just tap the screen to shoot. If you are playing from a PC, then click on the screen to shoot.</span></p>', '', 'Kill zombies by shooting strategically.', '<ul><li>Click/Tap to shoot.</li></ul>', '');
INSERT INTO public.game_texts VALUES (376, 2, 'Mr Noob Vs Zombies', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (379, 1, 'Angry Sharks', '<p><span style="color: rgb(0, 0, 0);">The shark has been exposed to radiation and is now mutated. He floats in the sea and eats fish. The more he eats, the more he grows. People are afraid of him and they are trying to destroy him. Try to survive their attacks.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Control the shark with the mouse cursor or by moving your finger on the screen. Fishes swim against you, eat them to grow. Avoid bigger fishes and spiky fishes. Watch out for dangerous barrels, mines, spears, and other obstacles. You will pass the level if you grow to the desired size.</span></p>', '', 'Grow and grow as you eat fish from the sea. Survive attacks.', '<ul><li>Move your mouse around to move.</li><li>Click on the fish to eat them.</li></ul>', '');
INSERT INTO public.game_texts VALUES (379, 2, 'Angry Sharks', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (378, 1, 'Bon Voyage', '<p><span style="color: rgb(0, 0, 0);">Bon Voyage is a new match-3 puzzle game. Play now &amp; try to beat 500+ challenging levels in Paris, Egypt, Rome, and many other countries! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Discover mind-blowing facts about places you visit, win trophies for your own traveler''s collection, and take pictures in every country.</span></p>', '', 'Try to beat 500+ levels in Paris, Egypt, Rome, and many others! ', '<ul><li><span style="color: rgb(0, 0, 0);">Click and swipe to match 3 or more items.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (191, 1, 'Moto X3M Winter', '<p>Welcome to the winter special of this awesome bike stunt game, Moto X3M 4: Winter.</p><p><br></p><p>Drive your two-wheeler through challenging tracks full of deadly traps, ramps, explosives, and obstacles, and try to get to the finish line alive.</p><p><br></p><p>Complete every level as fast as you can to earn 3 stars, which you can use to unlock new riders.</p><p><br></p><p>Perform front or backflips for extra seconds and try to finish all levels with 3 stars to name yourself a professional X3M rider.</p><p><br></p><p>Have fun with Moto X3M 4: Winter!</p>', '', 'Drive your two-wheeler through challenging tracks full of deadly traps.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span> = to drive / balance.</li><li>Spacebar = to respawn at the last checkpoint.</li></ul>', '');
INSERT INTO public.game_texts VALUES (380, 2, 'Princess Villains', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (381, 2, 'Pixel Smash Duel', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (382, 1, 'Coffee Stack', '<p><span style="color: rgb(0, 0, 0);">Here is a collecting arcade game called Coffee Stack. On the conveyor belt platform track, it is managed for you to collect as many coffee materials as you can including dixie cups, cup sets, and green coffee liquid. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>If possible, you need to avoid losing cups from traps and free hands. Good luck!</span></p>', '', 'collect as many coffee materials as you can including dixie cups & cup sets', '<ul><li><span style="color: rgb(0, 0, 0);">Drag to move left and right.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (382, 2, 'Coffee Stack', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (383, 1, 'Color Pop 3D', '<p><span style="color: rgb(0, 0, 0);">Paint the whole circle by dodging steel plates in the way and completing as many levels as you can. Show your awesome skills in this satisfying color hypercasual game. Are you ready to prove your skills?</span></p>', '', 'Paint the whole circle by dodging steel plates. Really addicting!', '<ul><li><span style="color: rgb(0, 0, 0);">Tap On Screen/Press Space and Hold - to shoot.</span></li><li><span style="color: rgb(0, 0, 0);">Release Hold - to stop shooting.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (383, 2, 'Color Pop 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (386, 1, 'Match Adventure', '<p><span style="color: rgb(0, 0, 0);">Meet the colorful and fun match-3 game - start your exciting journey together with Gemmy the squirrel! One day, waking up, the inhabitants of the forest found that at night someone has destroyed the entire forest edge, and now it is in desolation. But what''s even worse - the brother of Gemmy the squirrel, Johnny, has disappeared. Help a small but brave squirrel to find her brother! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The path will not be easy – you, along with Gemmy, need to talk to all the forest inhabitants, restore the events of last night and go on an adventure to other worlds. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You, Gemmy, and her friends will travel from one world to another, learn new details about the mysterious disappearance of her brother and other characters and get acquainted with the inhabitants of other worlds.</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Key Features</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">To restore the destroyed edge and the forest world, you need to clear the territory, re-erect all the buildings and decorations and explore them. Complete the Match-3 levels and earn coins for construction. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">As you progress through the levels, Gemmy will communicate with various characters, and reveal the secret of what happened. After completing some levels, Gemmy and the travelers will receive a reputation and reward, as well as a part of a secret mechanism that will help them get to the next world. Buy new decorations in the store for coins and increase the reputation of the world! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Do not forget to clear the territory to make room for new buildings. To do this, you will need nuts. And to speed up the process - use diamonds!</span></p>', '', 'Complete the Match-3 levels and earn coins for construction of the forest.', '<ul><li>Match 3 or more items and fulfill goals to clear the levels and earn coins.</li></ul>', '');
INSERT INTO public.game_texts VALUES (381, 1, 'Pixel Smash Duel', '<p><span style="color: rgb(0, 0, 0);">Pixel Smash Duel is a chaotic 2 player retro-pixel battle game. Control your character with 2 buttons against your friend or against the CPU and continue the fight. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿Stay on the platform and push the opponent down with weapons. The player who first reaches 5 wins the game.</span></p>', '', 'Stay on the platform and push the opponent down with weapons.', '<p><span style="color: rgb(0, 0, 0);">The goal of this game is to shoot your opponent off the platform.</span></p><p><br></p><ul><li>W - to jump.</li><li>E - to shoot.</li></ul>', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️ - to jump.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">M - to shoot.</span></li></ul>');
INSERT INTO public.game_texts VALUES (384, 2, 'I''m not a Monster: Wanna Live', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (385, 1, 'Healing Rush', '<p><span style="color: rgb(0, 0, 0);">Welcome to Healing Rush! In Healing Rush you play a doctor in a new hospital. Citizens have fallen ill with strange diseases, let''s get down to healing them! Only you can help – build the greatest hospital in town and save all the patients! Your patients have many complex and strange diseases. Hurry up and use the right medicine to heal them in this simple and very addicting action game!</span></p>', '', 'Quickly heal the ill citizens in the new hospital. Addicting!', '<ul><li>Click to collect items.</li><li>Hold the click and direct it in the direction you want - to walk.</li></ul>', '');
INSERT INTO public.game_texts VALUES (385, 2, 'Healing Rush', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (386, 2, 'Match Adventure', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (388, 1, 'Jetpack Joyride', '<p><span style="color: rgb(0, 0, 0);">Bullet-powered jetpacks! Giant mechanical! From the makers of Fruit Ninja comes this insane, high-flying endless runner that will keep you on the edge of your seat! It''s time to join Barry Steakfries and equip cool jetpacks, suit up in stylish costumes and ride crazy vehicles in his endless running quest to beat the scientists to the end of the lab.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play Jetpack Joyride on Vedia Games!</span></p>', '', 'Collect tons of coins as you fly around with your bullet-powered jetpacks!', '<ul><li>Click to fly. </li><li>Avoid obstacles.</li></ul>', '');
INSERT INTO public.game_texts VALUES (388, 2, 'Jetpack Joyride', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (390, 1, 'Eliatopia', '<p><span style="color: rgb(0, 0, 0);">Explore the new planet of Eliatopia, as you (a human from Earth) set off to explore the newly discovered planet inhabited by aliens. Play with your friends, or make new ones and explore the planet together. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Fight monsters and even other players in PVP-enabled areas. Progress your character through a huge collection of weapons and armor, skills, and ability points. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">What dark secrets do Eliatopia and its government hold? And what about its correlations to Earth? Find out now!</span></p><p><br></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Massively multiplayer: play with people all over the world. Over hundreds of equipment to choose from. Huge world to explore full of enemies and friends to meet along the way. Tons of skills and customizations to make your character different from others.</span></p>', '', 'Explore the new planet! Fight monsters, progress your character.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD or </span><span style="color: rgb(0, 0, 0); background-color: rgb(22, 35, 80);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span><span style="color: rgb(0, 0, 0);"> - to move. </span></li><li><span style="color: rgb(0, 0, 0);">C - to attack. </span></li><li><span style="color: rgb(0, 0, 0);">E - to pick up items </span></li><li><span style="color: rgb(0, 0, 0);">Mouse - to aim.</span></li><li>V - to talk.</li></ul>', '');
INSERT INTO public.game_texts VALUES (390, 2, 'Eliatopia', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (391, 1, 'Lady Strange and Ruby Witch', '<p><span style="color: rgb(0, 0, 0);">The multiverse is infinite and diverse. In one of the endless worlds, Lady Strange and the Ruby Witch are serving. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Together they protect this world from the forces of evil. However, real superheroines never forget about style. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Choose cool and original costumes for the girls that will emphasize their individuality. Complete the look with bright makeup, hair, and accessories. Go on an unforgettable adventure with Lady Strange and the Ruby Witch.</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Instruction</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">Create a real superhero comic book heroine from an ordinary girl. Choose the right makeup and hairstyle; from what you can find in the wardrobe, make a bright superhero costume; complement the image with unusual accessories.</span></p>', '', 'Create a real superhero comic book heroine from an ordinary girl.', '<ul><li>Click to choose items you want to wear.</li></ul>', '');
INSERT INTO public.game_texts VALUES (391, 2, 'Lady Strange and Ruby Witch', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (392, 2, 'Beautician Princess', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (392, 1, 'Beautician Princess', '<p><span style="color: rgb(0, 0, 0);">Modern technologies and materials make our lives better. Test yourself as a beautician. Help our beautiful princess to become even more beautiful. Get rid of dark circles under the eyes with hyaluronic acid. Straighten brow line. Make a tattoo of arrows near the eyes. In addition, make your lips a little bigger. Complete the look with light makeup and accessories!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">In this game, together with the main character of the game, you will get to know the most popular cosmetic procedures closely. And our artist, who drew the game, will help you with this, who has tested all these procedures on herself... Depending on the gaming device, a computer mouse click or a simple touch on touch screens is used for control.</span></p>', '', 'Test yourself as a beautician. Help the princess take care of herself.', '<ul><li>Follow the instructions within the game.</li></ul>', '');
INSERT INTO public.game_texts VALUES (393, 1, 'Real Bus Simulator', '<p><span style="color: rgb(0, 0, 0);">Here is a bus driving simulation game for you to train your parking and stunt driving skills with 3D modern game art animations. You are able to earn gold coins by transporting the passengers to the stations and completing the current level. Keep calm and drive stably!</span></p>', '', 'Transport passengers, park at the right time and earn gold!', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (393, 2, 'Real Bus Simulator', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (394, 1, 'Room Escape 3D', '<p><span style="color: rgb(0, 0, 0);">Room Escape 3D is an interesting puzzle online game for free. You need to use some ways to avoid the guards, and don''t let them find you. Try to outwit the enemy! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>You can test your logical thinking ability in this one of the best 3D prison games. All kinds of cool action tasks and puzzles are waiting for you! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The overall operation of the game is not difficult, but you need to be bold, careful, and flexible to play this game well!</span></p>', '', 'Flee the room when the guard is not watching!', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (394, 2, 'Room Escape 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (395, 1, 'Whooo', '<p><span style="color: rgb(0, 0, 0);">Whooo? is a casual puzzle online game for everyone. You can guess in the game through the given tips. If you guess the character successfully in the shortest time, you will win. Guess according to the characteristics of each people. There are also more character cards waiting for you to unlock. So, why not try it now? Enjoy yourself!</span></p>', '', 'Ask the right questions to guess the character as quickly as you can.', '<ul><li>Click on the questions and answers you want to ask or give.</li></ul>', '');
INSERT INTO public.game_texts VALUES (395, 2, 'Whooo', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (530, 1, 'Ricochet Arrow', '<p><span style="color: rgb(0, 0, 0);">Pick up your bow! Kill dangerous skeletons in 50 different levels. Aim before launching your arrow. You have unlimited arrows, but be smart and don’t shoot yourself an arrow. Let''s start destroying the skeletons!</span></p>', '', 'Pick up your bow! Kill dangerous skeletons in 50 different levels.', '<ul><li>Click to shoot.</li></ul>', '');
INSERT INTO public.game_texts VALUES (389, 2, 'Parkour Block 2', '', 'Vedia Games ofrece el mejor juego Parkour Block 2 en línea de forma gratuita. ¡Despeja los bloques saltando sobre ellos y usando tu entorno a tu favor! No se necesita instalación ni descargas, ¡disfrútalo!', '', '', '');
INSERT INTO public.game_texts VALUES (530, 2, 'Ricochet Arrow', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (543, 1, 'RSLocator - RS3', '<p>How many locations in the world of Gielinor do you know? Test your RuneScape game-knowledge and pinpoint all the locations on the map in a game of RSLocator.</p>', 'osrs geoguessr runescape old school runescape rune scape geo guessing guesser geoguesser', 'Guess the locations of RuneScape (RS3 version)', '<h1><strong>PLAY IN FULLSCREEN!</strong></h1><ul><li>Drag and click with touch or mouse</li></ul>', '');
INSERT INTO public.game_texts VALUES (396, 1, 'Shape Shift Run', '<p><span style="color: rgb(0, 0, 0);">Shape Shift Run game is an interesting online game that uses fingers to control the graphic to transform its shape. The graphic in your hands has different elasticity, and you can change different shapes by clicking with your fingers. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>You need to adjust the shape in time according to the obstacles ahead and easily pass the customs by changing it into a matching graphic. All jelly shapes need to be completed in a very short time. Come and challenge it!</span></p>', '', 'Adjust the shape in time according to the obstacles ahead to survive.', '<ul><li>Click to change shapes.</li></ul>', '');
INSERT INTO public.game_texts VALUES (396, 2, 'Shape Shift Run', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (397, 1, 'Solitaire Seasons', '<p><span style="color: rgb(0, 0, 0);">You need to go through all 40 levels to open all four windows, each of which goes into its own season. Use jokers to simplify the process. In addition to the usual jokers in the game, there are jokers for each suit.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You have to draw cards one at a time from your stockpile. Select the cards that are one higher or one lower in value than your drawn card to remove them from the playing field. To complete a level you need to remove all the cards from the playing field without running out of cards from your stockpile.</span></p>', '', 'A nice game of solitaire, more than 40+ levels.', '<ul><li><span style="color: rgb(0, 0, 0);">Select the cards that are one higher or one lower in value than your drawn card to remove them from the playing field. </span></li></ul>', '');
INSERT INTO public.game_texts VALUES (397, 2, 'Solitaire Seasons', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (398, 1, 'Burger Mania', '<p>Burger Mania is a cooking game. Cook some juicy burgers! You will get orders for each day and will need to prepare the right burgers for your customers.</p><p><br></p><p>First, you finish training to learn to play, then will start cooking for real.</p>', '', 'Cook juicy burgers based on orders.', '<ul><li>Click on the ingredients to put them in the burger.</li></ul>', '');
INSERT INTO public.game_texts VALUES (398, 2, 'Burger Mania', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (399, 1, 'Funny Kitty Haircut', '<p><span style="color: rgb(0, 0, 0);">Have you ever dreamed of becoming the best hairdresser in your own hair salon? Help the kitties in this new haircut game! Run the best kitty salon and take care of your virtual kitties. Wash, color, and brush their hair, then create beautiful hairstyles. Don''t forget to dress up and accessorize them to become more fashionable!</span></p>', '', 'Run the best kitty salon and take care of your virtual kitties. ', '<ul><li>Follow the instructions within the game.</li></ul>', '');
INSERT INTO public.game_texts VALUES (399, 2, 'Funny Kitty Haircut', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (400, 1, 'Dental Care Game', '<p><span style="color: rgb(0, 0, 0);">Boys and girls welcome to the Dentist, Here you can not only turn yourself into a professional dentist but also diagnose and cure different patients, make it you''re dreaming one! In the game, patients are not models who just open their mouths with a poker face, they are so vivid with laughers and tears!</span></p>', '', 'Become a professional dentist and cure different patients.', '<ul><li>Use the tools to cure different tooth problems.</li></ul>', '');
INSERT INTO public.game_texts VALUES (400, 2, 'Dental Care Game', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (401, 1, 'Teeth Runner', '<p><span style="color: rgb(0, 0, 0);">As illness often finds its way in by the mouth, oral hygiene is of vital importance to everyone. Brushing the teeth on a daily basis could effectively keep the teeth healthy. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>If you stick to this fairly simple but hugely rewarding habit, people will surely be impressed by the pleasing freshness of your lips when speaking with you. Let this game be a delightful reminder!</span></p>', '', 'Brush teeth as you ran through the track.', '<ul><li>Click and hold at the right times.</li></ul>', '');
INSERT INTO public.game_texts VALUES (401, 2, 'Teeth Runner', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (412, 1, 'Mahjong Pirate Plunder Journey', '<p><span style="color: rgb(0, 0, 0);">Play this fun Mahjong in the Caribbean, where pirates quest for the pearl treasure. Your goal in this epic pirates mahjong is to collect as many stars as possible on every level to unlock other fun levels and backgrounds. You will earn 1 star if you finish the level, a second star if you do not use hints, and a third star if you finish the level in a limited time. You may also want to play the daily pirate''s mahjong challenge level to collect more stars, gold, and diamonds.</span></p>', '', 'Play this fun Mahjong in the Caribbean! collect as many stars as possible!', '<ul><li>Click/Tap.</li></ul>', '');
INSERT INTO public.game_texts VALUES (412, 2, 'Mahjong Pirate Plunder Journey', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (413, 1, 'Cat Chef and Broccoli', '<p><span style="color: rgb(0, 0, 0);">The cute broccoli needs to escape from the chef cat, he will catch it and make dinner. Help the broccoli to reach the fridge while the sweet chef cat chases the cute broccoli. Be careful, cookies are not your friend - they are the enemy. There are obstacles in your way too.be careful with obstacles such as salt shakers and graters.</span></p>', '', 'Run away from the chef to your final destination: the fridge! ', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️ - to jump.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">➡️ - to run away.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (413, 2, 'Cat Chef and Broccoli', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (414, 1, 'Robox', '<p><span style="color: rgb(0, 0, 0);">Robox is a puzzle platformer game where you control a robot to find the exit door. Help him to escape enemies and traps along the way. Jump, shoot the boxes using your teleportation gun and try to reach the door. Good luck!</span></p>', '', 'Get to the exit door by escaping traps and enemies on the way.', '<ul><li><span style="color: rgb(0, 0, 0);">A / </span><span style="color: rgb(0, 0, 0); background-color: rgb(22, 35, 80);">⬅️</span><span style="color: rgb(0, 0, 0);"> - to move left </span></li><li><span style="color: rgb(0, 0, 0);">D / </span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️</span><span style="color: rgb(0, 0, 0);"> - to move right. </span></li><li><span style="color: rgb(0, 0, 0);">W / Z = to jump.</span></li><li><span style="color: rgb(0, 0, 0);">E / J - to shoot. </span></li><li><span style="color: rgb(0, 0, 0);">R = to reset. </span></li><li><span style="color: rgb(0, 0, 0);">Esc / B = back</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (414, 2, 'Robox', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (415, 1, 'Driving Test Simulator', '<p><span style="color: rgb(0, 0, 0);">Here is a car parking simulation game under a 3D game engine. You are able to drive a car to the marked parking position without any crashing accidents at each level. There are enough levels for you to challenge your driving skills if you are a car racing game fan. Good luck!</span></p>', '', 'Drive the car to the marked position.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (415, 2, 'Driving Test Simulator', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (416, 1, 'One Escape', '<p><span style="color: rgb(0, 0, 0);">Crimers has been imprisoned in One Escape. Now you must escape from prison! - A lot of levels - Epic boss fight - Strange jailbreak levels - Escape from prison - Your character is crimer - Prisonbreak</span></p>', '', 'Use strategy to escape from prison! ', '<p><span style="color: rgb(0, 0, 0);">"J" - to jump. </span></p><p><span style="color: rgb(0, 0, 0);">W or D - to move around.</span></p>', '');
INSERT INTO public.game_texts VALUES (416, 2, 'One Escape', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (428, 1, 'World Flags Quiz', '<p><span style="color: rgb(0, 0, 0);">How well do you know the flags of the world? Have fun learning about different flags from countries around the world. As a country’s name appears in the box, simply tap or click on the correct match from the given flags. The faster you click the correct answer, the higher your score!</span></p>', '', 'How well do you know the flags of the world?', '<ul><li><span style="color: rgb(0, 0, 0);">As a country’s name appears in the box, simply tap or click on the correct match from the given flags. The faster you click the correct answer, the higher your score!</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (428, 2, 'World Flags Quiz', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (429, 2, 'Clash of Trivia', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (417, 1, 'Hug and Kis Station Escape', '<p><span style="color: rgb(0, 0, 0);">You have the story of two crazy astronaut monsters. You have to escape from the space station with Hug and Kis. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Help them escape in the first game of the series. Hug and Kis must get the key and reach the door. You have to take care to collect all the diamonds. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Don''t worry, there are no monsters or obstacles in the station. so calmly move towards the door with your friend.</span></p>', '', 'Get the key and reach the door to escape the space station.', '<ul><li>WASD - to move.</li></ul>', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️➡️ - to move.</span></li></ul>');
INSERT INTO public.game_texts VALUES (417, 2, 'Hug and Kis Station Escape', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (418, 1, 'Connect the bubbles', '<p><span style="color: rgb(0, 0, 0);">Swipe across the board to connect all same colored bubbles, use powerful boosters to reach the high score, and beat your friends. The more bubbles you connect the more powerful booster you earn. Make a connected square to unleash the bomb booster, connect 10 bubbles to earn a rocket booster, and make a chain of all same colored bubbles to earn a color booster!</span></p>', '', 'Swipe across the board to connect all same colored bubbles.', '<ul><li><span style="color: rgb(0, 0, 0);">Swipe across the board to connect all same colored bubbles.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (418, 2, 'Connect the bubbles', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (419, 1, 'Coloring Book', '<p><span style="color: rgb(0, 0, 0);">Relax and color everywhere you go. Coloring pages include peaceful scenery, flowers, mandala, mountains, sunshine, and more. The perfect anti-stress activity book for adults, kids, and all ages.</span></p><p><br></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Multiple templates to start with.</span></li><li><span style="color: rgb(0, 0, 0);">Choose different brush sizes and colors.</span></li></ul>', '', 'Color peaceful scenery and relax.', '<ul><li>Use the mouse to color.</li></ul>', '');
INSERT INTO public.game_texts VALUES (419, 2, 'Coloring Book', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (420, 1, 'Pro Billiards', '<p><span style="color: rgb(0, 0, 0);">This is a modern pool in which you can play alone on a timer, and also together with a friend. Rules as in the present pool 8 ball. Good luck to you!</span></p>', '', 'Play modern pool game alone or with a friend!', '<ul><li>Use your mouse to play. Click and hold in the direction you want your ball to go, then release.</li></ul>', '');
INSERT INTO public.game_texts VALUES (420, 2, 'Pro Billiards', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (421, 1, 'Princess Influencer Salon', '<p><span style="color: rgb(0, 0, 0);">Princess Influencer Salon is a fun girl game with amazing customizations! </span></p><p><span style="color: rgb(0, 0, 0);">Spring has come! Hey girls! These princesses have a dream of a wonderland and they would like to happen in reality by making wishes to fairies. Before making wishes they try some beautiful fairy dresses. So help the princess and have fun!</span></p>', '', 'Help the princesses with their daily routine and dressup.', '<ul><li>Follow the instructions within the game.</li></ul>', '');
INSERT INTO public.game_texts VALUES (421, 2, 'Princess Influencer Salon', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (422, 1, 'Doodle God Ultimate Edition', '<p><span style="color: rgb(0, 0, 0);">In this addictive, ALL ages, puzzle game mix and match different combinations of fire, earth, wind, and air to create an entire universe! As you create each element watch your world come alive as each element animates on your planet. The new “Planet” mode offers a new challenging way to create the universe of your dreams. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">- Create 300+ advanced items and concepts.</span></p><p><span style="color: rgb(0, 0, 0);">﻿- Intuitive one-click gameplay</span></p>', '', 'Create the universe of your dreams.', '<ul><li>Use your mouse.</li></ul><p><br></p><p>Follow tasks to create elements and first and later the universe.</p>', '');
INSERT INTO public.game_texts VALUES (422, 2, 'Doodle God Ultimate Edition', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (423, 1, 'Noob Escape: One level again', '<p><span style="color: rgb(0, 0, 0);">Noob has been imprisoned in Noob Escape: one level again game. Now Noob must escape from prison and defeat Cheater! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">- 100 levels </span></p><p><span style="color: rgb(0, 0, 0);">- Epic boss fight </span></p><p><span style="color: rgb(0, 0, 0);">- New game of Noob vs Pro vs Hacker vs God </span></p><p><span style="color: rgb(0, 0, 0);">- Strange jailbreak levels</span></p>', '', 'Escape from prison without dieing. 100+ levels.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span><span style="color: rgb(0, 0, 0);"> \ WASD - to move.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (423, 2, 'Noob Escape: One level again', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (424, 1, 'Bazooka Boy Online', '<p><span style="color: rgb(0, 0, 0);">Blast through levels and destroy everything before you with a bunch of amazing weapons! Collect all and master their different and unique qualities! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Send your enemies flying, explode their bases and crush their buildings! Satisfying destruction and unlimited possibilities to shoot your way to victory! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Fun ragdoll enemies and crazy explosions with levels upon levels of awesome content and challenges, go and wipe out all the enemies to win!</span></p>', '', 'Can you kill all of your enemies with wasting as less moves as possible?', '<ul><li>Right click to aim and release to shoot.</li></ul>', '');
INSERT INTO public.game_texts VALUES (424, 2, 'Bazooka Boy Online', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (425, 1, 'Jumpy! The Legacy of a Chicken', '<p><span style="color: rgb(0, 0, 0);">Help the little chicken escape the tower. Control the height of the jump and the timing of it, so you don''t die from all of the obstacles in the game.</span></p><p><span style="color: rgb(0, 0, 0);">To control the height hold your click - the more you hold the higher the chicken will jump.</span></p><p>How high can you get?</p>', '', 'Try to get as high as possible without dying.', '<ul><li>Use your mouse. Click and hold to control the height of the jump. The longer you hold the higher the chicken will jump.</li></ul>', '');
INSERT INTO public.game_texts VALUES (425, 2, 'Jumpy! The Legacy of a Chicken', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (426, 1, 'Draw the Bridge', '<p><span style="color: rgb(0, 0, 0);">Draw The Bridge is a fun arcade game where the player has to draw a path for the vehicles and is easy to play and draw the vehicles enjoy it fun arcade game where the player has to draw.</span></p>', '', 'Strategically draw a bridge so the car can get to the other side.', '<ul><li>Use your mouse to draw the bridge.</li></ul>', '');
INSERT INTO public.game_texts VALUES (426, 2, 'Draw the Bridge', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (543, 2, 'RSLocator - RS3', '', 'osrs geoguessr runescape old school runescape rune scape', '', '', '');
INSERT INTO public.game_texts VALUES (427, 2, 'Hotel Hideaway', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (476, 1, 'Besties Summer Vacation', '<p>In this cute game Besties Summer Vacation, Besties are planning for a cute summer vacation. They decided to arrange a trip to the beach with their old van. But they need some expert help to choose cute makeup and the perfect trip outfit. And also they need some help to modify and decorate their old van. Play and have fun!</p>', '', 'Prepare the besties for a cute summer vacation.', '<ul><li>Click to dress up the characters.</li></ul>', '');
INSERT INTO public.game_texts VALUES (429, 1, 'Clash of Trivia', '<p><span style="color: rgb(0, 0, 0);">Clash with friends via this PvP trivia game. Answer a broad universe of general knowledge questions in a rapid-fire format. Play with friends via invite codes or with anyone online.</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Key Features</span></h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Avatar selection </span></li><li><span style="color: rgb(0, 0, 0);">Custom usernames </span></li><li><span style="color: rgb(0, 0, 0);">Pool of 200 questions </span></li><li><span style="color: rgb(0, 0, 0);">Play with friends via invite codes </span></li><li><span style="color: rgb(0, 0, 0);">Play with anyone online</span></li></ul>', '', 'Answer a broad universe of general knowledge questions quickly.', '<ul><li><span style="color: rgb(0, 0, 0);">Click on the answer you think is right.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (430, 1, 'Mahjong 3D', '<p><span style="color: rgb(0, 0, 0);">Mahjong 3D takes the classic brain teaser game to a new third dimension! You will experience one of the most popular puzzles from many new angles and enjoy matching the beautiful tiles!</span></p><p><br></p><h3>Instructions</h3><p><br></p><p><span style="color: rgb(0, 0, 0);">You have to find and match two tiles with the same symbol. Tiles are matchable only if there is no other tile on their left or right side. If they are blocked, you will have to unblock them by matching the tiles placed next to them. You will receive some extra time for every level you manage to beat! So what are you waiting for? </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Enjoy the most beautiful Mahjong 3D Game here and now, on Vedia Games!</span></p>', '', 'A satisfying mahjong game, where you need to find and match two tiles.', '<p>Find and connect 2 tiles with the same symbol.</p><ul><li>Click on the tiles you wish to connect.</li></ul><p><br></p>', '');
INSERT INTO public.game_texts VALUES (430, 2, 'Mahjong 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (431, 1, 'Mr Bean Solitaire Adventures', '<p><span style="color: rgb(0, 0, 0);">Mr. Bean - Play this super fun solitaire card game adventure ♠️ ♣️ ♥️ ♦️ Mr. Bean is experimenting with taking selfies on top of Tower Bridge in London but falls from the bridge and collides with a ship, set for the USA! When he opens his eyes, he finds himself in New York and his solitaire adventure begins. Join him on his road trip through the USA and experience the vibe of cities like New York, Honolulu, San Francisco, New Orleans, and many more in our new solitaire card game.</span></p>', '', 'Play a good solitaire game with Mr. Bean''s characters!', '<ul><li><span style="color: rgb(0, 0, 0);">Tap or click to stack your cards in the correct order, either ascending or descending. If you have a 3 of clubs, you can match it with a 2 of any suit, or a 4 of any suit.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (431, 2, 'Mr Bean Solitaire Adventures', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (432, 1, 'Hidden Objects Superthief', '<p><span style="color: rgb(0, 0, 0);">A rich city of mansions, museums, and ateliers with tons of opportunities to steal mysterious relics and rare artifacts. As a hired thief, it is a perfect place for Mrs. Smith to become the best of the best. Help her find the hidden objects her clients desire and earn the highest reputation! Expect lots of various scenes to search through, side jobs, and special equipment to collect. The scenes change their layout and difficulty every time you play and according to your level of mastery!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Search through different scenes for hidden objects, then tap to collect them. The faster you find the objects you''re supposed to, the more score you get. When you have a hard time finding an object, you can use a hint. Earn a star-based reputation to unlock new scenes. Try to master each scene for a mastery reward. Have fun with various side jobs.</span></p>', '', 'Collect the hidden objects your clients desire and become the best thief.', '<ul><li><span style="color: rgb(0, 0, 0);">Search through different scenes for hidden objects, then </span><strong style="color: rgb(0, 0, 0);">tap to collect them</strong><span style="color: rgb(0, 0, 0);">. The faster you find the objects you''re supposed to, the more score you get. </span></li></ul>', '');
INSERT INTO public.game_texts VALUES (432, 2, 'Hidden Objects Superthief', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (433, 1, 'Woodturning Studio', '<p><span style="color: rgb(0, 0, 0);">In the Woodturning Studio game, sample wood is shaped with different wood carving knives. After wood carving, you can color the wood and apply varnish to it. Turn your imagination into wood art with this game. In the final scene, you can save your wood artwork to your phone/tablet gallery. Game Features; - Just swipe wood and create shapes - Unlimited combinations with different wood carving tools - Coloring, polishing, and matting tools - You can save your artwork as an image.</span></p>', '', 'Relax by creating your own art pieces by shaping wood.', '<ul><li>Use your mouse to play the game. </li></ul>', '');
INSERT INTO public.game_texts VALUES (433, 2, 'Woodturning Studio', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (230, 1, 'Blocky Parkour Ninja', '<p>Ninja Blocky Parkour is an amazing 3D FPS parkour game where you have to jump from platform to platform. Check this cool game out and try to complete all the levels.</p>', '', 'Smooth 3D online platformer game with simple graphics and low requirements ', '<ul><li>WASD or Arrow keys - move</li><li>Space or Right mouse click - jump</li></ul>', '');
INSERT INTO public.game_texts VALUES (434, 1, 'Ellie Fashion Fever', '<p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Welcome to Ellie Fashion Fever. Ellie is a supermodel who is inspired more by the latest fashion trends. She tired of trying old fashion and plan try something unique. Help her to try different trends by browsing her wardrobe and picking cute outfits in each fashion style. And don’t forget to try different hairstyles in each fashion.</span></p>', '', 'Help Ellie, the supermodel, to dress up by the latest fashion trends.', '<ul><li>Click on the items, you want Ellie to wear.</li></ul>', '');
INSERT INTO public.game_texts VALUES (434, 2, 'Ellie Fashion Fever', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (436, 1, 'Traffic Jam 3D', '<p><span style="color: rgb(0, 0, 0);">Prepare yourself for the most outrageous and thrilling racing game of your life. You can try to reach checkpoints on time, make a specific number of points within a set period of time, drive a set distance within a set period of time, and so much more. So if you want some fun and excitement, buckle up your seatbelts and play Traffic jam 3D!</span></p><p><br></p><h3>Key Features</h3><p><br></p><p><span style="color: rgb(0, 0, 0);">- Simple gameplay </span></p><p><span style="color: rgb(0, 0, 0);">- Eye-catching graphics and effects </span></p><p><span style="color: rgb(0, 0, 0);">- Over twenty fantastic automobiles with a variety of Factory and Test Specs Upgrade the Engine, Brakes, and Handling to raise the Performance Rating. </span></p><p><span style="color: rgb(0, 0, 0);">- The Gear Ratio, Ride Height, Front Camber, and Rear Camber can all be adjusted. </span></p><p><span style="color: rgb(0, 0, 0);">- Select from a variety of color schemes. - Change the car''s and wheel''s colors. </span></p><p><span style="color: rgb(0, 0, 0);">- If you want more information about your driving, go to the Driver Point and Driver Stats section. </span></p><p><span style="color: rgb(0, 0, 0);">- Four difficult modes: Career, Infinite, Time Against, and Free </span></p><p><span style="color: rgb(0, 0, 0);">- In Career, try to unlock all 80 levels. </span></p><p><span style="color: rgb(0, 0, 0);">- You can choose to travel on Highway, Desert, or City in Infinite Scenario, Time Against, and Free Scenarios. </span></p><p><span style="color: rgb(0, 0, 0);">- Drive in the morning, evening, and night. </span></p><p><span style="color: rgb(0, 0, 0);">- One-way or two-way driving</span></p>', '', 'A thrilling racing game, with lots of fun goals. A proper game to have fun.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ or WASD - to move.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (436, 2, 'Traffic Jam 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (476, 2, 'Besties Summer Vacation', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (437, 1, 'Martial Arts: Fighter Duel', '<p><span style="color: rgb(0, 0, 0);">Welcome to the duel tournament of martial arts! 17 martial arts masters from different countries and geographies meet in the arena. Show your unique fighting style and try to beat the opponents. You can join the tournament in "Arcade" mode or you can compete with your friend in "2 Player" mode. You can set the difficulty level of the game in the settings section. If you are ready for fights, you can start.</span></p>', '', 'Show your unique fighting style and try to beat the opponents.', '<ul><li>WASD - to move.</li><li>F/G/H - to punch.</li><li>C/V/B - to kick.</li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">U/I/O - to punch.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">J/K/L - to kick.</span></li></ul>');
INSERT INTO public.game_texts VALUES (437, 2, 'Martial Arts: Fighter Duel', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (438, 1, 'Jewels Blitz 5', '<p><span style="color: rgb(0, 0, 0);">Jewels Blitz 5, the long-awaited 5th installment of the legendary Match 3 game that takes you deep into the mystery of ancient cultures of Central America. You will explore Mayan Temples and try to solve their secrets and mysteries. Enjoy hundreds of levels, Daily Missions, and Weekly Challenges. Earn gold and magical items!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Combine at least 3 shiny gems of the same type to make them vanish. Use their secretive powers to remove jungle obstacles and magical seals. Climb your way up the saga map to increasingly difficult levels.</span></p>', '', 'Enjoy hundreds of levels of the amazing match-3 game: Jewels Blitz!', '<ul><li><span style="color: rgb(0, 0, 0);">Combine at least 3 shiny gems of the same type to make them vanish.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (438, 2, 'Jewels Blitz 5', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (439, 1, 'Magical Jigsaw', '<p><span style="color: rgb(0, 0, 0);">This is a fantastic jigsaw puzzle game with a magical and fantasy theme. Drag and drop the picture pieces to their exact locations.</span></p>', '', 'A jigsaw puzzle game with a magical fantasy theme.', '<ul><li><span style="color: rgb(0, 0, 0);">Drag and drop the picture pieces to their exact locations.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (439, 2, 'Magical Jigsaw', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (440, 1, 'A Mole in a Hole', '<p><span style="color: rgb(0, 0, 0);">Help a forgetful mole to find his way home! Look at the map and choose the right path! Go home to your wife before dinner is ready! She''s waiting for you!</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Key Features</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">-20 Levels to dig </span></p><p><span style="color: rgb(0, 0, 0);">-10 Achievements to unlock </span></p><p><span style="color: rgb(0, 0, 0);">- Many different ways to die </span></p><p><span style="color: rgb(0, 0, 0);">- Plenty of distractions to avoid </span></p>', '', 'Help a forgetful mole to find his way home!', '<p>Help a forgetful mole to find his way home.</p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Touch the button on the screen to choose the mole''s path.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (440, 2, 'A Mole in a Hole', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (441, 1, 'Hoops Champ 3D', '<p><span style="color: rgb(0, 0, 0);">Play this exciting basketball game. More than 200+ different levels of Challenging arcade-style basketball games. More than 6 different locations. Let''s dunk some balls!</span></p>', '', 'More than 200 different levels of a challenging basketball game.', '<ul><li>Drag the ball and then release to throw it.</li></ul>', '');
INSERT INTO public.game_texts VALUES (441, 2, 'Hoops Champ 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (442, 1, 'Wood Block Puzzle 2', '<p><span style="color: rgb(0, 0, 0);">The second sequel to the most addictive puzzle game of all time! This puzzle game will exercise your brain for hours, days, and months. It boasts a beautiful wooden design with carefully crafted puzzle pieces and a game board. Are you ready to become a master?</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You have to place a combination of 3 blocks on the board strategically. Complete lines vertically or horizontally for the blocks to disappear. The more lines you complete, the higher the score you will get. Be careful, once there is no space left on the board, the game is over! Sounds simple? Only at first sight. This game requires real strategy. Earn bonus points, unlock medals and achievements and become the wood block puzzle master!</span></p>', '', 'Place a combination of blocks on the board strategically, to form a line.', '<ul><li>Drag and drop the pieces on the board. </li></ul><p><br></p><p>You need to place combinations strategically, so they form a whole horizontal or vertical line.</p>', '');
INSERT INTO public.game_texts VALUES (442, 2, 'Wood Block Puzzle 2', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (443, 1, 'The Smurfs Ocean Cleanup', '<p><span style="color: rgb(0, 0, 0);">Join one of the Smurfs while he cleans the ocean that surrounds the tropical island he calls home. It’s been totally trashed by Gargamel and Azrael! You’ll earn coins for each item you’re able to pull out of the water. You can trade these coins for awesome upgrades that will make the Smurf stronger or give him a long fishing line that will help him grab more garbage. There are also valuable treasures and cool stickers floating around for you to collect!</span></p>', '', 'Join the Smurfs and clean the ocean! More trash - better score.', '<ul><li><span style="color: rgb(0, 0, 0);">Left click - to drop the fishing line into the water. </span></li><li><span style="color: rgb(0, 0, 0);">Move the mouse to pick up the trash from the ocean.</span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">The more trash you collect, the better score you get!</span></p>', '');
INSERT INTO public.game_texts VALUES (443, 2, 'The Smurfs Ocean Cleanup', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (464, 1, 'Squid Mahjong Connect 2', '<p><span style="color: rgb(0, 0, 0);">Connect the all squid mahjong tiles and clear the board. What''s the max level you can get to? You can use the "Hint" and "Shuffle" buttons for help.</span></p>', '', 'Connect the all squid mahjong tiles and clear the board.', '<ul><li>Click/Tap to connect the same tiles.</li></ul>', '');
INSERT INTO public.game_texts VALUES (464, 2, 'Squid Mahjong Connect 2', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (465, 1, 'Head Soccer 2022', '<p><span style="color: rgb(0, 0, 0);">Head Soccer 2022 is a fast-paced sports football game where you can challenge all your friends or play with the CPU. Choose your favorite player and play against the CPU for the tournament or be the best of your friends in the versus mode. With detailed players to choose from the best teams, 3 game fields, and all the arcade fun in a single game.</span></p><p><br></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Easy to understand; </span></li><li><span style="color: rgb(0, 0, 0);">Nice and addictive gameplay; </span></li><li><span style="color: rgb(0, 0, 0);">10 Real players to choose </span></li><li><span style="color: rgb(0, 0, 0);">3 detailed fields&nbsp;</span></li></ul>', '', 'A fast paced football game where you can challenge your friend or CPU.', '<ul><li>WASD - to move.</li><li>N, M - to shoot.</li></ul>', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️➡️</span> - to move.</li><li>1,2 - to shoot.</li></ul>');
INSERT INTO public.game_texts VALUES (465, 2, 'Head Soccer 2022', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (477, 1, 'Poppy Huggie Escape', '<p><span style="color: rgb(0, 0, 0);">Find yourself in a room with huggy. Escape from the house evading many objects, running, jumping, and sliding. Plan an escape from this room, Scary Huggy is back with a horror room adventure! Enemies are going by Wuggy to horror and spooky room where kissy is allowed to be roaming around. Collect all keys to open the doors or the chaser will hunt you. Use the score to unlock new chasers in the shop as Huggy, Freddy, Sonic.exe, Or Zombie among us.</span></p>', '', 'An exciting game where you need to be quick and escape from Huggy.', '<ul><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️ - </span><span style="color: rgb(0, 0, 0);">to jump.</span></li><li>⬇️<span style="color: rgb(0, 0, 0);"> -  to crouch under the obstacles. </span></li></ul>', '');
INSERT INTO public.game_texts VALUES (477, 2, 'Poppy Huggie Escape', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (478, 1, 'Mini Clash War Z', '<p><span style="color: rgb(0, 0, 0);">Have fun with this entertaining game of strategies a war in miniatures. Mini Clash War Z is an action and strategy game. Command your small army and triumph in battles. With this new game, you will learn to add and calculate your movements. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The objective of the game is to complete each level in a war of strategic movements, and move your troops to arrive with the number of soldiers necessary to capture the enemy base. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Decide your movements by counting the sum of soldiers of each movement to eliminate the soldiers positioned at different points of your base.</span></p>', '', 'Command your small army and triumph in battles. ', '<ul><li>Click to choose the side you want your soldiers to go on to.</li></ul>', '');
INSERT INTO public.game_texts VALUES (478, 2, 'Mini Clash War Z', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (479, 1, 'Beauty Run Run', '<p><span style="color: rgb(0, 0, 0);">There is no standard for beauty, everyone can be beautiful! In this game, you have the opportunity to try out various professions! Beauty Race is a fun casual game where you can choose the activity you are interested in. You can become a model or a firefighter. Or maybe you want to go skiing or to a water park?</span></p>', '', 'Make smart decisions to win in the race!', '<ul><li>Slide to choose where you want your character to go.</li></ul>', '');
INSERT INTO public.game_texts VALUES (479, 2, 'Beauty Run Run', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (480, 1, 'Horse Racing 2D', '<p><span style="color: rgb(0, 0, 0);">Choose the best horse and try to win the races. There are several horse breeds available. Use stamina wisely to get first! see the varied and beautiful sceneries of the racecourses and place your bets!</span></p>', '', 'Choose the best horse and try to win the races. ', '<ul><li>First choose your horse.</li><li>Then to play the game click on "Dash".</li></ul>', '');
INSERT INTO public.game_texts VALUES (480, 2, 'Horse Racing 2D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (481, 1, 'Country Pop Stars', '<p><span style="color: rgb(0, 0, 0);">Join Tay in her Country Pop Star dress-up! Help her get ready for the country tour with a southern-style dress ensemble. Alternate different boots, hats, tops, and dresses that fit for a southern belle with a musical flair!</span></p>', '', 'Help Tay get ready for a country tour with a southern-style dress ensemble.', '<ul><li>Click to choose.</li></ul>', '');
INSERT INTO public.game_texts VALUES (481, 2, 'Country Pop Stars', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (482, 1, 'Airport Rush', '<p><span style="color: rgb(0, 0, 0);">You own the airport and now have to manage it! You get to manage the landing and take-off of all planes at the airport! Put your alertness and management skills at work and make sure a safe journey for everyone.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>You get three different terminals which vary in number of platforms and planes. As the game stage increases, number of planes increase and their frequency as well.</span></p>', '', 'You own the airport and now have to manage it!', '<ul><li><span style="color: rgb(0, 0, 0);">Tap or click on the circular countdown near the plane to get it moving. If you don''t click, the plane will move once the countdown is complete. </span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">Planes stop for a refill or other activities. Safely manage to park and take off for maximum planes!</span></p>', '');
INSERT INTO public.game_texts VALUES (482, 2, 'Airport Rush', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (1, 1, 'Ninja Rabbit', 'Ninja Rabbit is a superhero. One day, the children in the village were taken away by the monster. Bearing the expectations of the villagers, the ninja rabbit set off resolutely and embarked on a journey to fight against monsters.', '', 'Save all the children from the village with your ninja strength.', '<ul><li><span style="color: rgb(0, 0, 0);">Click to throw the Shuriken!</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (42, 1, 'Industry Road Construction', '<p>Industry Road Construction is a 3D online web game where you play as a construction engineer. In this web game, you will be driving and using heavy construction trucks and equipment to help create urban cities.</p><p><br></p><h3>Features:</h3><ul><li>Put your road construction and driving skills to use and build roads in various city locations. </li><li>Become a construction site engineer and help create passable urban roads</li><li>Drive multiple heavy machinery in the construction zone to build roads.</li><li>Use your architectural knowledge and create a construction plan; how to build roads in a city area and which type of machinery will be used by road builders.</li></ul>', '', 'Fun 3D web online game where you drive and use heavy construction equipment', '<ul><li>W or ⬆️ to move forward</li><li>D or ➡️ to move right</li><li>S or ⬇️ to move backward</li><li>A or ⬅️ to move left</li><li>Move sliders on the screen to adjust truck cargo and excavator</li></ul>', '');
INSERT INTO public.game_texts VALUES (177, 1, 'Tile Master Match', '<p><span style="color: rgb(0, 0, 0);">Tile Master Match Game requires you to match 3 blocks of the same element, you will pass the level when all tiles are matched. Which is different from Mahjong or other block puzzle game. Tile Master Match consists of a large number of levels that get progressively more difficult.</span></p>', '', 'Match 3 tiles of the same element and pass when everything is cleared.', '<ul><li>Click/Tap to select tiles.</li></ul>', '');
INSERT INTO public.game_texts VALUES (223, 1, 'Rabbids Volcano Panic', '<p><span style="color: rgb(0, 0, 0);">Play Rabbids Volcano Panic on Vedia Games! This is an extremely exciting browser game, where you need to survive and not fall into the lava.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Rabbids island is crumbling in a colossal volcanic eruption! Stay safe as long as you can and make your way on the collapsing floor before the other panicking Rabbids take you down with them! Pick up bonus items and trap other players to play dirty and make them fall first!</span></p>', '', 'The island is crumbling in a volcanic eruption! Don''t fall in the lava!', '<p><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ or click - to move.</span></p><p><br></p><p>Try not to fall into the lava, survive as long as you can.</p>', '');
INSERT INTO public.game_texts VALUES (513, 1, 'Lovely Streamers', '<p><span style="color: rgb(0, 0, 0);">Live streaming is one of the most popular modern entertainment. To stay on trend, streamers must look flawless. Let''s help beautiful girls create their own unique fashion look for live streaming. Choose bright shiny outfits, incredible multi-colored hairstyles, and daring accessories. Start your fashion stream right now!</span></p>', '', 'To stay on trend, streamers must look flawless. Help them with their looks.', '<ul><li>Click to choose items.</li></ul>', '');
INSERT INTO public.game_texts VALUES (227, 1, 'Circuit Car Racing', '<p><span style="color: rgb(0, 0, 0);">Prepare to partake in a race where everything revolves around the portion of adrenaline and the race ahead of you. Show your racing skills and go for the win.<span class="ql-cursor">﻿</span></span></p>', '', 'Show your racing skills and go for the win.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD or ⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span><span style="color: rgb(0, 0, 0);"> - to drive.</span></li><li><span style="color: rgb(0, 0, 0);">Space - to break.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (51, 1, 'Basketball with buddies', '<p><span style="color: rgb(0, 0, 0);">Flick the basketball into the hoop. It''s that simple. Compete in real-time against your opponent. Play in real-time against your friends or the computer. How many points can you score in 60 seconds?</span></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Constantly moving basketball board</span></li><li><span style="color: rgb(0, 0, 0);">﻿Realistic audience cheers (and jeers)</span></li></ul>', '', 'Flick the basketball into the hoop.', '<ul><li>Swipe up to throw the ball.</li></ul>', '');
INSERT INTO public.game_texts VALUES (268, 1, 'Police Chase Motorbike Driver', '<p>Police Chase Motorbike Driver is the game for the people who are vigilant and ready to take on the criminals. Follow your guts and catch the criminals who are acting badly in your city.<strong> Every mission has its own limitations. </strong></p><p><br></p><p>Unlock bikes by completing missions and collecting money scattered across the city. You’re the superhero of this city, so keep the criminals out. Confront them and kill them if necessary. <strong>Don’t let them get away!!!</strong> But, with every Impact, you’ll lose your bike’s health.</p><p><br></p><h3><strong>Features:</strong></h3><ul><li>Get on the bike to catch and eliminate the threats.</li><li>Escort President on his journey to your city.</li><li>Unlock more bikes by driving and completing missions.</li></ul>', '', 'Try this cool 3D police simulator', '<ul><li>A - Drive / Move Left</li><li>D - Drive / Move Right</li><li>Space - Breaks</li><li>S - Drive / Move Reverse</li><li>W - Drive / Move Forward</li><li>F - Interact / get in vehicle</li><li>Left-click - shoot</li><li>Right-click -aim</li></ul>', '');
INSERT INTO public.game_texts VALUES (299, 1, 'Motorcycle Pet Delivery', '<p>Do you enjoy playing bike driving simulation games on your computer? We''ve compiled the greatest free bike driving games for your enjoyment. Play the City Motorbike Animal Transport and enjoy its one-of-a-kind gameplay experience. In this game, you will take on the role of a bike driving simulator and transfer various pets from one location to another. </p><p><br></p><p>The rider prepares their motorbike for pet animal carrying in our City Motorcycle Pet Animals program. Motorbike transport animal delivery is difficult because wild animals may hurt you while loading them for motorbike animal delivery. Animal Transport by Motor Cycle Animal teleportation missions will require riders to attach an engine trolley cage to their bikes. </p><p><br></p><p>They will also load their cargo into a motor mini truck and a cargo cage for offroad pet dog transport. Cattle, farm animals, and wild animals such as cows, goats, horses, Ponies, and Dogs will be transported to city clients by offroad pet dog transport in the animal transit games 2019.</p>', '', 'Epic bike driving simulation game inside your browser', '<ul><li>WASD to drive</li></ul>', '');
INSERT INTO public.game_texts VALUES (369, 1, 'Pony Friendship', '<p><span style="color: rgb(0, 0, 0);">Pony Friendship is a logic game where little ponies get lost in the forest. To help them, it is necessary, to observe the rules of mirror reflection, and to meet in the center of the location.</span></p><p><span style="color: rgb(0, 0, 0);"> </span></p><p><span style="color: rgb(0, 0, 0);">-Easy logic game </span></p><p><span style="color: rgb(0, 0, 0);">-You can improve the result every time</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Instructions</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">There are two ponies on the location opposite each other. When the first pony moves, the second pony repeats the actions in a mirror. It is required to spend as few actions as possible so that the ponies meet in the center of the location. </span></p>', '', 'Help little ponies get to each other by using logic.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD or ⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">When the first pony moves, the second pony repeats the actions in a mirror. Make as few actions as possible so the ponies meet.</span></p>', '');
INSERT INTO public.game_texts VALUES (241, 1, 'Funny Cooking Camp', '<p><span style="color: rgb(0, 0, 0);">The great outdoors is calling! But the mice are starting to get hungry. Help them to build the clay oven and collect the items for the grill. Bake delicious pizza and grill the BBQ satays. Enjoy this funny camping game!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Cook, bake, build, clean, and have fun with this amazing online game "Funny Cooking Camp". </span></p>', '', 'Build an oven and cook some delicious pizzas.', '<ul><li>Follow the instructions in the game.</li></ul>', '');
INSERT INTO public.game_texts VALUES (243, 1, 'Candy Maker Factory', '<p><span style="color: rgb(0, 0, 0);">Last week we received an invitation from the Magic Candy Land! The manager of the Magic Candy Land invited us to have a crazy candy factory one-day-tour! We feel so lucky to have this rare opportunity! We were so delighted that this day has finally come! A shuttle bus takes us to our destination! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Here we come! So many candy factories around us! Such as candy ring factory, rock candy factory, gummy candy factory, pretzel factory, and chocolate bar factory! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The manager is going to bring us to visit each of them and teach us how to make those yummy candies with cooking tools and machines! Oh my god! We are totally in love with this place! Do you want to join us in this wonderful place and cook candies with us? Come on! Let’s get started right now!</span></p><p><br></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">A super fun food-making game </span></li><li><span style="color: rgb(0, 0, 0);">Make yummy foods for candy rings, rock candy, gummy candies, pretzels, and chocolate bars </span></li><li><span style="color: rgb(0, 0, 0);">Tons of realistic cooking tools to play with: candy ring molds, candy ring base, induction cooker, mixing machine, water machine, glass jars, stationary machine, clamp machine, gummy candy molds, freezer, spatula, baking pan, weigh, bowls, rolling pin, cutting board, fryer, food masher and so much more </span></li><li><span style="color: rgb(0, 0, 0);">Tons of food materials and food decorations to try: sugar, jello, gelatin, water, corn syrup, flour, milk, sea salt, egg wash, peanut, peanut butter, chocolate, fruits, sprinkles and so much more</span></li></ul>', '', 'Cook the most delicious food and decorate it as you wish.', '<ul><li>Follow the game instructions.</li><li><span style="color: rgb(0, 0, 0);">Try different cooking tools and machines to make your yummy foods </span></li><li><span style="color: rgb(0, 0, 0);">Mix various ingredients to create the unique flavor and color of your foods </span></li><li><span style="color: rgb(0, 0, 0);">Decorate your foods with beautiful sprinkles, candies, and fruits</span></li></ul><p><br></p><p><br></p>', '');
INSERT INTO public.game_texts VALUES (246, 1, '8 Ball Pool Challenge', '<p><span style="color: rgb(0, 0, 0);">Play 8 Ball Pool Challenge on Vedia Games! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The pro arcade style pool game with a single player. 8 Ball League takes the latest technology to create the most realistic and amazing 8 Ball simulator. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Fantastic playability and ultra-realistic ball physics will refresh your pool game experience. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿Challenge a variety of stylish new levels of different abilities from beginner right up to pro level. Train your skills, improve your game and defeat the opposition to gain access to new city bars.</span></p>', '', 'Train, improve your game and defeat opposition playing 8 ball pool.', '<ul><li><span style="color: rgb(0, 0, 0);">Click-drag and release to launch the ball. </span></li></ul>', '');
INSERT INTO public.game_texts VALUES (259, 1, 'Bag Design Shop', '<p><span style="color: rgb(0, 0, 0);">Welcome creative &amp; Fashionista girls. It’s time to fulfill your fashion mania with this most interesting game for girls. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Bag Design Shop designer is the most creative game for those Fashionista girls who love to be always in new fashion trends. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You can design &amp; decorate your own bag for your wedding parties &amp; for special events. Are you ready to play this addictive girl bag designer game?</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play Bag Design Shop on Vedia Games!</span></p>', '', 'Create some wonderful bags and accept only the best offers!', '<ul><li>Hold &amp; Move the mouse around to paint the bags.</li><li>Drag &amp; Drop to position the elements right. </li><li>Click.</li></ul>', '');
INSERT INTO public.game_texts VALUES (273, 1, 'Sunny Farm io', '<p><span style="color: rgb(0, 0, 0);">Sunny Farm is a crazy blend of action and farming where you drive a combine, harvest crops, and destroy other players in heated online battles. Can you survive long enough to gather more wheat than anyone else on the server?</span></p><p><br></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The more you gather, the more trailers will be attached to your vehicle. Having a long trail is not just an indicator of your success, but also an instrument of destruction: if you can position yourself correctly, your enemies will end up crashing into one of your trailer cars and die immediately. However, this also means that you are vulnerable in the same way: try to avoid running into another vehicle’s side, or else you will have to start anew.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿The goal of this game is to survive for as long as you can while harvesting insane quantities of wheat. Control your combine by pressing Left, Right, Up and Down arrows on your keyboard. Alternatively, you can use the W, A, S and D keys, if you prefer. Wheat is harvested automatically, all you need to do us drive over the yellow parts of the field.</span></p>', '', 'Survive for as long as you can while harvesting insane quantities of wheat.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80);">⬆️➡️ -&nbsp;</span><span style="color: rgb(0, 0, 0);">to move or</span></li><li>WASD to move.</li></ul>', '');
INSERT INTO public.game_texts VALUES (277, 1, 'Starblast.io', '<p>StarBlast is a fun multiplayer online game set in space. Mine asteroids and fight other players in your own fully upgradable spaceship. Work together with your teammates to ensure victory.</p><p><br></p><p>There are four game modes in the game. We have:</p><p><br></p><ul><li>Team, </li><li>Survival mode, </li><li>Invasion, and </li><li>Pro DeathMatch. </li></ul><p><br></p><p>If you are a new player, team mode may be the best starting point for you because you have your team to back you up.</p><p><br></p><h3>If you are a new player</h3><p><br></p><p>The game offers a tutorial at the beginning, that will teach you anything you need to know - how to move, shoot, and others.</p><p><br></p><h3>Get gems from destroying asteroids</h3><p><br></p><p>To destroy asteroids, you need to shoot them until they explode in space. When they do, you will get an award - red gems.</p><p><br></p><h3>Upgrade your ship with what you earned</h3><p>As you earn gems, you unlock more and upgrade your ship to a better, quicker one. </p><p><br></p><p>Enjoy! Play StarBlast on Vedia Games.</p>', '', 'Mine asteroids in space and upgrade your ship. Work with your team to win.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">Spacebar or Click - to fire weapons.</span></li></ul><p><br></p><p>More useful controls on <a href="https://starblast.fandom.com/wiki/How_to_play_guide_for_Starblast" rel="noopener noreferrer" target="_blank">Starblast Fandom</a>.</p>', '');
INSERT INTO public.game_texts VALUES (325, 1, 'Top Guns IO', '<p><span style="color: rgb(0, 0, 0);">TopGuns.io is a mobile battle royale where you shoot with a weapon like your life depends on being the last player alive. The winner takes all! io online games are simple multiplayer games where you battle other players on and offline to try and survive as long as possible. It’s super fun battles!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">- Battle against real players </span></p><p><span style="color: rgb(0, 0, 0);">- Super easy controls </span></p><p><span style="color: rgb(0, 0, 0);">- 2-minute battles </span></p><p><span style="color: rgb(0, 0, 0);">- 10+ weapon types </span></p><p><span style="color: rgb(0, 0, 0);">- 8+ unique heroes </span></p><p><span style="color: rgb(0, 0, 0);">- Different game modes </span></p><p><span style="color: rgb(0, 0, 0);">- Lots of maps with unique gameplay</span></p>', '', 'Shoot with your weapon like your life depends on being the last player.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD or ⬅️</span><span style="background-color: rgb(22, 35, 80);">⬆️➡️ -&nbsp;</span><span style="color: rgb(0, 0, 0);">to move</span></li><li><span style="color: rgb(0, 0, 0);">Spacebar (or fire icon on the screen) - to shoot.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (279, 1, 'Vampire Survivors DEMO', '<h3><em>(Note: this might not work on safari browser)</em></h3><p><br></p><h3><strong>There are tales that exist, but shouldn''t.</strong></h3><p><em>In the year 2021, in Rural Italy, there lived an evil person named Bisconte Draculó, whose many evil magics created a bad world filled with famine and suffering. It''s now up to the members of the Belpaese family to end his reign of terror and return good food to the table.</em></p><p><strong>Vampire Survivors</strong> is currently a time survival game with minimalistic gameplay and roguelike elements.</p><p>There''s no place where to hide, all you can do is try to survive a cursed night and get as much gold as possible for the next survivor before Death inevitably puts an end to your struggles.</p><p><br></p><h3><strong>Content in the demo web&nbsp;version:</strong></h3><ul><li>7 characters</li><li>22 weapons and 12 power-ups</li><li>10 pickups</li><li>23 achievements</li><li>1 stage</li><li>Supports mouse, keyboard, controller, and touch screen.</li></ul><p><br></p><h3><strong>Starting tips:</strong></h3><ul><li>Take your time to grab gems and&nbsp;items, they won''t disappear.</li><li>Get just two or three offensive&nbsp;weapons, but focus on leveling them up one at a time.</li><li>Armor and Luck are good starting power-ups to spend money on.</li></ul><p><br></p><h3><strong>FAQs:</strong></h3><p><strong>What''s different from the Steam version?</strong></p><p>The Steam version is receiving regular content updates, while the web version is considered pretty much like a demo.</p><p><br></p><p><strong>Is it possible to transfer the save file to the Steam version?</strong></p><p>No, there are plans to look into it but it''s highly unlikely it will happen.</p><p><br></p><p>Try out Vampire Survivors demo for free online within your browser on vediagames.com</p><p><br></p><p><a href="https://store.steampowered.com/app/1794680/Vampire_Survivors/" rel="noopener noreferrer" target="_blank">Buy the full game on steam!</a></p>', '', 'web online free demo of an indie game that is super addicting and good', '<ul><li>WASD, touch, gamepad, mouse click - control movement</li><li>Left-click or touch - interact with UI</li></ul>', '');
INSERT INTO public.game_texts VALUES (305, 1, 'Uphill Offroad Bicycle Rider', '<p><span style="color: rgb(0, 0, 0);">Hill Climb Cycling is best for maintaining fitness. To become the best freestyle MTB Mountain Bike cyclist and ride at full speed by controlling the BMX MTB Mountain Bike (Bike) handlebars with a strong wrist grip.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Race the 2-wheeler monster Mountain Bike bicycle by kicking a fast paddle to perform stunts in freestyle Hill Climb Racing. Every level is very enjoyable and exciting. You can race in the Trial bike racing arena</span></p>', '', 'Ride bicycle and complete mountain tracks in this web 3D game', '<ul><li>WASD or Arrows - movement</li><li>Space - brake</li><li>C - camera</li><li>G - jump</li></ul>', '');
INSERT INTO public.game_texts VALUES (513, 2, 'Lovely Streamers', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (307, 1, 'Draw and Park', '<p><span style="color: rgb(0, 0, 0);">An exciting mix of parking and drawing in one online game invites players to have an exciting time placing cars. This time, you will not need the ability to drive for this. Draw a route from the car to the parking lot. There will be various obstacles and obstacles on the way. Pave the road so that you can safely go around everything and not crash. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Over time, you will have to park 2 or even 3 cars already. One problem is that they start driving at the same time, so they may collide. Draw a route for each one so that there is no accident. The complexity of the game increases with each level, try to reach the finish line without accidents and take the place assigned by the color of your car</span></p><p><br></p><h3><strong style="color: rgb(0, 0, 0);">Features:</strong></h3><ul><li><span style="color: rgb(0, 0, 0);">A simple touch or mouse control</span></li><li><span style="color: rgb(0, 0, 0);">Fun gameplay</span></li><li><span style="color: rgb(0, 0, 0);">Challenging and interesting levels</span></li></ul>', '', 'An exciting mix of parking and drawing in one online game.', '<ul><li><span style="color: rgb(0, 0, 0);">Swipe your finger to create the perfect path for driving and parking cars. </span></li><li><span style="color: rgb(0, 0, 0);">Be careful and do not create accidents. </span></li></ul>', '');
INSERT INTO public.game_texts VALUES (312, 1, 'Bus Simulator 2021', '<p><span style="color: rgb(0, 0, 0);">You must be curious to drive such vehicles, but you don''t. You want to park your vehicles, but it is also very difficult for you. The best 3D bus parking simulation is what can make it easier for you to park buses, and large vehicles, practice parking and pick up passengers on the bus in 2021.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The best 3D bus parking simulation is what can make it easier for you to park buses, and large vehicles, practice parking and pick up passengers on the bus in 2021.</span></p>', '', '', '<ul><li><span style="color: rgb(0, 0, 0);">Use arrow or WASD to play the game.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (329, 1, 'Impostor.io', '<p><span style="color: rgb(0, 0, 0);">Become the superior life form by defeating other players in Impostor.io! This game is inspired by Among Us and features similar visuals and controls. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The gameplay is completely different: no need to worry about sneaking and pretending. The curtains are down, it’s every man (or alien) for himself. Beat everyone up with various weapons and climb to the top of the leader boards. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Collect energy cubes to level up and become stronger. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Can you survive the battle and become the most powerful impostor in the universe?</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Key Features</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">Fighting in the intergalactic arena will award you some credits. Spend them in the in-game store to buy valuable upgrades. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You can customize the color of your character, and purchase weapons and hats. Having a unique style will make you look a lot more experienced and intimidating. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>If you are a fan of Among Us, don’t hesitate to give this game a try. It’s a hilarious homage to the viral sensation. Unlike the original, it doesn’t require you to communicate with other players. Kill them all one by one, and get the highest score.</span></p>', '', 'Collect cubes and kill other impostors to upgrade in the game.', '<ul><li>WASD or <span style="color: rgb(0, 0, 0);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️ - to move.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">Click to attack other players.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (333, 1, 'Cat Runner', '<p><span style="color: rgb(0, 0, 0);">Run to chase after the robber and explore the endless running worlds of Talking Tom Gold Run! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Enjoy hours of fun with your loved cat, and run to collect gold coins after being robbed in this endless runner game! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Explore new worlds, only racing with fast speed. Go on a running adventure, dodge fast cars and trains as you go after the robber.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Play runner games on Vedia Games!</span></p>', '', 'Chase the robber and explore the endless running world of the cat runner.', '<ul><li><span style="color: rgb(0, 0, 0);">⬅️ - to move left.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">➡️ - to move right.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️ - jump.</span></li><li><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬇️ - slide under.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (389, 1, 'Parkour Block 2', '<p><span style="color: rgb(0, 0, 0);">Parkour Block 2 is a skill game, classic mode from your favorite games right in the browser on your computer and phone! More levels, more mechanics, and more hardcore await you.</span></p>', 'Vedia Games offer the best online Parkour Block 2 game for free. Clear blocks by jumping over them and using your environment to your advantage! No installation & downloads are needed, enjoy!', 'Carefully jump and don''t fall to complete the levels.', '<ul><li><span style="color: rgb(0, 0, 0);">SPACE - to jump. </span></li><li><span style="color: rgb(0, 0, 0);">WASD - to move. </span></li><li><span style="color: rgb(0, 0, 0);">Left Shift - to run. </span></li><li><span style="color: rgb(0, 0, 0);">Double Escape - Menu.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (362, 1, 'Millionaire Trivia Quiz', '<p><span style="color: rgb(0, 0, 0);">Do you want to get rich and become a Millionaire? Win your first $1,000,000 It''s time to test and increase your knowledge! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">An educational quiz game for everyone who wants to have a good time and become smarter. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">This free quiz will become your favorite logic game that you want to play again and again.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>The leader asks questions. You have to choose from 4 answers. Use hints if you don''t know the answer. In case of an incorrect answer, you can take a second chance hint.</span></p>', '', 'Win your first MILLION by answering the questions right.', '<ul><li>Click on the right answers.</li></ul>', '');
INSERT INTO public.game_texts VALUES (514, 1, 'Baby Panda Care', '<p><span style="color: rgb(0, 0, 0);">Baby Panda Care gives players the chance of caring for a baby, a cute baby panda. You might be surprised to find out how much you will enjoy caring for this new baby!</span></p>', '', 'Care for a cute baby panda. Feed it, change its diapers and play with it.', '<ul><li>Use your mouse to play.</li></ul>', '');
INSERT INTO public.game_texts VALUES (514, 2, 'Baby Panda Care', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (371, 1, 'Football Superstars 2022', '<p><span style="color: rgb(0, 0, 0);">Experience football like never before, in this fresh and easy mini football game. Test your skills in a Friendly match, or jump right in and lead your dream team in the World tournament against international teams. Remember, no one ever drowned in sweat!</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Key Features</span></h3><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Endless game </span></li><li><span style="color: rgb(0, 0, 0);">7 international teams to choose </span></li><li><span style="color: rgb(0, 0, 0);">2 game modes </span></li><li><span style="color: rgb(0, 0, 0);">Simple controls </span></li><li><span style="color: rgb(0, 0, 0);">Easy to play</span></li></ul>', '', 'Experience soccer like never before, in this fresh and easy soccer game.', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬅️⬆️➡️⬇️ - to move.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">A - long pass.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">S - pass/switch.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">D - shoot/tackle.</span></li></ul><p><br></p><p>Hold D to aim.</p>', '');
INSERT INTO public.game_texts VALUES (380, 1, 'Princess Villains', '<p><span style="color: rgb(0, 0, 0);">Let''s fantasize a little and imagine our favorite princesses in the form of fabulous villains. Evil queens love dark colors. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Pick up luxurious outfits with gold and red decorations for the princesses. Makeup villains are bright and dark! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>Create the image of a vamp lady. Do not forget about the main accessories of the villains - magic staves, potions, magic wands, wings, and a cloak.</span></p>', '', 'Pick up luxurious outfits with gold and red decorations for the princesses.', '<ul><li>Click on the make-up or different clothing items to choose them for the princesses.</li></ul>', '');
INSERT INTO public.game_texts VALUES (483, 1, 'Bro draw it', '<p><span style="color: rgb(0, 0, 0);">There are many levels in the game that can be challenged, players need to be in accordance with the requirements of the level to cross the line, by clicking the screen to draw the level task graphics, can not interrupt, until the completion of the graphics shown, the game is simple, but can exercise your thinking.</span></p>', '', 'Cover all of the squares with one line.', '<ul><li>Cover all of the squares with just ONE line.</li></ul>', '');
INSERT INTO public.game_texts VALUES (483, 2, 'Bro draw it', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (484, 1, 'Chess Fill', '<p><span style="color: rgb(0, 0, 0);">Color all of the squares on the board by moving chess pieces over them. Chess pieces as they do in the game of Chess. 70 levels to complete!</span></p>', '', 'Color all of the squares on the board by moving chess pieces over them.', '<ul><li><span style="color: rgb(0, 0, 0);">Tap or left click to swipe chess pieces.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (484, 2, 'Chess Fill', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (485, 1, 'Real Chess', '<p><span style="color: rgb(0, 0, 0);">Develop your intelligence with this most realistic chess game! You can play the game for 2 players or against the AI. You can set 4 different difficulty levels against the computer. Level 1 (green) is defined as the easiest and level 4 (red) as the smartest. The game can be played on 8x8 and 6x6 boards. There are also 3D and 2D view options.</span></p>', '', 'Develop your intelligence with a chess game! Play alone or with a friend.', '<ul><li>Grab the piece you want to move and drag it to the place where you want it to be.</li></ul>', '');
INSERT INTO public.game_texts VALUES (485, 2, 'Real Chess', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (486, 1, 'Jump me', '<p><span style="color: rgb(0, 0, 0);">Up for new chessboard logical moves and strategy logic board puzzle? Well, you love the mind-boggling logical challenges of Jump Me – the ultimate Knights Tour checkerboard variation! We made sure to create a chessboard game &amp; logic board puzzle that is both fun, challenging, and brain-teasing, so you can entertain and train your brain at the same time. Play with the Knight &amp; his mighty horse and plan your chess board moves, make good strategy logic decisions, and pass through all levels.</span></p><p><br></p><p><br></p><p><span style="color: rgb(0, 0, 0);">⭐WHY YOU’LL LOVE to JUMP ME⭐ ✅ simple logic board puzzle with checkerboard Knight’s Tour gameplay ✅ chessboard game with exquisite graphics and artwork </span></p><p><span style="color: rgb(0, 0, 0);">✅ Wide array of levels (new levels are added frequently) with various chess board moves and logical moves challenges </span></p><p><span style="color: rgb(0, 0, 0);">✅ collect diamonds and coins to buy boosters </span></p><p><span style="color: rgb(0, 0, 0);">✅ 4 boosters and helpers for the toughest levels </span></p><p><span style="color: rgb(0, 0, 0);">✅ 5 lives &amp; ability to shop more </span></p><p><span style="color: rgb(0, 0, 0);">✅ free logic chess board game</span></p>', '', 'Play with the Knight & his mighty horse and plan your chess board moves.', '<ul><li>Follow the instructions within the game. Click on a square to move to it.</li></ul>', '');
INSERT INTO public.game_texts VALUES (486, 2, 'Jump me', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (487, 1, 'Chess', '<p>Play the standard game of chess on Vedia Games! </p><p><br></p><p><span style="color: rgb(0, 0, 0);">Chess is a two-player strategy board game played on a checkered board with 64 squares arranged in an 8×8 grid.</span></p>', '', 'With strategic and smart moves, try to win a game of chess!', '<ul><li><span style="color: rgb(0, 0, 0);">Click a piece you want to move, a possible tile move with blue or green color will be shown, then click one of them.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (487, 2, 'Chess', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (488, 1, 'Junior Chess', '<p><span style="color: rgb(0, 0, 0);">Junior Chess is the best way to teach younger generations to love this century-old classic (unless you have a grandpa at hand, of course).</span></p>', '', 'The best way to teach younger generations to love this century-old classic.', '<ul><li><span style="color: rgb(0, 0, 0);">Click a piece you want to move, a possible tile move in red color will be shown, then click one of them.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (488, 2, 'Junior Chess', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (511, 1, 'Help me: Time Travel Adventure', '<p><span style="color: rgb(0, 0, 0);">Everyone has been eagerly waiting for it, and now it''s finally here! A fascinating puzzle game where you need to find the right answer. If you pick the wrong choice, the hero won''t be rescued. A game focused on both difficult logic and relaxation, so you''ll have to put your brain into action and use your IQ to solve the puzzles. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">A great, fascinating story is waiting for you, a storyline in which you need to travel through different eras, moving from Ancient Egypt to the Wild West and from Ancient Greece to the future. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">On your path, you will need to solve puzzles to save the girl and her friends. Pull yourself into this fantastic puzzle game, solve complex problems, and engage your brain! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>The game is accompanied by dialogues and hint words for more immersion in the world. It''s easy to understand for everyone, so go through the levels as a family!</span></p>', '', 'Travel through different eras and do the right choices to survive.', '<ul><li>Click to choose.</li></ul>', '');
INSERT INTO public.game_texts VALUES (511, 2, 'Help me: Time Travel Adventure', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (490, 1, 'Chess Move 2', '<p><span style="color: rgb(0, 0, 0);">Defeat the Red King by strategically moving your pieces to get to the Red King''s location. There are 24 challenging levels in this game where you''ll sometimes need to slide the game board halves or use the gravity switcher squares. No time limit in this game so you can take your time and if you get stuck on a level you can always click the Video button on the Main Menu to see the walkthrough video. You don''t need to know how to play chess as the chess pieces in this game will display the squares they can move to when they are clicked. In fact, this can be a good introduction to how chess pieces move!</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Instructions</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">Click on one of your blue chess pieces to highlight where it can move. To move the piece to a highlighted square, click on that square. To complete a level you''ll need to move one of your blue pieces to the square the Red King occupies. More detailed instructions, as well as a walkthrough video, are available in the game via the buttons on the Main Menu.</span></p>', '', 'Defeat the Red King by strategically moving pieces to get to his location.', '<ul><li><span style="color: rgb(0, 0, 0);">Click on one of your blue chess pieces to highlight where it can move. </span></li><li><span style="color: rgb(0, 0, 0);">To move the piece to a highlighted square, click on that square. </span></li><li><strong style="color: rgb(0, 0, 0);">You can mirror the whole board by clicking on the green button at the bottom of the screen.</strong></li><li><span style="color: rgb(0, 0, 0);">To complete a level you''ll need to move one of your blue pieces to the square the Red King occupies. </span></li></ul>', '');
INSERT INTO public.game_texts VALUES (490, 2, 'Chess Move 2', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (491, 1, 'Eliza Queen of Chess', '<p><span style="color: rgb(0, 0, 0);">Elizabeth has an extraordinary gift. She plays chess with genius and takes first place in numerous tournaments. At the same time, Eliza remains a stylish young girl. Choose a dress or suit for a young chess player, or, maybe, you prefer a skirt and a blouse? Don''t forget the elegant accessories. Forward to new victories together with Eliza - the Queen of Chess!</span></p>', '', 'Choose an outfit for Eliza, an extraordinary chess player!', '<ul><li>Click on the items you want to wear.</li></ul>', '');
INSERT INTO public.game_texts VALUES (491, 2, 'Eliza Queen of Chess', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (492, 1, 'Baby Tailor Clothes and Shoes Maker', '<p><span style="color: rgb(0, 0, 0);">Search for “Baby Tailor” for a more free tailor’s series of games for you to enjoy! It''s Fashion Tailor Shop! Now, you play as a little fashion tailor. Have different thoughts about the dress that showed in a shop window? Change it right away! Lots of customers are waiting for your latest design.</span></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Tons of colorful fabrics and fashionable accessories </span></li><li><span style="color: rgb(0, 0, 0);">Offer you an iron machine/sewing machine and other facilities. </span></li><li><span style="color: rgb(0, 0, 0);">Free to select well-designed clothes in the boutique You are able to make all sorts of skirts/sweaters/trousers-shirts</span></li><li><span style="color: rgb(0, 0, 0);">Fashion kids up like never before, match everything for them, including hair style/sunglasses/earrings/dresses/shoes/handbag</span></li></ul>', '', 'Pick your favorite fabric and sew some amazing dresses!', '<ul><li><span style="color: rgb(0, 0, 0);">Pick your favorite fabric. Cut it based on your design, then stitch it with a sewing machine. Choose the cutest buttons and decorate the clothes with shining stickers. Explore new designs in Baby Tailor!</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (492, 2, 'Baby Tailor Clothes and Shoes Maker', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (493, 1, 'Baby Hazel New Born Baby', '<p><span style="color: rgb(0, 0, 0);">Baby Hazel is in the seventh sky! She is very excited about the newly arrived member of her family, and that''s her little brother. She is eagerly waiting for her mother who is going to get a newly born baby at home. Wow! What a great feeling it is! Having a little one in the house brings contentment. The newborn baby has become an apple of Hazel''s eye.</span></p>', '', 'Baby Hazel is very happy since she has a new brother.', '<ul><li>Follow the in-game instructions.</li></ul>', '');
INSERT INTO public.game_texts VALUES (493, 2, 'Baby Hazel New Born Baby', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (494, 1, 'Charge Everything', '<p><span style="color: rgb(0, 0, 0);">Charge Everything -This is a game in which you need to connect all the equipment such as phones, tablets, players, and cars in the sockets bypassing obstacles, you also need to go through closed walls and use windmills to pass the levels.</span></p>', '', 'Connect all of the charges with all the devices. Charge everything!', '<ul><li>Connect the charges with the devices.</li></ul>', '');
INSERT INTO public.game_texts VALUES (494, 2, 'Charge Everything', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (495, 1, 'Chess Move 2', '<p><span style="color: rgb(0, 0, 0);">Defeat the Red King by strategically moving your pieces to get to the Red King''s location. There are 24 challenging levels in this game where you''ll sometimes need to slide the game board halves or use the gravity switcher squares. No time limit in this game so you can take your time and if you get stuck on a level you can always click the Video button on the Main Menu to see the walkthrough video. You don''t need to know how to play chess as the chess pieces in this game will display the squares they can move to when they are clicked. In fact, this can be a good introduction to how chess pieces move!</span></p><p><br></p><h3><span style="color: rgb(0, 0, 0);">Instructions</span></h3><p><br></p><p><span style="color: rgb(0, 0, 0);">Click on one of your blue chess pieces to highlight where it can move. To move the piece to a highlighted square, click on that square. To complete a level you''ll need to move one of your blue pieces to the square the Red King occupies. More detailed instructions, as well as a walkthrough video, are available in the game via the buttons on the Main Menu.</span></p>', '', 'Defeat the Red King by strategically moving pieces to get to his location.', '<ul><li><span style="color: rgb(0, 0, 0);">Click on one of your blue chess pieces to highlight where it can move. </span></li><li><span style="color: rgb(0, 0, 0);">To move the piece to a highlighted square, click on that square. </span></li><li><strong style="color: rgb(0, 0, 0);">You can mirror the whole board by clicking on the green button at the bottom of the screen.</strong></li><li><span style="color: rgb(0, 0, 0);">To complete a level you''ll need to move one of your blue pieces to the square the Red King occupies. </span></li></ul>', '');
INSERT INTO public.game_texts VALUES (495, 2, 'Chess Move 2', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (496, 1, 'Bridge', '<p><span style="color: rgb(0, 0, 0);">It''s not always easy to get your friends together for a game of Bridge these days. Thankfully, now you can play Bridge any time you want with this meticulously crafted online version!</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">This free online Bridge game is always ready to go! Team up with a computerized partner and pit your Bridge skills against two clever AI opponents in this free version of the classic card game.</span></p>', '', 'Team up with a friend against 2 clever AI opponents and try to win!', '<ul><li>Click/Tap on the screen.</li></ul>', '');
INSERT INTO public.game_texts VALUES (496, 2, 'Bridge', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (498, 1, 'Nail Salon for Animals', '<p>We present the nail salon for animals! You can choose 3 different animals and style their nails in the way you like. You have different sizes of brushes, nail colors, and stickers! </p>', '', 'Style the nails of the cute animals as you wish!', '<ul><li>Follow in-game instructions.</li></ul>', '');
INSERT INTO public.game_texts VALUES (515, 1, 'Om Nom Bounce', '<p><span style="color: rgb(0, 0, 0);">Remember ''Om Nom'' from the Cut the Rope mobile games? Our little green friend rolled into a new adventure in ''On Nom Bounce.'' He faces some fierce enemies and bosses which can be eliminated by shooting candy right at them! Aim, shoot, and bounce through 40 challenging levels and 4 different environments. Upgrade your abilities along the way to defeat even the toughest enemies!</span></p>', '', 'Kill Om Nom''s fierce enemies by shooting candy at them.', '<ul><li><span style="color: rgb(0, 0, 0);">Click and hold the mouse button to aim, and release it to shoot. </span></li></ul><p><span style="color: rgb(0, 0, 0);">On mobile: </span></p><ul><li><span style="color: rgb(0, 0, 0);">Tap and hold to aim. Release to shoot.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (515, 2, 'Om Nom Bounce', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (516, 1, 'Ludo Fever', '<p><span style="color: rgb(0, 0, 0);">The main goal of the game is to take all 4 tokens inside the home area before the other opponents. Roll the dice and move forward. Watch out, don''t let your opponents kick your token back to their starting position.</span></p>', '', 'Take all 4 tokens inside the home area before the other opponents.', '<ul><li>Click to play.</li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">- Take all 4 tokens inside the home area before the other opponents. </span></p><p><span style="color: rgb(0, 0, 0);">- Roll the dice and move forward. </span></p><p><span style="color: rgb(0, 0, 0);">- Watch out, don''t let your opponents kick your token back to their starting position.</span></p>', '');
INSERT INTO public.game_texts VALUES (516, 2, 'Ludo Fever', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (517, 1, 'Flip Bottle', '<p><span style="color: rgb(0, 0, 0);">Explore different rooms, and jump on all sorts of objects: shelves, tables, chairs, sofas, and even subwoofers! Make the bottle jump or even double flip. How? Just tap the screen at the right moment and jump!</span></p>', '', 'Flip the bottle to get to the end goal without falling down.', '<ul><li>Click to flip the bottle.</li><li>Double click for the bottle to fly higher. </li></ul>', '');
INSERT INTO public.game_texts VALUES (517, 2, 'Flip Bottle', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (518, 1, 'RCC Car Parking 3D', '<p><span style="color: rgb(0, 0, 0);">Do you like parking cars? Try RCC Car Parking 3D in unique 100 levels, your mission is to drive the car carefully without hitting walls, barriers, and other objects. Look at the minimap to see where is your finish to drive your care there. We update the game every day with a new parking mission.</span></p>', '', 'Drive the car carefully, without hitting any objects. Park the car safely. ', '<p><span style="color: rgb(0, 0, 0);">WASD or </span><span style="color: rgb(0, 0, 0); background-color: rgb(22, 35, 80);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span><span style="color: rgb(0, 0, 0);"> -  to drive the car. </span></p><ul><li><span style="color: rgb(0, 0, 0);">TAB/ESC/P - show menu</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (518, 2, 'RCC Car Parking 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (519, 1, 'Realistic Parking', '<p><span style="color: rgb(0, 0, 0);">As a professional driver, you are required to park the car at the pointed yellow square. Glad you will unlock more vehicles in the garage and have fun!</span></p>', '', 'Park the car at the pointed yellow square.', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️➡️ or WASD - to drive.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (519, 2, 'Realistic Parking', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (520, 1, 'Parking Fury 3D: Beach City', '<p><span style="color: rgb(0, 0, 0);">Get ready to drive through narrow streets, park in difficult places, and steal cars while you avoid the police. There''s plenty to do and see in Parking Fury 3D: Beach City</span></p>', '', 'Park in difficult places, steal cars and more while avoiding the police.', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(0, 0, 0);">⬅️</span><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️➡️ - to drive.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (520, 2, 'Parking Fury 3D: Beach City', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (521, 1, '2 Player Police Racing', '<p><span style="color: rgb(0, 0, 0);">Play 2 Player Police Racing free of charge and experience the adventure of driving at high paces through the city as you beat your adversaries to the end goal.</span></p>', '', 'Exciting and challenging race with the police.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD or </span><span style="color: rgb(0, 0, 0); background-color: rgb(22, 35, 80);">⬅️</span><span style="color: rgb(255, 255, 255); background-color: rgb(22, 35, 80);">⬆️➡️</span><span style="color: rgb(0, 0, 0);"> - to drive.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (521, 2, '2 Player Police Racing', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (523, 1, 'Perfect Ironing', '<p><span style="color: rgb(0, 0, 0);">Like to iron and make clothes tidier? Hold the iron and smooth the wrinkles in our relaxing game! Go through exciting levels and make the world a little smoother. Strangely satisfying app for free! Do you take deep pleasure in doing house chores to perfection? Then, our “perfect ironing game” is the anti-stress app you shouldn''t miss out on! Iron out different types of clothes and feel enormous satisfaction! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Come on, play one of the best oddly “satisfying games” for girls, smooth out those wrinkles and become extremely good at ironing clothes! Perfect Ironing: Satisfy your Inner Perfectionist Fun “satisfying ASMR” games for kids and adults as well; </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Choose the color for your ironing board; Drag your finger around to iron the clothes; If you do it within the given time, you go to the next level; With every level, new clothing items to iron; Steamy ASMR sounds that will relax and soothe every user! </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Now you can really have fun while doing house chores with this princess dress-up game. Here you can sort the toys and clothes, wash them, and iron the clothes before dressing up in a nice clean outfit. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);"><span class="ql-cursor">﻿</span>With so much cleaning and ironing fun to be had, any princess will look their best after doing her chores with this funny game.</span></p>', '', 'Hold the iron and smooth the wrinkles on each piece of clothing.', '<ul><li>Hold your click and slide to iron the clothes.</li></ul>', '');
INSERT INTO public.game_texts VALUES (523, 2, 'Perfect Ironing', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (524, 1, 'Spider Solitaire Blue', '<p><span style="color: rgb(0, 0, 0);">Spider Solitaire Blue brings one of the most popular styles of Solitaire to the palm of your hand. Featuring the 3 classic gameplay modes: one-suit, two-suits, and four-suits, Spider Solitaire guarantees fun and brain teasing for hours to come. Combined with the highly polished graphics that Softgames Solitaire Games are known for, this is a must-play for all Solitaire players in 2022. Enjoy this card game masterpiece!</span></p>', '', 'One of the most popular solitaires featuring 3 modes.', '<ul><li>Click on the cards.</li></ul>', '');
INSERT INTO public.game_texts VALUES (524, 2, 'Spider Solitaire Blue', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (525, 1, 'Wizard School', '<p><span style="color: rgb(0, 0, 0);">In the modern world, some children are born with magical powers. And there is a particular school specializing in teaching them how to use wands and control powers. Build your own wizard school. Come join us to build and manage a wizard school！</span></p>', '', 'Build your own wizard school. Teach muggles to be wizards.st', '<ul><li>Click to play the game.</li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">Build your own wizard school by accepting new muggles, turning them into wizards and teaching them about the magic world.</span></p>', '');
INSERT INTO public.game_texts VALUES (525, 2, 'Wizard School', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (526, 1, 'Winx Club: Love and Pet', '<p><span style="color: rgb(0, 0, 0);">Follow the Winx Club girls in this puzzle match adventures! Every level is packed with the cutest little animals. It''s up to you to match them and finish the level within number of moves. Are you able to collect all the points and reach 3 stars in each level? Make sure to connect the animals that can clear a whole row!</span></p>', '', 'Can you match all of the cute animals on time and get 3 stars?', '<ul><li><span style="color: rgb(0, 0, 0);">Click / Tap and Drag to connect animals of the same color.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (526, 2, 'Winx Club: Love and Pet', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (527, 1, 'People Onet', '<p><span style="color: rgb(0, 0, 0);">People Onet is a popular and addictive online Puzzle pair matching game with different game modes and difficulties. In this puzzle game, the goal is to remove all tiles by connecting pairs of matching tiles. Connect the same tiles within 3 lines. Spend less time and connect farther tiles to get 3-star to unlock new cities.</span></p><p><br></p><p><br></p><p><span style="color: rgb(0, 0, 0);">– Easy &amp; relaxing matching game mechanics. </span></p><p><span style="color: rgb(0, 0, 0);">– Inspired by the classic Mahjong game. – Two types of gameplay: Story Mode and Random Play. </span></p><p><span style="color: rgb(0, 0, 0);">– 111+ different cities with different people. </span></p><p><span style="color: rgb(0, 0, 0);">– Gets harder for higher levels with more people and types of pairs. </span></p><p><span style="color: rgb(0, 0, 0);">– Use Hint/Shuffle to overcome the difficulty. </span></p><p><span style="color: rgb(0, 0, 0);">– 176 types of people''s faces</span></p>', '', 'A popular pair matching game inspired by the classic Mahjong.', '<ul><li><span style="color: rgb(0, 0, 0);">Click to connect 2 same tiles.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (527, 2, 'People Onet', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (528, 1, 'Stickman Archero Fight', '<p><span style="color: rgb(0, 0, 0);">Upgrade your stickman, and fight enemies in the Stickman Archer game. Create cool and dynamic fatalities. Lots of magic and battles! The game is similar to SupremeDuelistStickman. Fights in the village with other stickmen.</span></p>', '', 'Upgrade your stickman, and fight enemies in the Stickman Archer game. ', '<ul><li>WASD - to move.</li><li>E - to collect items.</li><li>Left click - to punch/shoot...</li></ul>', '');
INSERT INTO public.game_texts VALUES (528, 2, 'Stickman Archero Fight', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (529, 1, 'BMX Kid', '<p><span style="color: rgb(0, 0, 0);">BMX Kid is an easy-to-play game for kids as well as adults. It is one of the best bike cycling racing games with Cool stunts, Mad tricks, and Amazing Graphics! Test your skills on impossible paths and unleash your inner stuntman rider. Do awesome and extreme stunts and tricks such as wheelies, flips, and grinds!</span></p>', '', 'Test your skills on impossible paths and unleash your inner stuntman rider.', '<ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️ - to jump.</span></li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">➡️ - to speed.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (529, 2, 'BMX Kid', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (384, 1, 'I''m not a Monster: Wanna Live', '<p><span style="color: rgb(0, 0, 0);">Have you ever felt curious about Huggy Wuggy''s history before becoming so vengeful in an abandoned toy factory? Let''s find out and save our beloved friend. Based on a theory about Poppy Animation, this game tells you a story about the adventure of a girl to rescue her childhood toy - Huggy Wuggy. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">You will play the role of that girl and complete all the tricky level games. At the beginning of the chapter, Huggy is seen contained within a glass case. Huggy Wuggy just needs your hug. He is not a monster. Try to give him your warm hand and bring him alive.</span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">﻿Follow the guideline to open Huggy''s case. Use your brain IQ to identify the rule. Take advantage of the GrabPack magic backpack during Poppy Playtime. Use Blue Hand and Red Hand to hack electrical circuits or grab anything from afar.</span></p>', '', 'Hack the electrical circuits to free Huggy Wuggy from his cage.', '<p><span style="color: rgb(0, 0, 0);">Use Blue Hand and Red Hand to hack electrical circuits and to save the Huggy Wuggy.</span></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Click and drag the hands to their place.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (534, 1, 'Real Sports Flying Car 3D', '<p><span style="color: rgb(0, 0, 0);">Thinking about flying cars has always been exciting and fun in mind. Well, that idea is now just become a flying car game and your car game is now also one of the flying games as well. Now you can become a car driver and flying pilot as well with a single push of a button. Explore more hidden features of your flying car simulator game as it might do flips and big jumps from the air when you turn off the flying feature in the air. Just drive or take a flight on your very own car which is now not less than an airplane.</span></p>', '', 'Drive around the city, do flips and big jumps, accomplish the tasks.', '<ul><li><span style="color: rgb(0, 0, 0);">WASD - to move.</span></li><li><span style="color: rgb(0, 0, 0);">C -Cursor Lock/Unlock.</span></li><li><span style="color: rgb(0, 0, 0);">R - Reset Car.</span></li><li><span style="color: rgb(0, 0, 0);">Left Shift – Nitro.</span></li><li><span style="color: rgb(0, 0, 0);">F - Flying/Landing.</span></li><li><span style="color: rgb(0, 0, 0);">I -Instructions.</span></li><li><span style="color: rgb(0, 0, 0);">P/Esc -Pause.</span></li></ul>', '');
INSERT INTO public.game_texts VALUES (534, 2, 'Real Sports Flying Car 3D', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (535, 1, 'Black Stallion Cabaret', '<p><span style="color: rgb(0, 0, 0);">What else do you need if you have an armored train? That''s right, a whole train carriage full of charming dancers! Get them through the whole country entertain the public in towns, improve your train and repel the attacks of monsters. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The game''s goal is to get the dancers through the whole country and protect them from monsters. In the game''s primary mode, you need to merge items you create in the workshop to increase their level and improve weapons, dancers, and the workshop. It would help if you had weapons to defend against many monsters you''ll meet on your way. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">The battles are automatic. You have 30 seconds to eliminate a squad of monsters. Dancers give performances in towns and get rewards including details for the train cars. With details, you can buy new train cars and improve the current ones.</span></p><p><br></p><h3>Instructions</h3><p><br></p><p><span style="color: rgb(0, 0, 0);">- Merge items and increase their level. The higher the level of an item, the more points it gives while using it. </span></p><p><span style="color: rgb(0, 0, 0);">- Items are used for improving weapons, dancers, and the workshop. Double click on an item to use it. </span></p><p><span style="color: rgb(0, 0, 0);">- Defeat the monster squads to move to the next town. </span></p><p><span style="color: rgb(0, 0, 0);">- Get carriage parts in the town and level up your train. The number of parts depends on the level of dancers. </span></p><p><span style="color: rgb(0, 0, 0);">- The level of the workshop influence the maximum level of crafted items and the size of the warehouse.</span></p>', '', 'Get the dancers through the whole country and protect them from monsters.', '<p>Get the dancers through the whole country and protect them from monsters.</p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Merge items you create in the workshop to increase their level and improve weapons</span></li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">Dancers give performances in towns and get rewards including details for the train cars. With details, you can buy new train cars and improve the current ones.</span></p><p><span style="color: rgb(0, 0, 0);">The battles are automatic.</span></p>', '');
INSERT INTO public.game_texts VALUES (535, 2, 'Black Stallion Cabaret', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (536, 1, 'Move the Pin 2', '<p><span style="color: rgb(0, 0, 0);">Move The Pin 2 is a game in which you need to fill a glass with colored balls. </span></p><p><br></p><ul><li><span style="color: rgb(0, 0, 0);">Paint the gray balls with a colored bomb, </span></li><li><span style="color: rgb(0, 0, 0);">The red prickly pins and bombs can destroy the balls.</span></li><li><span style="color: rgb(0, 0, 0);">Some foams are blocked.</span></li></ul>', '', 'Feel the glass with colored balls without destroying any of them.', '<ul><li>Use your mouse to play the game.</li></ul><p><br></p><p><span style="color: rgb(0, 0, 0);">Paint the gray balls with a colored bomb.</span></p><p><span style="color: rgb(0, 0, 0);">The red prickly pins and bombs can destroy the balls.</span></p>', '');
INSERT INTO public.game_texts VALUES (536, 2, 'Move the Pin 2', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (537, 1, 'Friday Night Funki Big Brother', '<p><span style="color: rgb(0, 0, 0);">Have fun with this new game Friday night Funki Big Brother a new game in this fabulous saga !! Play the ritual of each music, press the game buttons at the right time and accumulate the points to show that you are the best. All your favorite characters are here Big Brother, Boyfriend and many others are waiting for you.</span></p><h3><br></h3><h3><span style="color: rgb(0, 0, 0);">Characteristics and Objective: </span></h3><h3><br></h3><p><span style="color: rgb(0, 0, 0);">Try to beat Big Brother in a rap battle with the best songs but follow the rhythm and try to be very precise to improve your score. Improve your score with each attempt. </span></p>', '', 'Try to beat Big Brother in a rap battle with the best songs.', '<ul><li>Use the arrows on your keyboard at the right time.</li></ul>', '');
INSERT INTO public.game_texts VALUES (537, 2, 'Friday Night Funki Big Brother', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (538, 1, 'Geometry Rash Challenge', '<p><span style="color: rgb(0, 0, 0);">Geometry Rush Challenge is an online game that you can play for free. Your objective is to go through all obstacles, collect as many stars as possible, and hit the finish line. Shop new characters when collecting stars. Have fun.</span></p>', '', 'How far can you get with all of the obstacles in your way?', '<ul><li>Click at the right time to avoid the obstacles on the way.</li></ul>', '');
INSERT INTO public.game_texts VALUES (538, 2, 'Geometry Rash Challenge', '', '', '', '', '');
INSERT INTO public.game_texts VALUES (539, 1, 'Subway Surfers St. Petersburg', '<p>Ready for a new adventure in Subway Surf St. Petersburg? Get down into the subway and don''t let the grumpy inspector grab you. Good luck!</p><p><br></p><p>Subway Surfers is a popular, endless runner game that almost everyone played as a kid. You are trying to run away from the police officer while facing different obstacles such as trains, trams, and others. </p><p><br></p><h3><strong>Challenge</strong></h3><p><br></p><p>As you run, you become quicker, which makes it harder to dodge the obstacles in your way. The farther you get, the score you have is better.</p><p><br></p><h3><strong>Awards</strong></h3><p><br></p><p>Collect coins as you run to unlock new interesting characters, boards, and lots of fun stuff.</p><p><br></p><p>From awards you get keys. They give you the chance to customize your characters and upgrade your hoverboards.</p><p><br></p><h3><strong>How to play</strong></h3><p><br></p><p>You can play with your keyboard arrows or with your mouse.</p><p><br></p><p><br></p><p class="ql-align-center">Overall, Subway Surfers is an amazingly addictive game suited for everyone. Created by Sybo and Kiloo in 2012, it is still one of the most played games today.</p><p class="ql-align-center"><br></p><p><br></p>', '', 'An endless runner game where you''re trying to escape by avoiding obstacles.', '<p>Use keyboard arrows or your mouse.</p><p><br></p><p><strong>Keyboard:</strong></p><ul><li><span style="background-color: rgb(22, 35, 80); color: rgb(0, 0, 0);">⬅️/</span><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">➡️</span> - to move left / right.</li><li><span style="background-color: rgb(22, 35, 80); color: rgb(255, 255, 255);">⬆️</span> - to jump.</li><li>⬇️ - to roll.</li><li>Spacebar -  to activate hoverboard.</li></ul><p><br></p><p><strong>Mouse:</strong></p><ul><li>Swipe left / right - to move left / right.</li><li>Swipe up - to jump.</li><li>Swipe down - to roll.</li><li>Double click - to activate hoverboard.</li></ul>', '');
INSERT INTO public.game_texts VALUES (539, 2, 'Subway Surfers St. Petersburg', '<p><br></p>', '', '', '', '');
INSERT INTO public.game_texts VALUES (427, 1, 'Hotel Hideaway', '<p><span style="color: rgb(0, 0, 0);">Jump into the world of Hotel Hideaway: a social online 3D role-playing game full of opportunities to meet new people and make new friends. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Dress to impress and stand out from the crowd with an abundance of stylish clothing, items, and accessories. </span></p><p><br></p><p><span style="color: rgb(0, 0, 0);">Customize your room with a variety of furniture items and decorations. Learn secret gestures and dance moves - and then party into the early hours!</span></p>', 'DELETED BECAUSE IT IS NOT AVAILABLE ON GAME DISTRIBUTION ANYMORE', 'Jump into the world of Hideaway: a role-playing game full of opportunities.', '<ul><li>Use your mouse to click around and interact with the game.</li></ul>', '');
