INSERT INTO public.tag_texts VALUES (1, 1, 'Hypercasual', 'Hypercasual games are considered to be those that take little time to produce and have a minimalistic interface with instinctive and intuitive game play without tutorials or incorporation. They can be played and enjoyed immediately, by anyone, of any age. The sessions are short, but a lot of fun.', '', 'Extremely engaging, instantly playable, and lightweight games. ');
INSERT INTO public.tag_texts VALUES (1, 2, 'Hipercasual', 'Los juegos Hipercasuales son considerados los que tomaron poco tiempo para producir y tienen una interfaz minimalista con juego instintivo e intuitivo sin tutoriales ni incorporación. Se pueden jugar y disfrutar de inmediato, por cualquier persona, de cualquier edad. Las sesiones son cortas, pero muy divertidas.', '', 'Juegos extremadamente atractivos, jugables al instante y ligeros.');
